INSERT INTO `phpbb_posts_text` VALUES (79,'71b51083a5','Needed:  Jalapeno Mead Recipe','I have 12# of honey and 15 jalapeno\'s just waiting for a good recipe.  Thinking of 1 big jalapeno per gallon plus some cinnamon.  Want mead to be sweet and fruity with a slight heat finish.  \r\n\r\nAny suggestions?\r\n\r\n :cheers:');
