INSERT INTO `phpbb_posts_text` VALUES (2272,'7053442cf1','Meeting','OK, here it is.  I found my note from our last meeting.\r\nWe had decided to have the meeting at Inakya on St Andrews Rd on the 27th (today!)\r\n\r\nSince we met at your house last time, Chris, we should meet on the other side of the river tonight.\r\n\r\nInakya on St Andrews Road, 6:30 tonight.  Pete will save us a table.\r\nSee ya tonight.\r\nCheers!');
INSERT INTO `phpbb_posts_text` VALUES (81,'261300a15e','Hot Chilie recipie','Got mead is an ok website for mead recipies.  Here is a link to one that uses Chilies.\r\nhttp://www.gotmead.com/component/option,com_pccookbook/page,viewrecipe/cat_id,11/recipe_id,81/');
INSERT INTO `phpbb_posts_text` VALUES (82,'fadafacaf9','','Ok. Here\'s what I used: \r\n\r\n12.07# Local wildflower honey \r\n2# pineapple slices \r\n2 mangos \r\n15 medium to large jalapenos peppers \r\n5 dried chipotle peppers \r\n1 bundle cilantro \r\n4tsp yeast energizer \r\n1 packet Lalvin Wine yeast, ICV D-47 \r\n\r\nAll fruits and peppers were chopped &amp; the entire mix was boiled 15min. \r\n\r\n5 gallons. \r\n\r\nOG 1.085 \r\n\r\nI expect (even if I have to stop fermentation) FG at 1.005 - 1.010.\r\n\r\nPlan on doing the acid balancing in the secondary so as to not impede fermentation (trying something new).\r\n\r\nAlso, I don\'t expect this one to redesign my laundry room like the cherry mead did. \r\n\r\n[img:fadafacaf9]http://img376.imageshack.us/img376/5618/cherrymeaddecor038ta.jpg[/img:fadafacaf9]\r\n\r\n :? \r\n\r\nYeah, I\'m still using the same blow-off tube but this time I got a trick...');
