INSERT INTO `phpbb_posts_text` VALUES (2268,'f172062c44','Meeting','You all will have to excuse me, but I can\'t remember which Inakaya we are meeting at tonight.\r\nO\'neal Court or St. Andrews Rd?\r\n :oops:');
INSERT INTO `phpbb_posts_text` VALUES (4136,'90a77d96fa','','Heretofore left unasked is the (I believe) pertinent question of:\r\n\r\nWhy in the name of holy hell should it be illegal for a private citizen to send beer to a private recipient via private carrier? \r\n\r\nSeriously, the government seems to love to come down on alcohol \"just because.\" Half the time, there appears to be no proper justification for it.\r\n\r\nOn a side note, I recently shipped some beer to a friend by way of the UPS Store ... Without even thinking I included his nickname \"Beeriac\" on the address label. As soon as I got to the counter at the store I knew this was stupid of me. But they never asked any questions.');
INSERT INTO `phpbb_posts_text` VALUES (4132,'4ef01402f0','party?','Dan- you really suck!\r\n\r\nPlan it for after new years sometime and we\'re game.\r\n\r\n It\'s gonna be a hectic next two weeks. Thankfully, the keg of hoppyyum will come through and it will all be worth the stress.');
