INSERT INTO `phpbb_posts_text` VALUES (3397,'338f6e43dc','How often are restaurants inspected?','Many folks ask how ofter food facilities are inspected in SC.  What do you think?');
INSERT INTO `phpbb_posts_text` VALUES (3399,'09eaabdbf9','','I sincerely hope it is more often than my guess.  \r\n\r\nI just read your other post about the common things that can get a restaurant dinged on their inspection.  A favorite place of mine recently was demoted to a \'B\' because staff were eating in the kitchen and some of the dishes were stored damp.  They were able to get their A rating restored within 24hrs.  Is there some type of appeal period where the owner can request a re-inspection shortly after a bad inspection?');
INSERT INTO `phpbb_posts_text` VALUES (84,'1ed15e73f9','Old Crusty Clone','This is my attempt at Rogue\'s Old Crustacean Barleywine. It is modeled after the 2005 year. I might harvest some Pacman yeast from a bottle to try with this one. \r\n\r\n :cheers: \r\n\r\n\r\n[code:1:1ed15e73f9]Old Crusty \r\n\r\nRecipe Specifics \r\n---------------- \r\n\r\nBatch Size &#40;Gal&#41;&#58;         5.50    Wort Size &#40;Gal&#41;&#58;    5.50 \r\nTotal Grain &#40;Lbs&#41;&#58;       22.25 \r\nAnticipated OG&#58;          1.106    Plato&#58;             24.99 \r\nAnticipated SRM&#58;          10.8 \r\nAnticipated IBU&#58;         111.0 \r\nBrewhouse Efficiency&#58;       73 % \r\nWort Boil Time&#58;             90    Minutes \r\n\r\nGrain/Extract/Sugar \r\n\r\n   %     Amount     Name                          Origin        Potential SRM \r\n----------------------------------------------------------------------------- \r\n 80.9    18.00 lbs. Pale Malt&#40;2-row&#41;              America        1.036      2 \r\n  3.4     0.75 lbs. Crystal 60L                   America        1.034     60 \r\n 15.7     3.50 lbs. Munich Malt&#40;2-row&#41;            America        1.035      6 \r\n\r\nPotential represented as SG per pound per gallon. \r\n\r\n\r\nHops \r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time \r\n----------------------------------------------------------------------------- \r\n  1.00 oz.    Cascade                           Whole    4.00   9.5  60 min. \r\n  1.00 oz.    Centennial                        Pellet  10.00  26.1  60 min. \r\n  0.75 oz.    Cascade                           Whole    4.00   6.8  50 min. \r\n  0.75 oz.    Centennial                        Pellet  10.00  18.6  50 min. \r\n  0.50 oz.    Cascade                           Whole    4.00   4.2  40 min. \r\n  0.50 oz.    Centennial                        Pellet  10.00  11.4  40 min. \r\n  0.50 oz.    Cascade                           Whole    4.00   3.6  30 min. \r\n  0.50 oz.    Centennial                        Pellet  10.00  10.0  30 min. \r\n  0.50 oz.    Cascade                           Whole    4.00   2.9  20 min. \r\n  0.50 oz.    Centennial                        Pellet  10.00   7.9  20 min. \r\n  0.50 oz.    Cascade                           Whole    4.00   1.7  10 min. \r\n  0.50 oz.    Centennial                        Pellet  10.00   4.7  10 min. \r\n  0.50 oz.    Cascade                           Whole    4.00   0.9  5 min. \r\n  0.50 oz.    Centennial                        Pellet  10.00   2.6  5 min. \r\n\r\n\r\nYeast \r\n----- \r\n\r\nWhite Labs WLP002 English Ale[/code:1:1ed15e73f9]');
INSERT INTO `phpbb_posts_text` VALUES (91,'a43a1eebdf','Vanilla Blonde Ale','This is a great session Beer.\r\n\r\n\r\n\r\n[code:1:a43a1eebdf]Sweet Southern Blonde Ale\r\n\r\nA ProMash Recipe Report\r\n\r\nBJCP Style and Style Guidelines\r\n-------------------------------\r\n\r\n03-A  Light Ale, Blonde Ale\r\n\r\nMin OG&#58;  1.045   Max OG&#58;  1.060\r\nMin IBU&#58;    15   Max IBU&#58;    33\r\nMin Clr&#58;     2   Max Clr&#58;     8  Color in SRM, Lovibond\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size &#40;Gal&#41;&#58;         5.50    Wort Size &#40;Gal&#41;&#58;    5.50\r\nTotal Grain &#40;Lbs&#41;&#58;       10.50\r\nAnticipated OG&#58;          1.051    Plato&#58;             12.70\r\nAnticipated SRM&#58;           3.5\r\nAnticipated IBU&#58;          17.6\r\nBrewhouse Efficiency&#58;       75 %\r\nWort Boil Time&#58;             90    Minutes\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 85.7     9.00 lbs. Pale Malt&#40;2-row&#41;              America        1.036      2\r\n  4.8     0.50 lbs. Cara-Pils Dextrine Malt                      1.033      2\r\n  4.8     0.50 lbs. Wheat Malt                    America        1.038      2\r\n  4.8     0.50 lbs. Flaked Soft White Wheat       America        1.034      2\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n  0.75 oz.    Hallertauer                       Pellet   4.50  12.8  60 min.\r\n  0.50 oz.    Saazer                            Pellet   4.30   4.1  15 min.\r\n  0.50 oz.    Saazer                            Pellet   4.30   0.7  2 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP001 California Ale\r\n\r\n\r\n\r\nNotes\r\n-----\r\n2 Vanilla beans, sliced down center, contents scooped out and disgarded. Chop up 2 Vanilla Beans and add to a small shot glass. Soak in vodka for 1week. Pour vanilla beans and Vodka in hop bag and secondary for 2weeks.\r\n\r\n\r\n[/code:1:a43a1eebdf]');
