INSERT INTO `phpbb_posts_text` VALUES (4125,'dea296bfa0','','Looks yummy!  Looking at this I can\'t see much difference from a basic swartzbeer recipe so I guess they are kinda kissing cousins-   I always thought the Vienna was closer to a Octoberfest with some munich/vienna malt aroma.  Does the German Crystal have the same aroma that munich malt does?  I assume you are talking about caramunich I (40L) and III (70L) when you mention German Crystal.\r\n\r\nThe only Negro Modelo\'s I\'ve had have been pretty rough-  most likely quite stale!\r\n\r\nThanks Harold!   I am beginning to think that everyone has lied to me when they said you where a curmudgeon.\r\n\r\n :cheers: \r\n\r\nChris');
