INSERT INTO `phpbb_posts_text` VALUES (4123,'41cff18b84','','The late George Fix was America\'s (and likely one of the the world\'s) authority on Vienna.  He lists Noche Bueno (a seasonal beer, seldom seen in the US) and Negro Mondelo as the best then extant versions of a Vienna if the Negro Mondelo is very fresh.  These comments were made in 1991 in his and his wife\'s book \"Marzen, Oktoberfest and Vienna\" AHA Classic Beer Styles #4.  I had the opportunity to discuss this with George in 1998 and he still held much the same opinion.\r\n\r\nHis recipe for 5 gals of a \"Basic Dreher Vienna\":\r\n\r\nPils  7.5#\r\nGERMAN lt crystal  6 oz.\r\nGERMAN dk crystal 6 oz\r\nEnglish Caramel malt (L 120) 6 oz.\r\n\r\nHops were noble with a recommendation for Tettanger used to provide the hop profile appropriate for a Vienna.\r\n\r\nGerman \r\nLight Crystal\r\n(20 L Caramel)\r\n \r\n German Caramel malt adds balance and body to pilsner styles. \r\n \r\n \r\nGerman \r\nMedium Crystal\r\n(50 L Caramel)\r\n \r\nGerman Caramel malt adds color, sweetness and body to lagers styles. \r\n \r\n \r\nGerman \r\nDark Crystal\r\n(90-110 L Caramel)\r\n \r\nGerman Caramel malt imparts a very pronounced sharp caramel color, and body to dark lagers styles. \r\n\r\nConsidering the largis amount of 120 used I think the dark referred to in the recipe was probably medium crystal (in some places the medium is referred to as dark)');
