INSERT INTO `phpbb_posts_text` VALUES (116,'cede9ccbdd','Re: stoopid question that I WILL ask','[quote:cede9ccbdd=\"Katherine\"]what is a session beer? *)[/quote:cede9ccbdd]\r\n\r\nA session beer is typically a beer that you could enjoy pint after pint and leaves your pallet craving for more. \r\n\r\nMy session beers usually start around 75ibus 8) This is one is a exception because the wife loves it. :wink:');
INSERT INTO `phpbb_posts_text` VALUES (170,'929d123a6e','Dusseldorf Alt','ALT\r\n\r\nA ProMash Recipe Report\r\n\r\nBJCP Style and Style Guidelines\r\n-------------------------------\r\n\r\n07-C  Amber Hybrid Beer, Dusseldorfer Altbier\r\n\r\nMin OG:  1.046   Max OG:  1.054\r\nMin IBU:    35   Max IBU:    50\r\nMin Clr:    13   Max Clr:    17  Color in SRM, Lovibond\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size (Gal):         5.00    Wort Size (Gal):    5.00\r\nTotal Grain (Lbs):       11.69\r\nAnticipated OG:          1.059    Plato:             14.40\r\nAnticipated SRM:          17.2\r\nAnticipated IBU:          46.6\r\nBrewhouse Efficiency:       68 %\r\nWort Boil Time:             90    Minutes\r\n\r\nHop IBU Formula Used: Rager\r\n\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 21.4     2.50 lbs. Pale Malt(2-row)              America        1.036      2\r\n  8.6     1.00 lbs. Wheat Malt                    America        1.038      3\r\n 68.4     8.00 lbs. Munich Malt                   Germany        1.037     10\r\n  1.6     0.19 lbs. Chocolate Malt                Great Britain  1.034    475\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n 49.61 g.     Spalter Select                    Whole    6.20  46.6  60 min.\r\n 14.18 g.     Spalter Select                    Whole    6.20   0.0  0 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP029 German Ale/Kolsch\r\n\r\nNotes\r\n------\r\n\r\nThis formula is adjusted for batch sparge.\r\n1st Place PSBO7');
