INSERT INTO `phpbb_posts_text` VALUES (4120,'9bc023fc52','Has anyone done a good vienna?','Phil and I are going to do a Samiclaus this spring and are thinking of a good starter!  Mr. Malty says we need a 5.57 gallon starter so we might as well just do a \"small\" beer.\r\n\r\nA couple guys on the Greenboard have mentioned John Palmer\'s Klangfreudenfestbier Vienna Lager.   I personally have no clue about the style-  never tasted one-  I\'ve heard Negro Model is close but I think they changed the receipe a few years ago and are not close anymore.\r\n\r\nI\'d love to hear your guys and gals expert advice-\r\n\r\nJohn Palmer\'s Klangfreudenfestbier Vienna Lager\r\n\r\n7.00 lbs. Pilsener Germany\r\n2.00 lbs. Vienna Malt\r\n0.50 lbs. Crystal 40L \r\n0.25 lbs. Crystal 75L \r\n0.25 lbs. Crystal 120L\r\n0.50 oz. Santiam Pellet 6.00 13.4 60 min.\r\n1.25 oz. Liberty Pellet 4.00 11.4 30 min.\r\n0.50 oz. Liberty Pellet 4.00 2.4 15 min.\r\n\r\nMash 11q H2O @152\r\n\r\nThanks in Advance!\r\n\r\nChris');
INSERT INTO `phpbb_posts_text` VALUES (4118,'6d81f9802d','','Mine is 5/16 gas line and I *think* 1/4\" beer line.  But for short term as long as you have clamps or boiling water you can get it to work-   I\'ve fit a 3/16 beer line on a 5/16 barb in a pinch!\r\n\r\nThanks for bringing your beer gun-   I look forward sharing the leftovers!');
INSERT INTO `phpbb_posts_text` VALUES (4127,'ae14075cda','','Sounds like a fine idea to me! We\'re here and there so the timing may be a bit difficult but if we can I\'d like to. Perhaps the host can provide all of the Allagash items as a gesture of Christmas cheer.... just thinking out loud.  :devil:');
INSERT INTO `phpbb_posts_text` VALUES (148,'1ec730cc77','Looks good','Just back from vacation.  Your recipie looks good and I hope your ceiling fairs better this year.  \r\nYou are making a good choice in waiting untill secondary to make your acid blend, just remember that the acidity will fade over time and the flavor profile will change from year to year.  Watch your alcohol content and don\'t be afraid to stop frementation early if you think that the FG is right.');
INSERT INTO `phpbb_posts_text` VALUES (150,'57d73e702b','','I plan on watching the FG but desperately want a semi-sweet to sweet finish.  I\'ve read in the past about how to halt fermentation but can\'t remember.  After asking around the consensus seems to be that to make a sweet mead you must wait until fermentation is complete, rack then add additional honey.  If that is what needs to be done then I will but I\'d rather my FG end at . 05 or .10.  \r\n\r\nAny Ideas?\r\n\r\nAlso thinking of acid balancing with key lime juice rather than with citric acid.  Has anyone else tried that?  Help?\r\n\r\n :?');
INSERT INTO `phpbb_posts_text` VALUES (4511,'36ade0da4f','','I believe that a sponsoring club gets points for the AHA club of the year award.');
INSERT INTO `phpbb_posts_text` VALUES (4512,'d5dbc60687','February Meeting Synopsis','February Meeting Synopsis: \r\n\r\n21 members were present at the meeting\r\n\r\nThere are 49 paid members in PSB. We have $4421.02.\r\n\r\nNew Member Joined: Adam Bedenbaugh\r\n\r\nMembership:\r\nOverdue: Harold Dowda, Eon Mellitz, Jason Williams\r\nDue Now: Dan Derick, Jim Griggers, Mike Kelly\r\nDue March: Robin Dial, Dan Adams, Bill Garrett, Sam Hess, Brian Mosely, Chris Willis\r\n\r\nCongratulations to Bob Leach whose American Pale Ale won a 3rd prize in the MCAB Competition\r\n\r\nEvents:\r\nShamrock Open- March 1st. In order to have entires delivered to Alternative Beverage (a pickup location for Carboy) all entries must be to Bet Mar by the close of business on March 6th. If you are willing to drive the beers from Columbia to Charlotte on Friday the 6th let Carl know.\r\n\r\nAiken Brew tour - Dan Adams is looking into dates for a possible trip to Aiken in March. More details will be posted in the forum.\r\n\r\nFebruary 13th - tapping of sexual chocolate (Foothills Brewery) at the Flying Saucer\r\n\r\nMarch 1st- Brewsession at Joseph\'s house\r\n\r\nMarch 29th- Brewsession at Bet-Mar\r\n\r\nApril 12th- Club party at the police hut. Oysters will be on the menu.We will need people to bring other sides. There will  soon be a signup sheet on the forum and at the March meeting.\r\n\r\nApril 19th- Brewsession at Phil O\'s house.\r\n\r\nMay 3rd- Big Brew Day at Bet Mar. Judges will be needed - see Mark or Sonya. Othe rvolunteers will also be needed. Just watch the forum for details.\r\n\r\nThings in the Works:\r\n\r\nSeveral people have expressed an interest in a Cigar and Pint night. The way we would do this is by offering 2 cigars and probably 2 or 3 beers (home-brewed or commercial) for a flat fee. It woud be open to only members and their guests. It would be held at a club members home. Joseph has offered to host the first one. At the meeting about half the club members were interested. Speak to Joseph or Chris if you are interested in this.\r\n\r\nMarch meeting discussion will be concerning hops and what to use in place of them. Matthew Ellisor will be the speaker.\r\n\r\nHarold mentioned a BJCP exam and  possible study sessions. There were 5 people at the meeting interested. See Harold if you are interested.\r\n\r\nEducation Portion: Barry Ledford\r\nBarry has cycled through the following methods of cooling wort and has gotten the time down to less than 3 minutes for 10 gallons of beer. He\'s actually gone back to using one of the previous methods he used.\r\nEmersion chiller with lid\r\nEmersion chiller with no lid and stirring\r\n Counterflow chiller\r\n whirlpool chiller\r\n Blichman Thermonator\r\n If you missed the meeting and are interested in finding out the details, speak to Barry.\r\n\r\nRaffle: Donated by Kasey -, Dan A, and Carl. $33 dollars was made.\r\n\r\nBeer tasting:\r\nPhil O. - Belgian Christmas Ale \"Still Nacht\" clone, Anchor Portor Clone, Hen\'s tooth clone (brittish bitter)\r\n\r\nAdam Bedenbaugh, our newest member- Porter\r\n\r\nBob Leach- Coconut Porter\r\n\r\nDan Adams and friends- bourbon Stout');
