INSERT INTO `phpbb_posts_text` VALUES (4504,'20f4d200cc','1st Round AHA National Competition in Charlotte','Attached is info from the AHA site.  It looks as if they got it.  Way to go guys and gals!\r\nThey may need help judging and stewards.\r\n\r\n\r\n\r\n\r\n04/19/2008\r\nAHA National Homebrew Competition 1st Round South Region\r\nRaleigh, NC, US\r\nContact: Walt Sweeney\r\nPhone: (919) 562-7278\r\nEmail: [email]waltbop22@nc.rr.com[/email]\r\nWeb: http://www.beertown.org/events/nhc/index.html');
