INSERT INTO `phpbb_posts_text` VALUES (4117,'443e23ca20','Allagash tasting - interest?','Pete and I were talking about breaking out some Allagash brews with select company and I thought perhaps an officer\'s Christmas tasting would be nice.\r\n\r\nAnyone interested?  I can host at my house.  I\'m thinking everyone bring 2 different 750s and we can cover a big range of Allagash brews... \r\n\r\nI\'ll have a lot of free time this holiday season, this weekend evenings (or early afternoons, really) work fine for me.\r\n\r\nDon\'t make me drink all these myself!!!');
INSERT INTO `phpbb_posts_text` VALUES (4116,'ddb94e8166','','[quote:ddb94e8166=\"Chris Cole\"] \r\n On a logistical note,  does anyone know what size line I\'ll need for the beer out? What about CO2 in?[/quote:ddb94e8166]\r\n\r\nDepends on what size barb Phil has.. you can prolly use your tap line and your gas line from your house and crimp it down clamp. I don\'t think it will matter as long as it is tight. I would leave the pressure at 4-5psi and give it burst shots from the CO2 tank to avoid keeping it on for a week.');
INSERT INTO `phpbb_posts_text` VALUES (4513,'0c0aab1791','','Hot on the heels of the packed month of January come a few worthy events this month.  But first, a recap.\r\n\r\nThe Cask ale tasting in Atlanta was superb.  Chris and Tina joined Robin and I along with some brewers from other clubs and tasted 15 different cask ales at the Sweetwater Brewery.  The beers ranged from a Foothills cask-conditioned Seeing Double to an intensely oaky bourbon barrel barleywine and a winning sweet brown ale that was dry doughnuted with actual doughnuts!  All of Sweetwaters beers were free on tap as well and the crowd favorite seemed to be the Happy Ending Imperial Stout.\r\n\r\nHow can you get in on this next year, you ask?  Sign up for Owen Olgetrees [url=http://www.classiccitybrew.com/]Brew Newsletter[/url]. It contains a wealth of information regarding the Georgia beer scene and will announce when tickets go up for the 2009 event.\r\n\r\nThere is an upcoming club trip to [url=http://www.aikenbrewingcompany.com/]Aiken Brewing[/url] on March 8th.  We\'ll drive some cars up, eat at the brewery, take a tour and shoot the breeze with Randy and Herb and the Aiken gang.  Check the forum for the latest!\r\n\r\nThis months brew session will be held at [url=http://maps.google.com/maps?f=q&amp;hl=en&amp;q=1727+Romain+Drive%2C+Columbia%2C+SC]Joseph Ackerman\'s home[/url] .  Due to leap year (or something) it will be held March 1st.  Mark your calendars!');
INSERT INTO `phpbb_posts_text` VALUES (4115,'0e55a71cdf','','Jim,\r\n\r\nI can usually get what I need out of 2 sheets. One for recipe and the other for strike water/temp. I don\'t think it can be reduced to one page without it being legible. Here is a sample of a recipe we have done minus the strike temp page. It pretty much has everything you need to brew your batch.\r\n\r\n[code:1:0e55a71cdf]Sweet Southern Blonde Ale\r\n\r\nA ProMash Recipe Report\r\n\r\nBJCP Style and Style Guidelines\r\n-------------------------------\r\n\r\n03-A  Light Ale, Blonde Ale\r\n\r\nMin OG&#58;  1.045   Max OG&#58;  1.060\r\nMin IBU&#58;    15   Max IBU&#58;    33\r\nMin Clr&#58;     2   Max Clr&#58;     8  Color in SRM, Lovibond\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size &#40;Gal&#41;&#58;         5.50    Wort Size &#40;Gal&#41;&#58;    5.50\r\nTotal Grain &#40;Lbs&#41;&#58;       10.50\r\nAnticipated OG&#58;          1.051    Plato&#58;             12.70\r\nAnticipated SRM&#58;           3.5\r\nAnticipated IBU&#58;          17.6\r\nBrewhouse Efficiency&#58;       75 %\r\nWort Boil Time&#58;             90    Minutes\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 85.7     9.00 lbs. Pale Malt&#40;2-row&#41;              America        1.036      2\r\n  4.8     0.50 lbs. Cara-Pils Dextrine Malt                      1.033      2\r\n  4.8     0.50 lbs. Wheat Malt                    America        1.038      2\r\n  4.8     0.50 lbs. Flaked Soft White Wheat       America        1.034      2\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n  0.75 oz.    Hallertauer                       Pellet   4.50  12.8  60 min.\r\n  0.50 oz.    Saazer                            Pellet   4.30   4.1  15 min.\r\n  0.50 oz.    Saazer                            Pellet   4.30   0.7  2 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP001 California Ale\r\n\r\n\r\n\r\nNotes\r\n-----\r\n2 Vanilla beans, sliced down center, contents scooped out and disgarded. Chop up 2 Vanilla Beans and add to a small shot glass. Soak in vodka for 1week. Pour vanilla beans and Vodka in hop bag and secondary for 2weeks. [/code:1:0e55a71cdf]');
INSERT INTO `phpbb_posts_text` VALUES (4114,'9388f220af','','Sweet! Thanks everyone. Phil, I\'ll take you up on your offer if you don\'t mind. For those curious, Tina and I will be spending a glorious few days at Hunting island for New Years, we\'ll therefore need a copious (a lot) amount of alcohol to satisfy our \"needs\". A side note, I will have a gun with me so anyone that thinks they\'d like to pop by and visit the keg will do so at their own risk!  :cheers: \r\n On a logistical note,  does anyone know what size line I\'ll need for the beer out? What about CO2 in?');
