INSERT INTO `phpbb_posts_text` VALUES (4108,'8b9ed1c615','Sankey Tap','Does anyone have a Sankey tap I can borrow? I need one for about a week and apparently Greens doesn\'t rent them. For what it\'s worth, if I can borrow one is it safe to assume I can hook up my CO2 tank with little to no modification?\r\nThanks in advance!\r\nChris');
INSERT INTO `phpbb_posts_text` VALUES (4107,'be4f90f642','','We all have things come up in our lives to change our priorities. I understand Jeff\'s situation and hope things go well with his wife. If/when he gets back into writing software, I\'m sure he will continue to make improvements. I\'ll send along my suggestions.\r\n\r\nI\'ll check out the other software out there to see how it functions and what it\'s printing output looks like.\r\n\r\nBack to ProMash. My last batch went well using the numbers ProMash generated. The 1st rest was 156.5F when I was shooting for 155F. (I think there is a bug in the way it did its calculations, it used my crystal malt in the formula, even though I don\'t mash my crystal) The OG was 1.085, was shooting for 1.083. The only thing I need to really adjust is my volume into the kettle. It was about a gallon over, so I boiled it down before the first hop addition.  I\'ll go back and see what parameter(s) I need to adjust.\r\n\r\nMy main gripe is I want to see an output sheet generated that only has key brewing parameters on it, in bold, readable print. In ProMash, I have unchecked most things on the output report, and it still generates 3 (partly filled) pages, and I have to hunt for what I need - each malt listed with amounts, each hop listed with amounts, each water salt listed with amounts, strike volume and temperature, sparge volume, hop addition times, and target volume and gravity.  I KNOW all that will fit on one page and will be readable without glasses. :)\r\n\r\nI have other gripes, I\'ll save those for latter.  lol');
