INSERT INTO `phpbb_posts_text` VALUES (4105,'49c36307a9','','Harold,\r\n I\'ve heard the creator of ProMash is in the midst of a family crisis. (Medical maybe??) There was talk of this recently on another board. From what I\'m hearing he does or will continue to support it whenever his life levels back out. I love ProMash but Jim\'s initial question raises a good point, who are the masters out there? Any tips or tricks you could share? Any other brewing software afficionados? Looks like a great educational meeting topic. Beer Tools experience anyone? I\'m hearing good things about that program as well. Generally speaking, for brewers not using any software, you should. They\'re very helpful and I know ProMash and Beer Smith both have fully functional free demo versions. Just Google it. Check them out, they\'re worthwhile.  :cheers:');
INSERT INTO `phpbb_posts_text` VALUES (277,'7304033e32','Laurens Brew','I\'m drinking a Scotch Ale from the Laurens brewery (can\'t remember the name).  It is a very nice malty beverage which is just what I was looking for today.  One beer has delivered a soft, mellow buzz making me wonder if it\'s got a little extra \"vitamin A.\" Sorry I can\'t share.  :wink: \r\n\r\nAnyhoo.  I\'m way past due for brewing some yeast food and was wondering if anyone has a good extract recipe or maybe some tips on making a 120 shilling.\r\n\r\nSoon I plan on making another AIPA but it would be nice to break out of the mold and go a little malty.\r\n\r\n :drink:');
INSERT INTO `phpbb_posts_text` VALUES (278,'b278166b8c','120 Shilling','Pete...What is a 120 Shilling?\r\nIs that a Strong Scottish Ale (style 9E)?');
INSERT INTO `phpbb_posts_text` VALUES (279,'e781a674a3','Re: Laurens Brew','[quote:e781a674a3=\"Pete Goodwin\"]I\'m drinking a Scotch Ale from the Laurens brewery (can\'t remember the name).  It is a very nice malty beverage which is just what I was looking for today.  One beer has delivered a soft, mellow buzz making me wonder if it\'s got a little extra \"vitamin A.\" Sorry I can\'t share.  :wink: \r\n\r\nAnyhoo.  I\'m way past due for brewing some yeast food and was wondering if anyone has a good extract recipe or maybe some tips on making a 120 shilling.\r\n\r\nSoon I plan on making another AIPA but it would be nice to break out of the mold and go a little malty.\r\n\r\n :drink:[/quote:e781a674a3]\r\n\r\nWould this be LRBC in Laurens? I\'d like to take a visit there one day. \r\n\r\nI don\'t think they make a 120 shillings.. I believe it is 60,70,80. \r\n\r\nI made a 80 shilling extract one time from Clone Brew. I think you need to do a 90min boil to carmelize  the wort a little to give it a maltier effect.');
INSERT INTO `phpbb_posts_text` VALUES (282,'abb27ee767','Re: Laurens Brew','[quote:abb27ee767=\"Jamie Sox\"]Would this be LRBC in Laurens? I\'d like to take a visit there one day. \r\n\r\nI don\'t think they make a 120 shillings.. I believe it is 60,70,80. \r\n\r\nI made a 80 shilling extract one time from Clone Brew. I think you need to do a 90min boil to carmelize  the wort a little to give it a maltier effect.[/quote:abb27ee767]\r\n\r\nA 120 would be a be a strong or wee heavy Scottish.  I think it starts at 90 shilling.\r\n\r\nYes, it is the LRBC.  Couldn\'t remember at the time.  It (legally) should not be a 120 but I swear it was a Wee Heavy.  No alcoholic nose or taste but a definate feel.  \r\n\r\nThanks for the clone brew tip.  I have a copy of the book and may see if I can run it through a brew calculator to bump up the malt for a 120 without losing balance with the hops.  Also the 90boil tip is something I would not have thought of.  For grains I\'m going to see if I can find something peat smoked.');
INSERT INTO `phpbb_posts_text` VALUES (289,'d2d295cf64','Re: Laurens Brew','[quote:d2d295cf64=\"Pete Goodwin\"][quote:d2d295cf64=\"Jamie Sox\"]Would this be LRBC in Laurens? I\'d like to take a visit there one day. \r\n\r\nI don\'t think they make a 120 shillings.. I believe it is 60,70,80. \r\n\r\nI made a 80 shilling extract one time from Clone Brew. I think you need to do a 90min boil to carmelize  the wort a little to give it a maltier effect.[/quote:d2d295cf64]\r\n\r\nA 120 would be a be a strong or wee heavy Scottish.  I think it starts at 90 shilling.\r\n\r\nYes, it is the LRBC.  Couldn\'t remember at the time.  It (legally) should not be a 120 but I swear it was a Wee Heavy.  No alcoholic nose or taste but a definate feel.  \r\n\r\nThanks for the clone brew tip.  I have a copy of the book and may see if I can run it through a brew calculator to bump up the malt for a 120 without losing balance with the hops.  Also the 90boil tip is something I would not have thought of.  For grains I\'m going to see if I can find something peat smoked.[/quote:d2d295cf64]\r\n\r\nAh... Well it just so happens JR Brew is brewing a Scottish Wee Heavy on Saturday and I have a couple \"samples\" of that style to try.\r\n\r\n I have some peat malt I can give you .I heard a little dab will do you of that stuff. I think I have 8oz or so in a 5gallon batch.');
