INSERT INTO `phpbb_posts_text` VALUES (4101,'14f4478c37','','[quote:14f4478c37=\"Harold Dowda\"]All I needed was a dead parrot...[/quote:14f4478c37]\r\n\r\nIt\'s not dead.   :wink:\r\n\r\nOnce when I was buying smokes a convenience store clerk asked for my ID.  I shrugged and said, \"sure but do I really look under 18?\"  He said, in a rather snippy tone, it is the law to check IDs and that he could not sell them to me without checking.  I said, \"no, it is not against the law to not check IDs.  It is against the law to sell tobacco to minors.\"  His manager happened to be there and came over to tell this twit I was right and that he was not to bother customers who were obviously of age.  I really didn\'t care about showing my ID but it did bug me that this guy didn\'t know what he was talking about.  And since he was being a rude biatch I felt it was my duty to call him out.  Jackass.\r\n\r\nAnyway, sounds like a similar experience.  I say stick it to the man by shipping everything in boxes labeled with alcohol brands.\r\n\r\n :cheers:');
INSERT INTO `phpbb_posts_text` VALUES (303,'0968214d9b','First attempt at a triple..','Anyone with triple experience. Any tips to Improve this recipe?\r\n\r\n  11 lbs belgian pils\r\n   3 lbs Vienna\r\n   3 lbs candy sugar ( homemade)\r\n   yeast WLP500 Trappist Ale starter\r\n   Mash at 148 ?  \r\n   long boil or will sixty be enought?\r\n\r\n\r\n\r\n\r\n\r\n   Any advice would be  appreciated. Prost!');
INSERT INTO `phpbb_posts_text` VALUES (4496,'14b93686d2','','Ok, I always read you shouldn\'t boil the grains...it can cause some really bad flavors (I can\'t remember which flavors).  So why doesn\'t it cause a problem\r\n\r\n[quote:14b93686d2]Just in case you have heard the uninformed questions about decoctions, NO IT DOES NOT CAUSE A TANNIN PROBLEM.[/quote:14b93686d2]');
INSERT INTO `phpbb_posts_text` VALUES (308,'1e7fd148bc','','Brian,\r\n\r\nI have only brewed one XXX and it was around my first year of brewing.\r\n\r\nI got a buddy of mine to give me some suggestions on your recipe and I took his comments and derived this. \r\n\r\nHTH\r\nJamie\r\n\r\n[code:1:1e7fd148bc]Tripel\r\n\r\nA ProMash Recipe Report\r\n\r\nBJCP Style and Style Guidelines\r\n-------------------------------\r\n\r\n18-C  Belgian Strong Ale, Belgian Tripel\r\n\r\nMin OG&#58;  1.075   Max OG&#58;  1.085\r\nMin IBU&#58;    25   Max IBU&#58;    38\r\nMin Clr&#58;    45   Max Clr&#58;     6  Color in SRM, Lovibond\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size &#40;Gal&#41;&#58;         5.50    Wort Size &#40;Gal&#41;&#58;    5.50\r\nTotal Grain &#40;Lbs&#41;&#58;       17.00\r\nAnticipated OG&#58;          1.094    Plato&#58;             22.44\r\nAnticipated SRM&#58;           5.1\r\nAnticipated IBU&#58;          27.4\r\nBrewhouse Efficiency&#58;       75 %\r\nWort Boil Time&#58;             60    Minutes\r\n\r\nFormulas Used\r\n-------------\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 70.6    12.00 lbs. Pilsener                      Belgium        1.037      2\r\n 14.7     2.50 lbs. Candi Sugar &#40;clear&#41;           Generic        1.046      1\r\n  8.8     1.50 lbs. Vienna Malt &#40;2 Row&#41;           France         1.037      3\r\n  2.9     0.50 lbs. CaraPilsner                   France         1.035     10\r\n  2.9     0.50 lbs. Wheat Malt                    Belgium        1.038      2\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n  1.00 oz.    Hallertauer                       Whole    4.00  10.3  60 min.\r\n  1.00 oz.    Saazer                            Whole    4.30  11.1  60 min.\r\n  0.50 oz.    Saazer                            Whole    4.30   2.7  15 min.\r\n  0.50 oz.    Styrian Goldings                  Whole    5.25   3.3  15 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP500 Trappist Ale\r\n\r\n\r\nBrewer\'s notes&#58;\r\n\r\nBIG BIG Starter\r\nMash around 150-152- the Candi sugar has a tendency to dry out the beer\r\nAdd the Candi around 15min left of the boil\r\n\r\n[/code:1:1e7fd148bc]');
INSERT INTO `phpbb_posts_text` VALUES (309,'0a1725ebc5','','Thanks Jamie, I was most concerned with the mash temps.  I\'ve use candi  before and was worried it would be to dry. I\'ll be firing the burners sunday morning and I\'ll report back with the results.  :cheers:   Prost!');
