INSERT INTO `phpbb_posts_text` VALUES (4100,'dfbb24fff3','ProMash software','Is anyone here a \"master\" at using ProMash? I have had this software for years, but never really got a handle on how to use it. I mainly used it to enter recipes, but never relied on the numbers it generated.  I finally got around to measuring some parameters the program needed (such as mash tun thermal mass, kettle dead space, etc). Still need to figure my evaporation rate.\r\n\r\nBefore that, I used a program called \"Brewer\'s Calculator\" which served me well. It was a Windows 3.1 or Windows 95 era program that was horribly slow on old hardware. As computers got faster, the program actually worked fairly well, but alas Bob Regent stopped supporting it. It used a Borland database engine (I have forgotten the name of it).\r\n\r\nI would like to discuss with anyone that regularly uses this program their procedure. I have a gripe about the printout and would love for it to be more customizable, but I can adapt. I would love for it to print out on one sheet all the information I need to actually brew, and skip the rest.\r\n\r\nMaybe brewing software would be a good future topic for a meeting  :)');
INSERT INTO `phpbb_posts_text` VALUES (4099,'73f86d11c3','','As long as your alcohol and water proportions are roughly equivalent it doesn\'t matter if you\'re talking a pint, fifth or gallon, although this recipe is designed around a fifth.  Larger or less volumes would require modifications to fruit and sugar amounts.  I\'ll try and remember to bring the pineapple to the January meeting.   :devil: \r\n\r\nI have found it works best cutting back about 10% on the simple syrup so the stuff doesn\'t get icy or freeze in the fridge.  You need to keep the alcohol content up in the fluid to prevent freezing.');
INSERT INTO `phpbb_posts_text` VALUES (4499,'75099117f9','','Carl and Joe and I enjoyed Sexual Chocolate on draft at the Publick House last night.  $5 / pint!  Nice.  Also had Hoppyum for $4.25.  It\'s a nice bar, go check it out if you haven\'t been.  They have a decent beer selection and nice atmosphere.');
INSERT INTO `phpbb_posts_text` VALUES (4500,'b368c16a6c','','[size=18:b368c16a6c][u:b368c16a6c][b:b368c16a6c]Report from the VP of Competitions:[/b:b368c16a6c][/u:b368c16a6c][/size:b368c16a6c]\r\n\r\nNot much to say here but get ready for Shamrock!  The first comp. in the 2008 CBOY season is on March 15th.  Registration started February 2nd and will continue through March 1st.  Keep your eyes on the forum for ways to ship.  There has been some discussion about CARBOY coming down or stopping half way to pick up entries.  The details are not yet ironed out but new info will be posted in the forum as it becomes available.\r\n\r\nThere is no club only competition this month.  Dr. Leach was the winner last month in the dark lager category and it will be judged on the 16th by the Prairie Homebrewing Companions of Fargo, ND.  Good luck Robert!  \r\n\r\nNext months competition is the Perfect Porter Challenge.  We will judge it at our March meeting so get your porters out and ready to travel.  There will be little time between PSBs March meeting and the entry due date of March 21.  Please, everyone entering a beer to judge, remember to bring 4 bottles and be prepared to fill out your entry forms.  Two bottles to judge at the meeting and, if youre the winner, two to send to the competition.  Losers get to keep their beers.\r\n\r\n[url=http://www.palmettostatebrewers.com/competitions/]More information on competitions can be found on the website under, oddly enough, \"Competitions.\"[/url]');
INSERT INTO `phpbb_posts_text` VALUES (4096,'bee17b6747','','Nope, not a suggestion.  As I recall it was, \"In future shipments please don\'t use alcohol boxes.\"  My question \"Why?\" Answer \"they(?) don\'t want us to use them because we aren\'t supposed to ship alcohol unless it is from a licensed distributor.  Me: OK but why not the boxes? Her: We can be fined $15,000(!) if we do. Me: OK, do what? Her: Ship alcohol. Me: but you don\'t get fined for the box? Her: No, but they(!) don\'t like it.  Me: Is this like a federal law? Her: I don\'t know but we can be fined. Me: About all the boxes that are easy to get and free are alcohol boxes.  I cant pay $12.00 for one of your boxes. Her: Our boxes are not $12.00...I point to a stack with a $12.00 sign...well not all are $12.00. Me:Does FedEx have this rule? Her: I don\'t know.\r\n\r\nAll I needed was a dead parrot...');
