INSERT INTO `phpbb_posts_text` VALUES (4198,'1b900a7a3e','','My IPA went in the keg this afternoon. I put the hop pellets in a nylon bag, threw in a sanitized stainless fitting, and suspended the bag in the middle of the keg with mono-filament. My problem now is I can\'t seem to get the gasket to seal with the line coming out. So, I think it will only have the hops in there overnight. I\'ll pull out the bag tomorrow, and I will just live with a possibly lower dry hop character. I think the yeast will drop out quite well with the keg sitting outside tonight. I\'ll probably drape a towel around it to prevent having a frozen keg.');
