INSERT INTO `phpbb_posts_text` VALUES (4086,'a63cfef547','','You can just toss pellet hops in a carboy and they\'ll settle out eventually. I\'ve done this before. It\'ll obviously help even more if you can crash cool the carboy when you\'re done dry hopping. \r\n\r\nI\'ve dry hopped with the white mesh bags in the keg before, but with whole hops. I\'m not sure that the weave is tight enough for pellet hops. Panty hose might work better.\r\n\r\nWhat I do currently is dry hop in the keg, with pellets, using a [url=http://www.northernbrewer.com/hop-accessories.html]stainless steel tea ball[/url]. This thing is a fantastic solution for keg hopping with pellets. Furthermore, when I keg hop I leave \'em in there until the thing\'s empty. As far as I\'m concerned  there\'s no urgent reason to remove keg hops from your keg before it blows.\r\n\r\nNow, I have read elsewhere some people\'s reports that a part of those tea balls is in fact not stainless and has eroded away in a keg of beer. I asked Northern Brewer about this and they assured me the thing is 100 percent stainless. I\'m presently on my first keg using the tea balls so I can neither verify nor disconfirm this. At any rate, even if the piece is slowly dissolving away it can\'t be too big a deal because that beer just took a ribbon at PSBO9.  :wink:');
