INSERT INTO `phpbb_posts_text` VALUES (4085,'792effae9a','','Good advice Phil!\r\n\r\nOption 1 - Put hops in a hop bag then suspend them in the keg.  To suspend add sanitized glass (marbles or shot glass) to the hop bag.  Tie sanitized fishing line to the bag and run it out of the lid.  At any time you can simply open the lid and retrieve your hop bag.  Be careful because some hop flotties from pellets may get through the bag (even the nylon ones) and gum up your fittings.');
INSERT INTO `phpbb_posts_text` VALUES (3997,'996ca7b0b3','','I\'ve got a mix with no problems.  I chased down my leak by turning off my distribution block and seeing which beers had no pressure on them in a few days.  Turns out I had several cracked O-rings on the gas in posts and one disconnect leaking.  The ONLY disconnect I had leaking was a MFL BTW.\r\n\r\n;)');
