INSERT INTO `phpbb_posts_text` VALUES (4079,'0a1739e3c9','Wierdness at UPS Store','Was at my local UPS store, the one in Murraywood Center on St Andrew\'s Rd in greater Irmo, this morning to ship some packages.  The \'manager\' a late teen, early 20\'s type told me that in future it would be better if I did not bring in things to be shipped contained in \'alcohol\' boxes (beer, wine, spirits).  Since two of the three I had to ship were in alcohol boxes, there resulted an extended period of pulling huge labels off a sheet and applying them so that any reference to EtOH was obliterated.  The boxes were half covered with these white labels.  The owner (her father) was nearby and did not contradict her.  She said she could be fined for shipping alcohol (her point was...?).  I asked if it was a federal law that alcohol boxes could not be used but she did not know and her father took a header to the back.  Coveniently located were a display of overpriced boxes for sale.  Huuummmm.  Let\'s see.  UPS does not want us to wrap boxes in brown paper, or use alcohol boxes, or mark out the alcohol logo on the offending box to indicate no liquor is contained therein.  Wonder if FedEx is open or even more thumb up their aspoles.\r\n\r\nBTW, the girl did not ask me what was in any of the boxes including the alcohol boxes.  2/3 could have gotten her fined... lol');
