INSERT INTO `phpbb_posts_text` VALUES (4076,'df569e8860','','I\'ve only dry hopped a couple times but it was with leaf hops.\r\n\r\nPersonally I\'d just put it in the carboy, and a couple days before transferring to the keg, I\'d give the carboy a spin to put everything in suspension, and wedge a 1/4\" - 1/2\" stack of paper (or whatever) to put the carboy at a slight angle. I\'d then rack using a racking cane with a tip, and rack from the higher side of the carboy.\r\n\r\nJP');
