INSERT INTO `phpbb_posts_text` VALUES (4075,'ec8b7874d5','Dry Hopping','I need some advice on how to dry hop a beer. What is your method of dry hopping?\r\n\r\nI ferment in glass carboys and keg my beer, so what I have always done in the past is to put my hops in a mesh bag, tie a stainless steel coupler to the bag to keep the bag submerged, then transfer my beer from carboy to keg.  When I used pelletized hops, there is always a bit of \"crud\" that gets pushed out on the first few beers and the last beer of the keg. I usually don\'t move my kegs out of the cooler.\r\n\r\nHowever, I\'m making a beer to take with me on a trip to DC and don\'t want to put the hop bag in the keg. I\'ve never just thrown hops into the carboy fearing it would clog my siphon tube or not settle out completely enough.\r\n\r\nI guess my options are:\r\n1. Use the hop bag in the keg, then transfer the beer to another keg for the trip.\r\n2. Put the hops in the carboy and hope things don\'t get clogged. Assuming the racking tube doesn\'t get clogged, I can put a bag over the end of my siphon tube to keep the hop particles out of the keg.\r\n\r\nI am using pelletized hops.');
INSERT INTO `phpbb_posts_text` VALUES (4073,'bac9abe200','Limoncello','I\'ve had several requests for the limoncello recipe so here it is.  Much simpler than making beer.  Enjoy.   :wink: \r\n\r\n\r\nLimoncello\r\n\r\n\r\n	Peel the rind of about 12 lemons and steep in a container with grain alcohol for 2 weeks.\r\n	Take an equal amount of water (I usually save the Everclear grain alcohol bottle to measure the water) and bring to a near boil.\r\n	Mix 2 cups of sugar in the water.  You can go up to about 4 cups of sugar if you want it sweeter.\r\n	Let the simple syrup water and sugar mixture cool.\r\n	Remove or strain out the lemon peels from the grain and add to the cooled sugar water mixture.\r\n	Stir, bottle and place in the freezer.\r\n\r\nOptional Methods\r\n\r\n	For a creamy version, use an equal amount of milk instead of water to make a milk and sugar mixture.  When using milk, extra care must be exercised to not scald the milk when heating, and to be absolutely certain the mixture is cooled prior to mixing in the alcohol otherwise the mixture is not smooth.  The goal of heating the milk is to insure the sugar melts so boiling is not necessary.\r\n	Use other fruit.  Roughly peel a pineapple and cut into  sections.  This size section works well because when it comes time to remove the pineapple from the alcohol you can use a garlic press on each piece (tedious, but an effort of love) or a fruit press to remove the alcohol the pineapple absorbed.');
