INSERT INTO `phpbb_posts_text` VALUES (4069,'089e4c7dd0','','[quote:089e4c7dd0]As a former avid homebrewer turned avid drinker of the homebrews of others, it was with great appreciation that I was able to serve as a judge earlier this month for the Ninth Annual Palmetto State Brewers Open held at an undisclosed location deep in the heart of Irmo.\r\nFor those who dont know, the event, hosted by the aforementioned Palmetto State Brewers Club, is kind of a big deal for homebrewers, as its their only opportunity to have their beers judged by experts from around the Carolinas and possibly move on to regional and national competitions.\r\n\r\nFirst, let me say that a finer collection of folks would be nearly impossible to find  after all, every judge there was invited due to their expertise and love for beer, whether they were long-time homebrewers with years of credentialed judging experience or professional brewers at such area breweries as the Aiken Brewing Company and the Duck-Rabbit Brewery in Farmville. N.C. In all, three states were represented to judge 333 entries from 17 states in 23 categories.\r\n\r\nYeah, its a big deal.\r\n\r\nThe first item to report from the experience is that contrary to my own expectations for myself, I held my beer exceptionally well, which perhaps was in part to the gallon of chili I chugged for lunch. A drunk judge is no judge at all. Secondly, I was blown away by the care and attention paid by the judges to the entries. Every beer, whether skunked or not to style or just bad-tasting, was given equal consideration and judged more fairly than many competitions Ive been associated with in my day.\r\n\r\nThat having been said, following are your winners (I list them here not just to congratulate them, but also to let you readers know that if you see a name you know here, you need to hit them up immediately for some of the good stuff):\r\n\r\nBeer Best of Show: Robert Leach, Aiken, English Barleywine; Jim Smith, Summerfield, N.C., Smoked Porter; and J.R. Brewing, Lexington, Special Bitter. \r\n\r\nMead and Cider Best of Show: Joel Masters, Columbia, Braggot (a blend of mead and beer); Kevin Martin, Charlotte, Marys Apple Rose Cider and his Dangerously Smooth semi-sweet mead.\r\n\r\nJust Good Beer Brewoff: Harold Dowda, Columbia, Prolifically Peppered Porter; Kevin Marino, Really Good Beer; and Dowda, Dark Weissass.\r\n\r\nNow, just your first-place winners: Light Lager, Mac Wylie, Greensboro, N.C.; Pilsner, Jim Smith, Summerfield, N.C.; Amber Lager, David Keller, Bat Cave, N.C.; Dark Lager, Carl Foster, Columbia; Bock, Jim Smith, Summerfield, N.C.; Light Hybrid Beer, Mac Wylie, Greensboro, N.C.; Amber Hybrid Beer, Phillip Folse, Charlotte, N.C.; English Pale Ale, JR Brewing, Lexington; Scottish and Irish Ale, David Keller, Bat Cave, N.C.; American Ale, Robert Leach, Aiken; English Brown Ale, Katherine Shavo, Columbia; Porter, Karen Lassiter, Cross Plains, Tenn.; Stout, Jim Smith, Summerfield, N.C.; IPA, Alex Buerckholtz, Asheville, N.C.; German Wheat Beer, Peter Polczynski, Tulsa, Okla.; Belgian Ale, Chris Dotson, Asheville, N.C.; Sour Beer, Robert Leach, Aiken; Belgian Strong Ale, Bill Lynch, Waxhaw, N.C.; Strong Ale, Robert Leach, Aiken; Fruit Beer, Carl Foster, Columbia; Spice, Herb and Vegetable Beer, Aaron Zaccagnino, Fredericksburg, Va.; Smoked and Wood-Aged Beer, Jim Smith, Summerfield, N.C.; Specialty Beer, JR Brewing, Lexington; Traditional Mead, Kevin Martin, Charlotte, N.C.; Melomel, Ken Hilton, Greenville, N.C.; Other Mead, Joel Masters, Cayce; and finally, Cider, Kevin Martin, Charlotte, N.C..\r\n\r\nWhew. Thanks to the Palmetto State Brewers for having me out, and if youre a local homebrewer or want to become one, club meetings are held the second Monday of each month at Zorbas in Irmo from 6 to 8:30 p.m. Check them out online at www.palmettostatebrewers.com.\r\n[/quote:089e4c7dd0]\r\n\r\nhttp://www.free-times.com/index.php?cat=1992912064202144&amp;ShowArticle_ID=11461112071208743');
