INSERT INTO `phpbb_posts_text` VALUES (4193,'3c4e2b70fe','Warning! Defective Kitchen Matches from China','Take heed all we smokers of cigars (and others, such as crack smokers) who use \'kitchen\' matches to light-up.  I have discovered that matches made in China present significant dangers.  When struck they ignite immediately in to a large flame and burn furiously often reaching finger tits before the head can be presented to the cigar and then immediately go out before the object of the ignition sequence can be compleated to all parties satisfaction.  The only thing getting hot is the match and fingers.  Rather like pre-mature extinguishation.  Additionally, they very often break during the striking process leaving one holding a short , dead stick while the flaming tip goes flying.  Seems they need to use a less oily wood and some adjuvant to maintain the strength of the shaft. \r\n\r\nThese matches are sold at Kroger in boxes that resemble good old American matches well known for their slow burn and strength to maintain contact \'til ignition is complete before they burnout.');
