INSERT INTO `phpbb_posts_text` VALUES (4041,'4fe8e5e2d5','','cheap temp control: tub or action packer from dollar tree - pepsi bottles filled with water and frozen - place your carboy in the tub - fill it to almost the same level as your wort - add frozen pepsi bottles in the morning b4 u go to work - and change them out when you get home at nite - in my unconditioned barn even up into june - i can maintain 70 prtty evenly. the mass of water will not absorb energy quickly nor will it release energy quickly so you will even out your temp spikes. try it - i can say for a fact that it works.');
