INSERT INTO `phpbb_posts_text` VALUES (4032,'60dafe7cb6','','Well, I bottled this stuff on 30 Nov, and tried one today.  Not the best beer I\'ve ever brewed, but it will turn out all right with a little more age.  I used WLP013 London Ale yeast, and I can really taste the \"estery\" part.  I think this is in part due to the high temps during fermentation, but since that is apparently a normal taste for this strain it worked out ok.  It\'s really malty, and has a lot of body.  I think some of this came from the oats, I\'m not sure.  I\'d tell you the OG and FG, but I was having a really bad day when I brewed this batch and broke my hydrometer!\r\n\r\nI went looking at more recipes that use oats.  In the book cited above, they always put the oats in for the boil.');
