INSERT INTO `phpbb_posts_text` VALUES (4203,'a7ace553cc','pro mash','I too am not totally happy with the print out with the Pro Mash.  I cannot blame this entirely on the software because I know that I have not learned how to use it completely.  The thing that I DO like about PM is its calculator capabilities.  ie.  Alcohol content, dilution factoring, water needs, and, most importantly to me, strike temperature.  Id like to attend a tutorial on this program.\r\n\r\nI unfortunately use both Pro Mash and Beer Tools.  I like the way the BT print out of the recipe is concise and shows how close the predicted brew compares to the style guidelines.  It is a good cover sheet for my lab notes.\r\n\r\nBeer Smith seems like a good product also, but I have not spent much time with it.');
