INSERT INTO `phpbb_posts_text` VALUES (4197,'51aab12711','','[quote:51aab12711=\"Jamie Sox\"]Jim,\r\n\r\nI can usually get what I need out of 2 sheets. One for recipe and the other for strike water/temp. I don\'t think it can be reduced to one page without it being legible. Here is a sample of a recipe we have done minus the strike temp page. It pretty much has everything you need to brew your batch.\r\n\r\n[/quote:51aab12711]\r\n\r\nJim,   \r\n\r\nYea I tend to get about the same info as you so its usually 3 pages-   One thing I have found is to use the copy to clipboard function, paste to word or notepad, then I cut all the \"junk\" out.  Usually my laziness overcomes my wish to save paper though and I just print the 3 sheets.');
INSERT INTO `phpbb_posts_text` VALUES (455,'05ed135267','','Hey Jamie. I didnt mean to drop the thread just life got busy :wink:  Most of the session went well. I became distracted (due to events out of  my control) and let the boil go too long and missed my volume but she came in at 1.085ish. It stayed in primary for two weeks and its still going down. last hydro reading was 1.018. I\'ll check it in a couple of weeks and let you know. It tasted good but I could sure taste the alcohol when I drank the hydro sample. I\'m very happy with it  so far. I figure I\'ll bottle this one and sit on it till Christmas. Should be smoothed out by then. :D Prost!');
