INSERT INTO `phpbb_posts_text` VALUES (4202,'b15aeccc56','','Jim,\r\nI usually dry hop with fresh hops in a bag in my keg, which is my secondary.  After the bag of hops is saturated, it sinks to the bottom.  The down side:  as the level of beer in the keg gets low, an astringency develops from the concentration of hops left in the diminished level of beer.  I\'ve never tethered the hop  bag as you have for fear of the same problem of the keg sealing.');
