INSERT INTO `phpbb_posts_text` VALUES (4006,'1aa7fd404d','Honey Deal','Monday night I was a guest speaker for the SC Beekeepers Assn.  I made several interesting contacts, some of whom may be at the meeting Monday.  I learned that the number of varietal honeys awailable to SC brewers is much larger than I could ever anticipated.  Also, the president of the beekeepers has 60 pounds of honey available for $100.00.  The honey is mixed soybean and cotton.  Both of these make excellent mead the cotton being light and mild and the soybean a bit darker and more complex. I have not seen the honey but I would guess it would make a dark gold mead.  This is an excellent opportunity for someone who wants to get into mead making to do so at a reasonable cost with quality ingredients and the potential for a killer product.  Assuming a minimum of 12 pounds per batch, $20 will put you in business.  Let\'s talk Monday.');
