INSERT INTO `phpbb_posts_text` VALUES (4001,'db6596cd02','','I had a bunch of leaks after I built mine and they were all at the kegs.  My entire system uses the barbs and no MFL connectors.\r\n\r\nRandom tips:\r\n1.	Star-san spray at connections can help chase down leaks.  \r\n2.	Try using Teflon tape on the barbs (or MFL) [u:db6596cd02][b:db6596cd02]AND[/b:db6596cd02][/u:db6596cd02] keg lube to seal.  Are you properly banding the MFLs?\r\n3.	Double check and triple check your kegs.  O-rings, pop-its and release valves will all leak with minimal encouragement. \r\n4.	If the release valves are leaking then take them apart and stretch the springs with a couple of pairs of needle nose pliers.  I learned about that one the hard way.');
