INSERT INTO `phpbb_posts_text` VALUES (3996,'c91d70686e','MFL vs. Barbed Quick Disconnects','Which do you guys think are better?  I have MFL on my dispensing tubing, but my gas side is barbed and I think that is where my kegerator is having problems.  Does anyone know if it would be worth my tim, effort, and money to completely change my system over from barb to MFL?  I am talking a complete overhaul of each disconnect as well as the distribution block and the regulator.  I am tired of having these stinking CO2 leaks.  :x    If this is too drastic please advise on corrective action to be taken!  Thanks');
