INSERT INTO `phpbb_posts_text` VALUES (3987,'440b899a15','Interesting show tonight on the brewing network RE Hops/Malt','Copied from http://www.thebrewingnetwork.com/\r\n\r\n\"The Session (Sunday Show)\r\nSunday, December 02, 2007, 5:00pm PT (8pm EST)\r\nThis week Ralph Olsen, president of Washington based hop distributer Hopunion, will join us on the show to talk about the hop shortage and what to expect in the future. Also, Ian Ward, VP Technical Director at Brewers Supply Group, will be joining us in the studio to talk about the global malt supply as well. So we\'ll have all your supply worries covered on this weeks show, so don\'t miss out! As always you can call 888.401.BEER to ask questions and participate, or join the chat room and hang out with fellow brewers.\r\n\r\nAll times Pacific Standard Time (GMT-8)\"');
