INSERT INTO `phpbb_posts_text` VALUES (4252,'2df77c04d6','Newsletter','Officers:\r\nRay has offered to post the newsletter until we can get Joseph up to speed.\r\nSend your report to Ray\'s email address: rayboland@gmail.com\r\nThe sooner he gets them (Wed. before the meeting...ooops....today...) the more likely they can get posted before Monday\'s meeting.\r\nThanks  See you Friday at HG.\r\nCHEERS!\r\n\r\n\r\nMeeting Agenda\r\nFirkin Victory Gloat\r\nNew Years Resolutions\r\nComputer Brewing\r\n\r\nFrom The President\r\nHOPPY BREW YEAR TO ALL!\r\nCongratulations to all of the Palmetto State Brewers for winning the 2007 Carolina Club of the Year.  \r\nThis accomplishment was achieved by the combined efforts of all the club members, from those that brewed and entered competitions to those that did not brew but were ground support with their enthusiasm and knowledge.  It was this mighty team effort that has earned us the reputation as a premier brew club and awards us the return of the Firkin Trophy.  GO PSB!\r\n\r\nUpon reviewing the numbers, I count 16 members as having won ribbons this year.  This is a record number for us and represents roughly 1/3 of the member roster.  Absolutely phenomenal!  Keep up the great work!\r\n\r\nA special recognition goes to Robert Leach for his second place CBoY achievement. This accomplishment makes it THREE YEARS IN A ROW that he has maintained one of the top three positions of the Carolina Brewer of the Year.  Robert, you are truly a remarkable brewer.\r\n\r\nOfficer elections were held at the December meeting.  With the addition of Joseph Ackerman, the same officers from 2007 were elected to serve in 2008.  Officers for 2008 are:\r\nPresident - Carl Foster\r\nVice President for Education and Recruitment  Chris Cole\r\nVice President Social Events  Dan Adams\r\nVice President for Competitions  Pete Goodwin\r\nVice President for Communications  Joseph Ackerman\r\nSecretary/Treasurer  Tina Cole	 \r\n								\r\nAs president, I would like to thank the past officers for their fantastic work and look forward to working with the newly elected slate.  Thanks too to Ray Boland for his tireless work as webmaster and to our Grand Curmudgeon, Harold Dowda.  Many, many thanks to ALL of the club members for your generous support and friendship in the past and I look forward to a great 08.  You are truly THE PREMIER BREW CLUB.\r\nThis is YOUR club.  Pay your dues, sign up to host a brew session, join in on the fun, make new friends, and BREW ON!\r\nIll see you at Zorbas on Monday the 14th, 6:00 dinner, 7:00 meeting.  Be sure to bring homebrew to share and to show off.\r\nCarl Foster/ Prez\r\n\r\n\r\n\r\n\r\nSecretary/Treasurer\'s Report\r\n\r\nMembership Update:\r\nPSB currently has 50 paid members\r\n\r\nOverdue members are: Harold Dowda, Bill Poole, Mark Simoneau\r\n\r\nDue January: Lee Ayers,Chris Ham, Bob Leach, Eon Mellitz, Jason Williams\r\n\r\nDue February: Dan Derrick, Jim Griggers, Mike Kelly\r\n\r\nWe currently have $3720.02');
INSERT INTO `phpbb_posts_text` VALUES (4249,'ace7055bda','','Go Bender!  Go Bender!  Go Bender!\r\n\r\nBender: Ahh, beer.  So many choices, and it makes so little difference.\r\nFry: How about Lbrau?  It has dots on it.\r\nBender: Overruled!  The choice of champions is Pabst\'s Blue Robot.\r\nFry: I can\'t drink that, the metal shavings make my throat bloody.\r\nBender: Well, well, baby wants a Zima.\r\nLeela: Hey, hey!  We can all fight when we\'re drunk.  Now listen.  Why don\'t we just brew our own beer?\r\nBender: You can brew your own beer?\r\nLeela: Sure.  The kids at the orphanarium used to do it all the time.');
