INSERT INTO `phpbb_posts_text` VALUES (3929,'2d12f34728','Reynolds Vacuum Sealer Review','One day last week I was in Publix and ran across a [url=http://www.alcoa.com/reynoldskitchens/handi_vac/en/home.asp]Reynolds brand vacuum sealing system[/url].  Considering the hop shortage and my prolonged brewing hiatus I thought it would be good to seal up the hops in my freezer.  I bought the vacuum for $10 and boxes of both one gallon (9 per box) and quart (14 per box) bags for $3.50 each.\r\n\r\nThat night I sealed about 2.5# of hops in individual bags ranging from 1oz to 8oz bags (mostly 1-2oz).  Most of the bags sealed fine but one or two out of about 15 did not seal well and lost their vacuum within a few minutes.  I cleaned the zippers and resealed them without problem.  It appears the baggies could be reused multiple times.\r\n\r\nThe vacuum itself was a little underpowered but I think the amount of air removed from the baggies is sufficient to protect the hops.  The system was easy to use.  Just fill a baggie, seal it like a regular zip-top bag, press the vacuums suction cup against the seal port marked in the corner and press the button.  The unit runs on  four AA batteries (included).\r\n\r\nAll in all I think it was $17 well spent.  You can get much better sealers at higher prices but this baggie system is convenient and easy to use.');
