INSERT INTO `phpbb_posts_text` VALUES (3925,'7d6a209624','','[quote:7d6a209624=\"ryanleach\"]4 gallons is all I\'ve got in the fermenter, and it was a mess.  Now it\'s fermenting at 82F, but my house temperature is 68-70F!  I\'ve never seen one of my beers warm up this much before.  Hope this isn\'t a huge flop.  This beer has been bizarre from the get go.[/quote:7d6a209624]\r\n\r\nYou really should try to get the temps down. If you have a secondary bath tub you could set in there and put a towel around it. let the towel set in the water. it will give a wicker effect and keep the temps down. Or do the same thing with a big bucket from Wally World.');
