INSERT INTO `phpbb_posts_text` VALUES (3923,'4b09cfa2f6','On hop and malt price increases','There\'s been a lot of talk about the hop shortage lately, so let\'s kick things off.  Excellent article over on Beer Advocate by the owner of Weyerbacher who talks about the hop and malt shortage and impending price increase in craft beer.\r\n\r\n\"A Treatise and an Appeal or How I Stopped Worrying and Learned to Love Craft Brew, At Any Price\r\n\r\nOK, here it is, your inside the industry explanation of the ridiculous price increases in Craft Brew that you are going to see very soon. Ill explain whats happened to the price of Malt and Hops and why, what can be done about it, and why you are going to see prices jump likely between 15 and 25% on the retail end for Craft brews in a matter of weeks...\"\r\n\r\n[url=http://beeradvocate.com/forum/read/1138170]Rest of the article[/url]\r\n\r\nThoughts?\r\n\r\nOh yes, he also speaks about ethanol...   :x');
INSERT INTO `phpbb_posts_text` VALUES (3922,'a201627632','','4 gallons is all I\'ve got in the fermenter, and it was a mess.  Now it\'s fermenting at 82F, but my house temperature is 68-70F!  I\'ve never seen one of my beers warm up this much before.  Hope this isn\'t a huge flop.  This beer has been bizarre from the get go.');
INSERT INTO `phpbb_posts_text` VALUES (3921,'a234326613','','It makes no sense to add oatmeal to the boil. They will gelatinize and make a mess.\r\n\r\nAt the very least, you could add them to steeped grained, but again, you will not get much out of them.\r\n\r\nThey need to be mashed with other base grains to convert the starches into fermentable sugars.\r\n\r\nI suppose that a simple steep would give you some unfermentable starches that would carry over to the final product, probably changing the mouthfeel, and possibly adding a \"floury\" taste.\r\n\r\nI think some of you will remember my multi-grain beer that I made back in 97... barley-wheat-oats-rye-buckwheat-rice-corn. It was all in there, in that order. :)\r\n\r\nI intend to outdo myself in the not-too-distant future by trying to find more different fermentable grains, and will make a 10-grain beer.\r\n\r\nAny suggestions for grains? \r\n\r\nJP');
