INSERT INTO `phpbb_posts_text` VALUES (726,'fc5df76932','Branching out','Does anyone have experience with the Cinncinatti Pale Ale in the \"How To Brew\" book (pg 6 &amp;39)? I\'m thinking about doing that next, but I have no experience to judge a recipe on. Comments/sugestions welcome\r\n\r\nRecipe [i:fc5df76932](copied from the web text)[/i:fc5df76932]\r\n[u:fc5df76932]Cincinnati Pale Ale[/u:fc5df76932]                      Ingredients for a 5 gallon batch\r\n\r\n3-4 lb. Pale malt extract syrup, unhopped \r\n2 lb. Amber dry malt extract \r\n12 AAU of bittering hops (any variety) For example, 1 oz. of 12% AA Nugget, or 1.5 oz. of 8% AA Perle \r\n5 AAU of finishing hops (Cascade or other) For example, 1 oz. of 5% Cascade or 1.25 oz. of 4% Liberty \r\n2 packets of dried ale yeast [i:fc5df76932](the book lists 3 pkg yeast)[/i:fc5df76932][/i]');
