INSERT INTO `phpbb_posts_text` VALUES (3916,'a216ba458f','','Yea.. that seems strange. Most Oat or Adjuncts are mashed or \"steeped\" with the other specialty grains. You can strain or let your beer ferment out. Then when it all settles to the bottom rack to secondary. \r\n\r\nhttp://www.howtobrew.com/section2/chapter12-2.html');
