INSERT INTO `phpbb_posts_text` VALUES (3910,'8e42a7913a','Oats','I just made a batch of ale that called for a pound of rolled oats.  After the boil when I filtered the wort there was a LOT of......well, oatmeal.  I filtered it all out.  I\'ve never used oats before, was I supposed to do that, or should I leave it in for the primary?  What do the oats contribute to the beer anyway?\r\n\r\nThanks,\r\n\r\nRyan');
