INSERT INTO `phpbb_posts_text` VALUES (3848,'c2470a7f8b','','As I have posted before, I have a Glatt mill that functions pretty well. When/if it breaks down, I would probably go with the C&amp;S. Not sure I have posted these pictures before, but these were taken a couple of years ago. I am going to modify the output bucket by cutting the bottom plywood and raising the base enough to accommodate a 5 gallon bucket.\r\n [url=http://www.jimgriggers.com/pictures/P0006715.JPG]glatt mill 1[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006717.JPG]glatt mill 2[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006719.JPG]glatt mill 3[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006729.JPG]glatt mill 4[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006730.JPG]glatt mill 5[/url]\r\n\r\nOk, I made my modification.\r\n[url=http://www.jimgriggers.com/pictures/100_4850.JPG]glatt mill mod[/url]');
