INSERT INTO `phpbb_posts_text` VALUES (3851,'dc3092c266','Charlotte Oktoberfest 2007 followup','All;\r\n    Just wanted to put a shout out to Palmetto for your positive contribution to Charlotte Oktoberfest! We couldn\'t do it w/o your participation.      \r\n    The beers you served were outstanding, and I\'m still amazed at the number of kegs you served that day.  \r\n    As information we are in early discussion of OFest event details for 2008. I think there will be some exciting changes in store.\r\n    We hope that Palmetto continues to support the event. See you at the competition in December!\r\n\r\nTony Profera\r\nCarolina BrewMasters\r\nCharlotte NC\r\n\r\nedited fer spelin');
