INSERT INTO `phpbb_posts_text` VALUES (3900,'cfbb6819b0','','Doing a quick google search I found some general statistics of their beer and threw this into Promash. Adapt as needed and add your favorite yeast. \r\n\r\n[color=olive:cfbb6819b0]Steller\r\n\r\nA ProMash Recipe Report\r\n\r\nBJCP Style and Style Guidelines\r\n-------------------------------\r\n\r\n02-B  European Pale Lager, Northern German Pilsner\r\n\r\nMin OG:  1.044   Max OG:  1.050\r\nMin IBU:    25   Max IBU:    45\r\nMin Clr:     2   Max Clr:     4  Color in SRM, Lovibond\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size (Gal):         5.50    Wort Size (Gal):    5.50\r\nTotal Grain (Lbs):       10.00\r\nAnticipated OG:          1.051    Plato:             12.64\r\nAnticipated SRM:           3.5\r\nAnticipated IBU:          25.4\r\nBrewhouse Efficiency:       75 %\r\nWort Boil Time:             60    Minutes\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 80.0     8.00 lbs. Pilsener                      Belgium        1.037      2\r\n 15.0     1.50 lbs. Flaked Corn (Maize)           America        1.040      1\r\n  5.0     0.50 lbs. Munich Malt                   Germany        1.037      8\r\n\r\n\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n  0.50 oz.    Northern Brewer                   Pellet   9.00  17.1  60 min.\r\n  0.50 oz.    Hallertau Hersbrucker             Pellet   4.75   8.3  45 min.\r\n  0.50 oz.    Czech Saaz                        Pellet   3.50   0.0  Dry Hop\r\n\r\n\r\nYeast\r\n-----\r\nWYeast 2278 Czech Pils[/color:cfbb6819b0]');
