INSERT INTO `phpbb_posts_text` VALUES (3492,'a23b3f072f','Re: Officers Meeting','[quote:a23b3f072f=\"Carl Foster\"]Inakaya on St Andrews Rd has a nice quiet atmosphere.  I\'m not too fond of suchi either, but can live on California rolls and wasabi.\r\nTina...do you think you could find something eatable there?  Updated member list is helpful but not required if you can\'t get to it.[/quote:a23b3f072f]\r\n\r\nAfter hearing about some of the goodies coming in tomorrow I would really like to meet at Inakaya.  For the non-sushi fans Inakaya is a full service Japanese restaurant.  They have some really good teriyaki and yakitori.  If you like steak and potatoes then they have that too (it\'s also mighty good).  If you like your fish cooked you might even be able to get some broiled salmon cheek.  Their beer selection is also great as long as you like Japanese brand light lagers.   :wink: \r\n\r\nI\'ll be out of the office tomorrow and off-line starting about 11am.  Somebody please let me know if anything transpires after that time(cell 513.0944).  And thanks for the fugu offer Chris but I\'m trying to cut back.  (Fugu me? No! Fugu you!)\r\n\r\nNow for your viewing pleasure - a little bunny:\r\n\r\n[img:a23b3f072f]http://img259.imageshack.us/img259/5205/cutebunnylu8.jpg[/img:a23b3f072f]\r\n\r\n(I wonder if they have any bunny dishes at Inakaya.)');
INSERT INTO `phpbb_posts_text` VALUES (3301,'fa02cfb079','','Well it turns out that my Belgium is pretty good.  I achieved 8.6% ABV without hitting terminal gravity (.001 like I was shooting for), BUT I think I have an off-flavor.  I can\'t tell with all of the phenol.  I know it is supposed to have that profile to a degree, but how much is too much?  I am trying to hide a lot of it by carbing to 4.0 vols, but I don\'t have any head retention to speak of....  BTW On head retention; is it normal for the head to go down after say a [sup:fa02cfb079]1[/sup:fa02cfb079]/[sub:fa02cfb079]4[/sub:fa02cfb079] pint or should it stay with the beer throughout the pint? \r\n\r\nBrian I am going to do your hop profile recipe next so I can fine tune my process.\r\n\r\nThanks\r\n\r\n :devil:');
INSERT INTO `phpbb_posts_text` VALUES (3304,'91e2186830','','[quote:91e2186830=\"Pete Goodwin\"]It may also be wise to not let your assistant brewer lick the glasses clean.   :wink:[/quote:91e2186830]\r\n\r\n\r\nNow you know how thorough he is at licking stuff clean!!! (no innuendo intended)     :mrgreen:');
INSERT INTO `phpbb_posts_text` VALUES (3302,'f61bd61f62','','Hey scott, At 8.6 I think you might just need time. Let it age for a couple months and check it again. I think you\'ll be surprised .  :drink:');
INSERT INTO `phpbb_posts_text` VALUES (3303,'77f4ad0abc','','[quote:77f4ad0abc=\"Scott Hasty\"]I am trying to hide a lot of it by carbing to 4.0 vols, but I don\'t have any head retention to speak of....  BTW On head retention; is it normal for the head to go down after say a [sup:77f4ad0abc]1[/sup:77f4ad0abc]/[sub:77f4ad0abc]4[/sub:77f4ad0abc] pint or should it stay with the beer throughout the pint? \r\n[/quote:77f4ad0abc]\r\n\r\nSince this is an AG recipe you should have adequate head retention.  Extracts sometimes need a little help.  It could be a problem with your glasses.  Make sure to rinse throughly with hot water to remove all soap residue.  Use a minimum amount of soap or use hot water and a sanitizer to clean your glasses.\r\n\r\nIt may also be wise to not let your assistant brewer lick the glasses clean.   :wink:');
INSERT INTO `phpbb_posts_text` VALUES (3896,'1e5012d497','','Well, we kicked over a kettle of fish with that one.\r\n\r\nCo2 is heavier than air.  It would form a layer over the liquid.  Any air entering a static equilibrium would first have to permeate the Co2 layer then the liquid.  Even discounting the CO2 layer permeation of air would be slow and eventually for a gradient top to bottom with little air reaching the places where it is needed.  The fermentation process would create some turbulance so mixing at the air/CO2 interface may occur a bit faster than in a true static system but the effect would me minimal at best.  Don\'t ask for specific examples, I don\'t do math anymore.\r\n\r\nAlso, a note in passing, accept with a box of salt most \'experiments\' done by home brewers.  Many of the ones I have read were severly faulted.  Like no controls, the same not being done to all the tests,  inoculum not standardized between the tests etc.  A good example of a hideous \'experiment\' was a comparison of BrewFerm kits that was actually published in BYO or Zymurgy a couple of years ago.  I used it to show my Master\'s students how not to do experiments :D');
