INSERT INTO `phpbb_posts_text` VALUES (3895,'02029bc459','','It sounds like what they really want is for you to brew them a [url=http://www.bjcp.org/styles04/Category1.html#style1C]Premium American Lager (BJCP 1C)[/url]. There should be no shortage of recipes out there on the interweb for this. But, why not do one better and go for a Helles? Build them up slowly...');
INSERT INTO `phpbb_posts_text` VALUES (3889,'d3b29223b5','','Actually, it\'s the other way around. The bottles are plenty strong, but the corks will ease out given the right amount of pressure.\r\n\r\nYou\'d be better off putting the mead in 22oz beer bottles.\r\n\r\nJP');
INSERT INTO `phpbb_posts_text` VALUES (3890,'a21257c6d9','','Champagne bottles are plenty strong.  They hold highly carbonated, well, champagne.  You just have to wire down the corks so they don\'t slip out prematurely.  Pete, contact me by email or PM, I may be able to help with a corker, in exchange for a bottle.');
