INSERT INTO `phpbb_posts_text` VALUES (3841,'8cfda0523b','','I\'ve heard of them, they have been around for quite a while. They are used in small car/camper coolers and have gotten very cheap in the last few years. The thermoelectric modules are small, compact, and make no noise.\r\n\r\nThat being said, they are very inefficient, meaning it takes quite a bit of electricity for the amount of heat it moves. My impression is they are used for continuous cooling and not cycled on-and-off like a compressor based refrigeration system. One reason this might be done is there is a good thermal conduction through the module when the electrical current is turned off. Another may be a reliability issue in that cycling the module reduces it\'s life time. In any case, I don\'t know of any big, household refrigerators that use thermoelectric cooling.\r\n\r\nI have looked at a few small coolers in the stores. Most all instruction manuals stress putting already cooled or heated food into the box (many of them will also keep food warm by reversing the current in the thermo module). This is because the modules don\'t move a great deal of heat, and to actually cool/heat a large mass would require much bigger modules (at more cost) and require a (maybe unavailable) large amount of current.\r\n\r\nI played around with some thermoelectric modules maybe 20 or so years ago when I worked at NCR. At that time, they were experimenting using them to cool microprocessors. A spin-off company (KryoTech) went on to cool microprocessors so they could run at faster speeds, but they moved away from thermoelectric cooling and went to using a refrigerant based cooling system. I never inquired why they did this, but I suspect is was because the thermoelectric modules were not capable of moving the amount of heat generated.');
INSERT INTO `phpbb_posts_text` VALUES (3504,'8bec1f6370','','Poll. When I left DHEC restaurants were expected once a year.  Sometimes a little more often if there was a history of problems.  If a complait is received inspection is done as soon as an inspector can get there.  Usually within 24-48 hours.\r\n\r\nMost minor problems result in only a short time til reinspection.  24 hrs is not uncommon.');
INSERT INTO `phpbb_posts_text` VALUES (3507,'8b79a719db','Meeting - educational topic','Hey,\r\n At next months meeting (09/10/07) the educational topic-o-the day will be Brewing Disasters. Hopefully/certainly weve all had our share of foolishness that led to valuable and sometimes messy, sticky lessons! So, please come prepared to expound upon any mishaps and lessons therein. Lack of a blow-off, capping all of your bottles and then realizing that you forgot to prime, etc There should be no shortage of amusing anecdotes. I will be unable to attend but thankfully I have never engaged in any less than stellar brewing practices!  lol  (Of course, the above examples wouldn\'t be from personal experience... or would they?)');
