INSERT INTO `phpbb_posts_text` VALUES (3522,'32553757d0','','Well since I won\'t be at the meeting this month (or any month for a while -- damn you Monday night class!!!) I\'ll add my inspiring tale of brewing dumbassery.\r\n\r\nThis happened this past Sunday. Which only goes to show, it doesn\'t matter how many times you\'ve done something, you can still screw it up...\r\n\r\nI was in the middle of my mash. I went outside to turn the burner on under my HLT in anticipation of my sparge. Went back inside.\r\n\r\nAbout 15 minutes later, a realization came to me: my sparge water, which I had measured out earlier, was not in my HLT -- it was still sitting in a bucket! Yes, I had my burner just about on full blast for 15 minutes with an EMPTY aluminum pot sitting on it.\r\n\r\nI raced outside, killed the flame, and lifted the lid on my HLT to reveal a very large hole that had melted through the bottom. There was melted aluminum all over my burner and my front porch. And my thermometer, which had been resting in a hole in the lid to that kettle, had gotten screwed up. Man, talk about feeling stupid.\r\n\r\nI was able to clean out the burner (mostly) and luckily I had a duplicate converted keg to sub for my HLT. The mash ran a little longer than planned but I\'m just glad I was able to finish brewing. My girlfriend, who was out anyway, picked me up a new thermometer (although it *appears* my old one fixed itself).');
