INSERT INTO `phpbb_posts_text` VALUES (4493,'2b7cda44ad','','Nice write up Jamie.  Thanks for posting it.  \r\n\r\nThere has always been a lot of controversy on forums and such about the necessity to decoct and it can be hard to sort through the BS.  Brew books seem to have the most reliable information but they can be a little dry reading.  This write-up is a nice summary for those of us on the lazy side.\r\n\r\nIve heard a number of times that the maillard reaction is one of the main reasons to decoct and Im not sure I have a real good handle on what it is exactly.  I understand it is similar to caramelization but how does it differ?  Is it a lower heat version of caramelization or something more complex?\r\n\r\nHmmm.  Maybe I should quit being lazy and read a book sometime.');
INSERT INTO `phpbb_posts_text` VALUES (4494,'5265d6a22b','tonight','This is an excerpt from the Free Times. We shall see:-)\r\n\r\nAs for what you should do: start off with the Macaroni and Cheese Wedges ($5.95). Now, I have no idea if deep-fried triangles of breaded mac-and-cheese are anything Bono and the Edge would chow down on but who cares? These things are disgustingly good. \r\n\r\nCare to take another leap of culinary faith? Garys Frog Legs ($3.50 for 2), fried in a soda-light batter and served with a sweet wasabi-plum dipping sauce, come off a touch greasy, but no more so than your average chicken wing, which, true to the adage, these kind of taste like. Again, Irish? Well, frogs are green, right? And Kermit, according to the baby name books, at least, derives from Dermot, an old Gaelic name, so \r\nYeah, I know.\r\n\r\nAnyway, the entres more closely reflect the Irish appetite. After considering the Bangers and Mash as well as McDags Meatloaf, I ultimately fell for that Irish-American standby, Corned Beef and Cabbage ($7.95). Supposedly 10 ounces, the duel slabs of cured brisket basking in the broth of my bowl were, Id wager, a mite bigger. Accompanied by roasted russets and Savoy cabbage, the dish proved both hearty and lean, if a little blunt by the time I swallowed my 400th bite. Mrs. T., feeling a smidge bloated herself after a cup of bacon-heavy Potato Leek Soup ($2.95), deferred to the sandwich board and the Irish Pumpernick ($6.95): pastrami, white cheddar, grilled onions and brown mustard on the eponymous pumpernickel and served with fries and a fried pickle spear. Not surprisingly, this was hardly a light alternative. That said, it was a bloody fine sandwich, something I can vouch for, having snagged two or three meaty bites from her plate despite my impending gout.');
