INSERT INTO `phpbb_posts_text` VALUES (4808,'7f7d4f7805','Portland OR trip update','I recently paid a visit to Portland Oregon for a week-end, so I thought I\'d report my experience over there. This is a bit tongue-in-cheek and silly - just like me.  :mrgreen: I didn\'t take any notes, so I don\'t recall that many of the beers that I had.\r\n\r\nFirst of all, I think I can officially call Portland as \"Beer Mecca USA\". It by far has the most brewpubs I\'ve ever seen in a town, and the number of great beer bars is quite impressive too.\r\n\r\nThe first spot I visited was on the friday for lunch, where I decided I\'d drop by a local german restaurant called Gustav\'s ( http://www.gustavs.net/ ) (it\'s a small local chain). I had a really decent meal there, consisting of \"beer smoked sausage\', red + white krauts, and scalloped potatoes. Very tasty. I tried a Koenig Ludwig (german) hefe-weizen, and it was off. I felt pretty bad by returning that one because it was a tall (32oz?) beer. I made the girl try the tap, and she couldn\'t tell for certain if it was off. To me, it tasted old and oxidized, and the typical murkiness of the hefe wasn\'t there. My guess is that it was too old. I instead tried a taste of the Franziskaner, and it was fine, so I had a tall one. I had a \"Dessert beer\", which was a Spaten Optimator, it was excellent too.\r\n\r\nI drove over to the Pittock Mansion ( http://www.pittockmansion.org/Default.asp ) , which is the mansion that Henry Pittock used to own in Portland. Pittock was a newspaper magnate. If you\'ve been to the Biltmore Estate, you\'ll think that Pittock\'s house was a log cabin comapred to Biltmore\'s (I think the sqft is 16,000 vs 175,000 for Biltmore). \r\n\r\nI proceeded to Rogues\' Public House ( http://www.rogue.com/locations-portland.html ), and had a couple strong beers, which were *excellent*. Rogue has been distilling for a little while, legally. They even have a small (working?) still upstairs. Their selection of beers was very impressive. Prices were typical Rogue prices, aka \"high\".\r\n\r\nOn the recommendation of the bartender, I proceeded to \"New Old Lompoc\" brewpub (http://www.newoldlompoc.com/lompochome.html ), and had dinner and a couple more beers there, both of which were excellent. \r\n\r\nAfter that, I headed to the hotel, hoping to take a nap between 6:30p and 9pm. I finally scraped myself out of bed at 11:15p, and made it over to \"Horse Brass Tavern\" ( http://www.horsebrass.com/pintarich.html ) I spent a good amount of time talking with the locals, about brewing, beers, etc. I had a couple H.U.B (Hopworks Urban Brewing ) hand pulled IPA\'s, and a Tricerahops Double IPA, also on cask. I closed the place down at 2:30am (odd hours, 2:30?)\r\n\r\nSaturday, I visited a very small casino a little bit outside of Portland, in WA state, in a small town called \"La Center\". (odd name). \r\n\r\nI then proceeded to Lucky Labrador Brewing\'s bier hall ( http://www.luckylab.com/html/story.html ) where they were having a barleywine tasting. There were 26 BW\'s to be had. I ended up sampling 5 (in 4oz glasses), none of which I wrote down, but most were well made. I also had a couple of Lucky Lab\'s regular offerings (they\'re not listed on their website, so I don\'t remember).\r\n\r\nI again needed a nap. (no surprise after BW\'s). I went over to Gustav\'s for dinner and had their wiener schnitzel, which was \"OK\". I\'ve had better.  I had a Franziskaner there.\r\n\r\nI decided to drop by the brewpub that was immediately next door to Gustav\'s, called Laurelwood Brewing ( http://www.laurelwoodbrewpub.com/brewery.php ). I had the Boss IPA, the Workhorse IPA, and the Tree Hugger  Porter. All of which were *excellent*.\r\n\r\nI was in bed by midnight, and made my 8:50 flight with just enough time to spare.\r\n\r\nMy thoughts on Portland:\r\n\r\nWOW. What a beer place. A \"must-go-before-I-die\" place, for certain. Many of the beers have \"imperial influence\" (Imp IPA, Imp Pilsener, etc) and therefore not session beers. \r\n\r\nPrices on beer were extremely competitive. 3.75 to 4.25$ for well poured pints, including the imperials. \r\n\r\nAnd, my final thought: I know where ALL of the hops are in the US: In PORTLAND!\r\n\r\n :cheers: \r\n\r\nJP');
