INSERT INTO `phpbb_posts_text` VALUES (3882,'61db5b99ed','','[quote:61db5b99ed=\"Tony Profera\"]\r\n\r\nReason being the flow rate from the aquarium pump would be as minimum as one could get right?  If slow minute bubbles being more advantageous for yeast were true, wouldn\'t the aquarium pump be the best of the three methods?  The oxygenator although using an air stone giving minute bubbles would still be pressurized in turn giving a more vicious aeration.\r\n\r\nI am no authority nor do I know the exact method of the oxygenator; just putting it out there.[/quote:61db5b99ed]\r\n\r\num-   not quite-   it has nothing to do about the delivery more of what can be delivered-\r\n\r\nO2 being 21% of the air-    max is 43ppm-   21% of 43ppm= about 8% and since our goal is 12% (or more for a heavy beer) then neither shaking nor aquarium pump hits the goal-\r\n\r\nSo if 8ppm is the max that you can oxygenate your wort using either shaking or aquarium pump then why bother getting a pump at all?\r\n\r\nthey both work though-   8% is enough to brew good beer but 12% is better right?\r\n\r\n:)');
INSERT INTO `phpbb_posts_text` VALUES (3883,'8622169eb0','','[quote:8622169eb0=\"Tony Profera\"]Excellent discussion here! \r\n\r\n   There is an article by M.B.Raines that researched yeast growth (in a starter) by various methods. The \"stirred\" method with a foil cap was the clear winner with almost 250% greater yeast cell growth than the next closest method - aerating.\r\n\r\n   Here\'s a link to that article on the Maltose Flacons site.\r\nhttp://www.maltosefalcons.com/tech/MB_Raines_Guide_to_Yeast_Culturing.php\r\n\r\n   Here\'s a question I\'ve had. Is it better to let the 02 flow slowly for fine small bubbles while oxygenating the wort , or let it fly for larger bubbles and more vigorous wort movement? I\'m guessing that the smaller O2 flow is advantageous as it allows more saturation before the foam crawls out the top of the carboy. Anybody know the real deal?[/quote:8622169eb0]\r\n\r\nFrom what I think we have hypothesized I\'m wondering how they got these results-   they keep mentioning that the stirplate is oxygenating the wort but from what our hypothesis states that there will be a CO2 \"blanket\" inside the flask/bottle, plus it is under positive pressure- so it should keep the O2 out....\r\n\r\nI\'m wondering how they preformed this experiment?');
INSERT INTO `phpbb_posts_text` VALUES (3881,'8366cc90a3','','[quote:8366cc90a3=\"Tony Profera\"]Is it better to let the 02 flow slowly for fine small bubbles while oxygenating the wort , or let it fly for larger bubbles and more vigorous wort movement? I\'m guessing that the smaller O2 flow is advantageous as it allows more saturation before the foam crawls out the top of the carboy. Anybody know the real deal?[/quote:8366cc90a3]\r\n\r\nI am not familiar with using an oxygenator, but it seems to me that it would be a pressurized O2 canister being let go in the wort.  My mental picture is releasing a balloon under water/wort.  Correct me if I am wrong.  I think you place an air stone on the end right?  With all of that being said wouldn\'t the inital findings from wyeast still hold true being;\r\n\r\n[quote:8366cc90a3=\"chriswillis\"]short answer- \r\n\r\nShake for 40 seconds- 8ppm \r\nAquarium Pump for 5 min- 8ppm \r\nO2- 60 seconds- 12ppm \r\n\r\nso- aquarium pump is waste of money.... shake is just as good! but 02 is best... [/quote:8366cc90a3]\r\n\r\nReason being the flow rate from the aquarium pump would be as minimum as one could get right?  If slow minute bubbles being more advantageous for yeast were true, wouldn\'t the aquarium pump be the best of the three methods?  The oxygenator although using an air stone giving minute bubbles would still be pressurized in turn giving a more vicious aeration.\r\n\r\nI am no authority nor do I know the exact method of the oxygenator; just putting it out there.');
