INSERT INTO `phpbb_posts_text` VALUES (3879,'a50563d69a','','Excellent discussion here! \r\n\r\n   There is an article by M.B.Raines that researched yeast growth (in a starter) by various methods. The \"stirred\" method with a foil cap was the clear winner with almost 250% greater yeast cell growth than the next closest method - aerating.\r\n\r\n   Here\'s a link to that article on the Maltose Flacons site.\r\nhttp://www.maltosefalcons.com/tech/MB_Raines_Guide_to_Yeast_Culturing.php\r\n\r\n   Here\'s a question I\'ve had. Is it better to let the 02 flow slowly for fine small bubbles while oxygenating the wort , or let it fly for larger bubbles and more vigorous wort movement? I\'m guessing that the smaller O2 flow is advantageous as it allows more saturation before the foam crawls out the top of the carboy. Anybody know the real deal?');
