INSERT INTO `phpbb_posts_text` VALUES (4802,'81b1c56e53','Big Brew Day May 3rd at Bet Mar','Big Brew Day is coming up. It will be on May 3rd. Those that will be setting up for this will need to be to Bet Mar around 8:30 or 9:00AM. People will be brewing and there will be those that bring homebrew samples to share. \r\nBet Mar will need volunteers for the following:\r\n[b:81b1c56e53]Brewing[/b:81b1c56e53]- If you choose to brew an official Big Brew Day recipe (see Sonya about this) you will receive 30% off the ingredients at Bet Mar (normal discount does not apply).\r\n[b:81b1c56e53]Set-Up[/b:81b1c56e53]- You need to be at Bet Mar around 8:30 AM to set up. This will mean setting up tables, making sure the water is hooked up and hoses are where they need to be, PSB sign is hung, canopies are placed, and tables are set-up.\r\n[b:81b1c56e53]Clean-Up[/b:81b1c56e53]- This will mean you need to be at Bet Mar when things are beginning to close down (about 4-6PM if my memory serves me correctly).\r\n[b:81b1c56e53]Someone to check ID\'s, make sure waivers are signed, and  armbands are worn[/b:81b1c56e53]- All you have to do is sit by a table and instruct people what to do.\r\n[b:81b1c56e53]Cook Brats[/b:81b1c56e53] (If we decide to sell them this year)-\r\n[b:81b1c56e53]Serve food and drinks[/b:81b1c56e53] (again, if we decide to sell them)- \r\n[b:81b1c56e53]Bring homebrew samples[/b:81b1c56e53]- kegs or bottles that you are willing to share with visitors and members\r\n[b:81b1c56e53]Bring Tables[/b:81b1c56e53]- Several are needed\r\n[b:81b1c56e53]Bring Canopies[/b:81b1c56e53]  - At least 3 needed\r\n[b:81b1c56e53]Judge the beer competition[/b:81b1c56e53]- Preferably BJCP judges (you know who you are) PLEASE!!!\r\n\r\nMore details will be added to this posting as I hear more. So, check back. If you know what you want to volunteer for for Big Brew Day send me a PM and I will update the list. \r\n\r\nBrewing: Dan Adams\r\nSet-Up:\r\nClean-Up:\r\nCheck ID\'s, waivers, armbands:\r\nCook Brats:\r\nServe food and drinks:\r\nBring Beer Samples: Dan Adams\r\nBring Tables:\r\nBring Canopies:\r\nJudges:[b][font=Arial Black:81b1c56e53] [/font:81b1c56e53]');
INSERT INTO `phpbb_posts_text` VALUES (3873,'4e17a1f9a2','Re: Oxygenation','[quote:4e17a1f9a2=\"Scott Hasty\"][quote:4e17a1f9a2=\"chriswillis\"]This opens another question-   airlocks on a stir plate-   if we put a airlock on our starter then why are we using a stirplate-   if the goal is to keep injecting more and more O2 then if we put an airlock on all we have is CO2.  Would it be better to just use tin foil, and even then would the positive pressure from the CO2 keep all O2 out?[/quote:4e17a1f9a2]\r\n\r\n\r\nI have been using a stir plate for my starters and never used an airlock (unless swirling).  I just crimp tin foil areound the mouth of the flask.  Once fermentation is complete, I use a rubber band on the tin foil and place it in the fridge.  Here is what I am not understanding though.  CO2 is heavier than O2; O2 is introduced via loose fitting tin foil.  Vortex sucks O2 in.  Now, wouldn\'t the vortex essentially be sucking CO2 back down before leaving the flask.  Wouldn\'t that be detrimental to the starter?[/quote:4e17a1f9a2]\r\n\r\nI do the same thing-  and have the same question LOL-\r\n\r\nwith the CO2 being generated there is a positive pressure also- so not only what your saying but the positive pressure would be keeping any O2 from coming in also-   Perhaps this is the reason I\'ve heard to hit your starters with like 10 sec of O2 every now and again...');
INSERT INTO `phpbb_posts_text` VALUES (3872,'57c71ef44a','Re: Oxygenation','[quote:57c71ef44a=\"chriswillis\"]This opens another question-   airlocks on a stir plate-   if we put a airlock on our starter then why are we using a stirplate-   if the goal is to keep injecting more and more O2 then if we put an airlock on all we have is CO2.  Would it be better to just use tin foil, and even then would the positive pressure from the CO2 keep all O2 out?[/quote:57c71ef44a]\r\n\r\n\r\nI have been using a stir plate for my starters and never used an airlock (unless swirling).  I just crimp tin foil areound the mouth of the flask.  Once fermentation is complete, I use a rubber band on the tin foil and place it in the fridge.  Here is what I am not understanding though.  CO2 is heavier than O2; O2 is introduced via loose fitting tin foil.  Vortex sucks O2 in.  Now, wouldn\'t the vortex essentially be sucking CO2 back down before leaving the flask.  Wouldn\'t that be detrimental to the starter?');
