INSERT INTO `phpbb_posts_text` VALUES (3833,'564ddf0fbb','','Crank &amp; Stein 3 roller here. Love it! It comes ready to hook up with a drill as well. \r\n\r\n There is a lengthy discussion about Monster and C&amp;S on the greenboard. Check [url=http://www.brewboard.com/index.php?s=&amp;showtopic=81371&amp;view=findpost&amp;p=960625]HERE[/url] for the discussion. I got mine\r\nfrom Fred and he\'ll stand behind his product.\r\n\r\n\r\nOn the flip side. Barley Crusher mills are great as well. Str8 out the box and ready to mill. \r\n\r\nGood Luck on your quest! Aside from going AG, it will be one of your best investments. :devil:');
