INSERT INTO `phpbb_posts_text` VALUES (3871,'3907bdf3eb','Re: Oxygenation','[quote:3907bdf3eb=\"Scott Hasty\"]\r\n\r\nWhat about stir plates or are we talking about large scale (5 gallons) or starter size?[/quote:3907bdf3eb]\r\n\r\nI think the goal with stir plates is to keep the O2 levels ~2 ppm to keep the yeast cell count increasing-   if the 02 runs out then the cells will stop reproducing and just make beer out of the wort-  While there is O2 present the cells will keep making more cells and not make beer out of your starter.\r\n\r\nI think aerobic life cycle is something like this-       yeast+sugar+O2=CO2+heat+more yeast cells\r\n  \r\nanaerobic is more       yeast+sugar=CO2+heat+Alchohol\r\n\r\nso in a \"perfect\" starter you would only have aerobic respiration while in your beer it would only be anaerobic!\r\n\r\nI think the problem with O2 toxicity comes in for big brewers in their \"starters\" because some of them constantly inject O2 to get the biggest starter possible.  I suppose if we hit our starters with pure O2 we could run into that as home brewers also-   but with a stir plate the O2 PPM is much less-  \r\n\r\nThis opens another question-   airlocks on a stir plate-   if we put a airlock on our starter then why are we using a stirplate-   if the goal is to keep injecting more and more O2 then if we put an airlock on all we have is CO2.  Would it be better to just use tin foil, and even then would the positive pressure from the CO2 keep all O2 out?');
