INSERT INTO `phpbb_posts_text` VALUES (1750,'e05a19bbba','Officers Meeting','Officers:\r\nSeems to me we need to include in tomorrows discussions:\r\n	Calendar for the year\r\n	Budget\r\n        Monthly meeting agenda\r\n	Whats on your mind\r\n        Whats on tap\r\n\r\nFYI:\r\nI have been soliciting input from club members at HG and at Dans brew session.\r\nWhat do you want the club to do and what do you want the club to be this year?\r\n\r\nJudging Classes for competitions.\r\nBasic classes in brewing techniques.\r\nJust to make good beer and drink good beer.\r\nA schedule for brewing for beer to be ready for competitions.\r\nLess business time in meetings.\r\nAccess to club member list with their contact information.\r\nField trips to breweries and festivals.\r\nRoad trips to purchase beer.\r\nVolume purchase of brewing supplies.\r\nMonthly meetings with speakers.\r\nEducational buildup towards AHA competition styles.\r\nShow and tell:\r\n	Latest gadgets\r\n	New techniques\r\n	New products\r\nHave year calendar of events published early.\r\nKeep balance of club emphasis. (ie. Not just competitions, but also on brewing techniques)\r\n\r\nAlso:\r\nWhile at Bet Mar today purchasing hops, I asked Sonja and Mark to give a basic and short How to brew from extract talk at this Mondays meeting.  (ChrisI hope you dont mind)\r\n\r\nBet Mar wants to host a brew session in the next couple of months and wil post soon.\r\n\r\nI have ordered a 9 x 12 plaque to present to Gerald at Mondays meeting.\r\n\r\nSEE YOU TOMORROW!\r\nCHEERS!\r\nCarl');
