INSERT INTO `phpbb_posts_text` VALUES (3870,'497d7a98cd','','I\'ve heard that too-   but I have never seen any proof anywhere-\r\n\r\nmy layman\'s understanding is this-\r\n\r\n1) wort can hold ~43ppm of any gas at room temp/sea level\r\n\r\n2) even if you pump it full of O2 there will be some \"air\" that takes some of this 43ppm just via racking/stirring/the surface of the wort touching the air\r\n\r\n3) O2 is not as soluble in liquid as other gases (co2 etc) so the O2 dissipates over time and is replaced with other gases-\r\n3a) this might be \"air\" that is in the carboy/other fermentation vessel\r\n3b) after the lag this is the c02 that \"scrubs\" the O2 out of the wort\r\n\r\n4) Conclusion-   15ppm is \"healthy\"  and unless in a lab I\'m guessing over 30ppm is unlikely- and even oxygenated to that point the O2 will be replaced by other gases within 2 hours and end up to about 8ppm.  I suppose this is why many people suggest to hit the wort with O2 every couple hours for a high-gravity until lag phase ends...\r\n\r\nBut,  I\'ve heard that there can be O2 damage after the lag phase.  My understanding is that this is more related to starters than to the wort itself.   Unless it is a super high-gravity wort I\'ve never hit it with O2 except before pitching.  From what I have read 15 sec or so of O2 is fine into your already fermenting wort down until it is about 70% fermented out.  The goal here is add ~2ppm to help the yeast keep multiplying to replace their losses over time.\r\n\r\nThe negative O2 issue happens with starters/yeast propagation when people hit them with too much &gt;2ppm[b:497d7a98cd] after[/b:497d7a98cd] the lag phase-\r\n\r\n\r\n\r\nI seem to remember Harold disagreeing with during one of the PSB meetings though-   something about creating too many yeast cells so the beer ferments too fast-  I\'d really enjoy hearing more about this! I suppose this could be true if temp control is a issue-   the more yeast cells the more heat generated...');
