INSERT INTO `phpbb_posts_text` VALUES (3869,'b831c0d785','Re: Oxygenation','[quote:b831c0d785=\"chriswillis\"]A few meetings ago there was a discussion about Oxygenation and times-    Wyeast have done some testing and have found that the 02 levels should be about 8-15 PPM and tested various methods and effectiveness.\r\n\r\nshort answer-\r\n\r\nShake for 40 seconds- 8ppm\r\nAquarium Pump for 5 min- 8ppm\r\nO2- 60 seconds- 12ppm\r\n\r\nso-   aquarium pump is waste of money....  shake is just as good!  but 02 is best...\r\n\r\nLong answer-\r\n\r\nhttp://www.wyeastlab.com/hb_oxygenation.cfm[/quote:b831c0d785]\r\n\r\n\r\nWhat about stir plates or are we talking about large scale (5 gallons) or starter size?');
