INSERT INTO `phpbb_posts_text` VALUES (3836,'8283a4eb63','','A few months ago I got the C&amp;S 3 roller and am quite happy with it!\r\n\r\nI had some questions a couple weeks ago and e-mailed both Fred and Don at the same time-   \r\n\r\nDon came back 8 hours later with a nice personal letter addressing my concerns and a committment to support his products.\r\n\r\nFred Replied 3 days later with a brief note that didn\'t quite adress my concerns with a suggestion the product I spent a LOT of money for could be replaced with a Monstermill that would work better....  \r\n\r\nI was left with the impression that while Fred \"says\" he will \"support\" what he sold me, his support would come from a small discount off a new mill.... Don seemed gracious and truly concerned it worked as it was supposed to. \r\n\r\nI guess it just burned me a bit to have the guy who sold me the C&amp;S tell me that he sold me a peice of junk and that I should upgrade to the monster mill....');
