INSERT INTO `phpbb_posts_text` VALUES (3867,'d7100046e6','','The newsletter has been amended to include Betmar\'s submission.  For convenience the information is here:\r\n\r\n\r\n[b:d7100046e6][size=18:d7100046e6]Bet-Mar Liquid Hobby Shop[/size:d7100046e6][/b:d7100046e6]\r\n\r\nHops, hops, hops. Y\'all know as much as we do about the \"panic buying\" that precipitated this year\'s shortage. Supply &amp; demand dictates the results. On our end, we\'re being forced to commit to \'08 purchases without knowing our cost! We\'ll get what hops we can &amp; let the chips fall where they may.\r\n\r\nLooking forward to our brewsession on Saturday, Nov 17th. Stop by for a brew!\r\nWere stocked up &amp; ready for mead &amp; beer-makers, and taking any special-order requests.\r\n\r\nSupport your local homebrew store,\r\nSonja &amp; Mark\r\nBet-Mar Liquid Hobby Shop\r\n\r\nStill 10% off for paid-up PSB members.\r\n \r\nSupport your local homebrew store,\r\nSonja &amp; Mark\r\nBet-Mar Liquid Hobby Shop\r\n798-2033');
INSERT INTO `phpbb_posts_text` VALUES (3865,'20f9e350af','Oxygenation','A few meetings ago there was a discussion about Oxygenation and times-    Wyeast have done some testing and have found that the 02 levels should be about 8-15 PPM and tested various methods and effectiveness.\r\n\r\nshort answer-\r\n\r\nShake for 40 seconds- 8ppm\r\nAquarium Pump for 5 min- 8ppm\r\nO2- 60 seconds- 12ppm\r\n\r\nso-   aquarium pump is waste of money....  shake is just as good!  but 02 is best...\r\n\r\nLong answer-\r\n\r\nhttp://www.wyeastlab.com/hb_oxygenation.cfm');
