INSERT INTO `phpbb_posts_text` VALUES (3860,'e2f051e743','','the barrel is in my estimation, the achilles heal. but steve-o reports we are good to go with the original barrel. so we\'re on for the racking party on the 17th of nov.\r\n\r\ni\'m not sure we would/could have done much different. the brew went off well, and fermenting everything in one 150 gallon fermenter is the way to go if possible. individual batches seem in my estimation, problematic. it has been a grand experiment to say the least. on which all participants are really placing a $25 bet on some good brew in a year. \r\n\r\nwe sampled a sneak preview at the meeting today at thomas creek and i must say that brew\'s got legs. i think it will be great in a year from now. even tom the master brewer at thomas creek was impressed.\r\n\r\nmy suggeston would be geta  fresh barrel, keep it hydrated, and go with that.\r\n\r\nin the end you\'re rolling the dice either way. but it\'s sure to put some brewing experience under your belt for sure.');
