INSERT INTO `phpbb_posts_text` VALUES (3783,'062544fc8e','Long Hammer','I hate to bitch, but I still think I got taken at Jake\'s this evening. We ordered a couple of Long Hammer IPAs at Jakes in 5 Points, and were served something like 10 ounce glasses for $6.50 each. We were told it was a \"high gravity\" beer. On checking the web site, Long Hammer is a whopping 6.5% ABV, 5.1% ABW.  Don\'t think I\'ll order any more of these from Jake\'s.\r\n\r\nJust thought I would send out a warning to others on this forum.');
