INSERT INTO `phpbb_posts_text` VALUES (3786,'08183d897f','','Yeah, there are a couple places around town that advertise new beers (like Longhammer and Brooklyn IPA, hah!) as \"High Gravity\" and charge silly prices for them.\r\n\r\nThose places are scams.. just stay away.  There are roughly 5 good places in town to drink beer, IMO.  My home being one of them.   :mrgreen: \r\n\r\nColumbia desperately needs a good pub with fresh craft beer and no freakin\' TVs.  But that\'s another thread.');
INSERT INTO `phpbb_posts_text` VALUES (1062,'9b1bc02fcc','Using Oatmeal','I was wondering if anyone has experience using oatmeal in the mash. What would something like two lbs oats in a grainbill, along with seven lbs pale ale malt, maybe some caravienna or something like that taste like? Maybe just use a single hop for bitterness.');
INSERT INTO `phpbb_posts_text` VALUES (1064,'1348074d02','Oatmeal','Brian:\r\nI have brewed a couple of stouts using oatmeal.  One used  lb oatmeal and the other 1 lb. of oatmeal, both were 5 gal. batches.  Neither had the strong oat flavor and thick mouth feel that I was looking for.  My mash temp was probably a little low at 150F also.\r\nMy next batch will have 1  lbs oatmeal and a higher mash tempthanks to the advice from JR.\r\nCheers,\r\nCarl\r\n PS:  Looks like I missed a great brew day.');
INSERT INTO `phpbb_posts_text` VALUES (1065,'cf775883ed','','Hey Carl, We did have a good time. It was the first time (group brew virgin :oops: ) I brewed with anyone except my dog jake so I was a bit nervous at first but everyone made me feel at ease. I\'m sorry you missed it but that trip is tough. Anyway I decided to brew A batch this weekend and use two lbs oats and eight lbs M.O. with a little caramunich and I\'ll report back with the results. Prost and Happy Fourth to everyone!');
