INSERT INTO `phpbb_posts_text` VALUES (3830,'5bed5557b8','Grain Mill Question','What are the pros and cons to mills with the above mentioned rollers.  Thinking of getting one, but don\'t know anything really about the mills.  Looking for insight and hopefully a decision making epiphany!  You know the usual; \"If I had to do it all over again, I would...\" kind of thing.  Hook me up with advice!!!  All advice appreciated.  Also I would like to see some brand discussion as well.  Barley Crusher, C&amp;S, Monster, JSP; what makes one better than the other, what should I look for in a mill, etc.  BTW, If I do purchase a mill I would like to use a drill and maybe later motorize the contraption.');
