INSERT INTO `phpbb_posts_text` VALUES (4851,'d3bb426433','Belgian Ale Forum','I have had several people talk to me about setting up a Forum about Belgian Ales Only.\r\nI have set this forum up with many forums about the World of Belgian Ales. Check it out and see what you think. At the present time, it is open to anyone but if spammers start to post I will have to change it to registered users only. You can go ahead and register and you will be set if the spammers do arrive. \r\nLook at the beginning forum about registering as I have posted a message about filling in your location and club. Hope this goes over well and if you have questions or info about any of the Belgian Ales you can make a post. \r\n\r\nGary\r\n\r\nhttp://www.garyc3.com/phpbb2/index.php');
