INSERT INTO `phpbb_posts_text` VALUES (3740,'bb35ab8f75','','Well, if the wort and yeast are too different it can be hard times for the yeast.  A 100 degrees likely will kill the yeast, 20 may not have any significanteffect and anything more may increase lag time..YRMV');
INSERT INTO `phpbb_posts_text` VALUES (3741,'3ac9aadd4f','','[quote:3ac9aadd4f] A 100 degrees likely will kill the yeast[/quote:3ac9aadd4f]\r\n\r\ni guess i was assuming we all know not to pitch yeast on to 100 wort. but like i said, in my personal experience the delta t of refrigerated slurry vs 75 wort temps have had no discernable effect on taste or lag times. in fact i usually get rather vigorous ferments when cold pitching. neither has the delta t of room temp hydrated yeast vs 75 wort have had any adverse effects. but as you say, YMMV');
INSERT INTO `phpbb_posts_text` VALUES (3742,'72c7a00a97','','[quote:72c7a00a97=\"chriswillis\"]\r\nKatherine, did you ever expect to open such a can of worms!\r\n:)[/quote:72c7a00a97]\r\n\r\nI was hoping to, I would like more discussion of homebrew and home brewing on the forum. I always learn loads when the can is opened. I just wish I knew enough to contribute rather than just ask. My curent batch is perfoming wonderfully in fermentation so the discussion is having an immediate impact - Thanks &amp; Keep it up.  :drink:');
INSERT INTO `phpbb_posts_text` VALUES (3743,'381af063e1','Joel\'s Braggot','My memory was not too good when I told some people about this recipe at the last meeting. I put a lot of details into this but it really is a pretty easy procedure.\r\n\r\nYeast starter-Prepare 2 to 3 days before brewing braggot\r\n1 gallon water\r\n1 cup light DME\r\n4 Northern brewer hop pellets-15 min. boil\r\n1 vial White Labs California Ale Yeast WLP001\r\n\r\nBraggot\r\n1-3.3 lb can Munton Extra Light Malt Extract\r\n5-lbs. Sam\'s honey\r\n\r\nStart with 2 gallons of water-put on to boil-Just before boil begins add malt extract\r\n\r\n1/2 oz Challenger hop pellets-8.0% Alpha-15 min. boil\r\n1/2 oz Kent Golding Hop pellets-6.0% Alpha-15 min. boil\r\n\r\nAt the end of the boil-add honey\r\n2 tsp yeast nutrient\r\nChill wort to 75 deg. F\r\nPure oxygen aeration-2 minutes\r\n\r\nPour off half the volume of the yeast starter (Top clear liquid)\r\nPitch the other half including the yeast slurry\r\n\r\nOriginal gravity 1.101\r\n\r\nAfter 1 month rack into secondary\r\n\r\n6 months later-Final gravity 1.022\r\n\r\nAdded 1/3 cup corn sugar to priming tank dissolved in 1 cup hot water.\r\nAdded 1 vial White Labs Champagne Yeast WLP715-Racked braggot on top\r\n\r\nBottled 1 case of 12 oz bottles.');
INSERT INTO `phpbb_posts_text` VALUES (3744,'6fa610ea23','Bourbon Barrel Brew','we are locked and loaded for the bourbon barrel brew starting tomorrow at around 6:00 am. the recipe will be as follows\"\r\n\r\n[code:1:6fa610ea23]Yeti Imperial Stout \r\nA ProMash Recipe Report\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size &#40;Gal&#41;&#58;        80.00    Wort Size &#40;Gal&#41;&#58;   80.00\r\nTotal Grain &#40;Lbs&#41;&#58;      312.00\r\nAnticipated OG&#58;          1.102    Plato&#58;             24.18\r\nAnticipated SRM&#58;          63.1\r\nAnticipated IBU&#58;          77.4\r\nBrewhouse Efficiency&#58;       75 %\r\nWort Boil Time&#58;             60    Minutes\r\n\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 78.2   244.00 lbs. Pale Malt&#40;2-row&#41;              America        1.036      2\r\n  5.1    16.00 lbs. Crystal 150L                  Great Britain  1.033    150\r\n  3.8    12.00 lbs. Chocolate Malt                America        1.029    350\r\n  3.8    12.00 lbs. Black Patent Malt             America        1.028    525\r\n  3.8    12.00 lbs. Roasted Barley                America        1.028    450\r\n  2.6     8.00 lbs. Flaked Soft White Wheat       America        1.034      2\r\n  2.6     8.00 lbs. Flaked Rye                    America        1.034      2\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n 16.00 oz.    Chinook                           Whole   13.00  46.2  60 min.\r\n  8.00 oz.    Chinook                           Whole   13.00  23.1  60 min.\r\n  8.00 oz.    Centennial                        Whole   10.50   5.0  15 min.\r\n  8.00 oz.    Centennial                        Whole   10.50   3.1  5 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWYeast 1056 Amercan Ale/Chico[/code:1:6fa610ea23]\r\n\r\ni\'ll post pix later');
INSERT INTO `phpbb_posts_text` VALUES (3635,'0aa93f37cf','20# CO2 bottle (empty) for sale','I already have 3 full 20# cylinders and a full 5# cylinder, I figured I don\'t need this one. It will need to be hydro tested, which runs about $18 at Columbia Fire and Safety. Another thing it needs but is not necessary is a handle since a full bottle weighs around 45#. This is a Luxfer aluminum bottle which goes for around $105 new. Lighter that an equivalent steel bottle and it doesn\'t rust. Asking $30.\r\n[url=http://www.jimgriggers.com/pictures/100_4724br.jpg]Luxfer bottle[/url]\r\n\r\nupdate: bottle has been sold');
