INSERT INTO `phpbb_posts_text` VALUES (1178,'20e79d8e28','Re: Onion Beer???????','[quote:20e79d8e28=\"Scott Hasty\"]Are there any fermentable sugars in an onion?  Can an onion be used and still the oniony flavor after fermentation?[/quote:20e79d8e28]\r\n\r\nC\'mon man.  You\'re not still thinking of making an onion beer are you?  Where are you going to find the onion extracts anyway?\r\n:P \r\n\r\n\r\nYes, onions do have fermentable sugars but in what proportions I don\'t know.  It will likely vary from variety to variety.  You may want to experiment with a small amount of onion balanced with plenty \'o malt just to be sure.  Increase onion and decrease malt as you experiment.\r\n\r\nI could only guess that the onion flavor would come through because I\'ve never known anyone reckless enough to even consider an onion beer.  You\'re livin\' on the edge.  \r\n\r\n lol');
INSERT INTO `phpbb_posts_text` VALUES (1179,'d7aeb24daf','','Onions are my favorite vegetable and I think it sounds like a FINE IDEA! They have quite a bit of carbohydrate which easily converts to sugar (caramelized onions). I would recommend a [i:d7aeb24daf]fresh[/i:d7aeb24daf], sweet onion such as a vidalia, Walla-walla, Texas 1015 or Peruvian Sweet. Old onions can be bitter. Prior cooking of the onions would help break down the complex CHO to sugar. I don\'t think you would want to add fat as you would normally in sauteeing or caramelizing. A negative effect might be the development of allum flavors during fermentation, but using fresh onions and not overcooking should take care of that. Caramelized onion ale,  YUM-YUM   :drink:');
