INSERT INTO `phpbb_posts_text` VALUES (3671,'30af0f7bae','NE O\'fest Report','Went to O\'Fest Friday night.\r\n\r\nFew facts and observations:\r\n\r\nCosts ten bucks to get in for which you get nothing.\r\n\r\nSteady crowd of 200 or so.  Wait til tomorrow when the crowd is there...\r\n\r\nThe only sanitary facilities are 4 port-a-johns located on a small hill.  The ground up to them is extremely rough especially in the dark.  Several older people fell trying to get to them (NOT yours truely).  There are no lights inside so it is \'cock and fire\' for the guys with potentially hideous consequences for the girls. BRING A FLASHLIGHT! if you will be there in the evening.\r\n\r\nThere are no lights anywhere except in the large tent and, here and there, in the food tents; not enough to see what you are buying.  The dessert temt was using a flashlight. BRING A FLASHLIGHT! if you will be there in the evening or be prepared to stumble a LOT.\r\n\r\nEat before you come or at one of the nearby shops.  Food was awful except for the wurst (brat and rot) which were very good and was expensive for what you got (meat and 2 sides).  All food except the wurst seemed to be low grade commercial crap. Even the kraut was poor (how the hell do you screw up kraut?). Food was cold. Weiner snitzel breading was stale and gummy.  Meat was pork not veal making it a very thin Jaeger schnitzel.  Desserts were commercial lot job type but cheap ($2 for a slice of Black Forest cake should have been fair warning). Noodles were cold and stuck together. Took 25 minutes to buy food with about 50 people in line.  They had two serving lines but only one ticket taker.\r\n\r\nNo arts/ crafts were available.\r\n\r\nTook 20 minutes to get a beer with about 30 people in line.  There were three order takers but all orders went through one tap man.  12 oz $4.  0.5 liter glass filled with beer $10 but refills only $4, 1.0 liter mug filled $20 refills?.  Warsteiner, Watsteiner O\'fest, Spaten Helles, Spaten O\'fest.  Beer was in good shape.\r\n\r\nMaybe tomorrow and Sunday will be better.');
