INSERT INTO `phpbb_posts_text` VALUES (3735,'8a590602e2','','Jamils podcast are very helpful.  when I refer to cold pitching what I do is transfer a beer To the keg and keep about a quart of the slurry. Seal it up in a sanitized mason jar and label it. When I brew the next batch I just pull the slurry from the fridge  and pitch it in the new batch. I try to keep most aspects of brewing as simple as possible. I have never had a negative experience. In fact I usually have very fast starts and finish quickly. It is amazing so many folks brew differently yet still turn out some pretty good beer. Prost!');
INSERT INTO `phpbb_posts_text` VALUES (3648,'052800a82c','Report from Oktoberfest 2007 - Munchen, BY','Well folks, yours truly managed to make it to Munich and back this year, and I must say, the Oktoerbfest is alive and well!!! \r\n\r\nAnd very crowded I might add. My buddy Tony &amp; I were only able to get a seat at a table in a tent ONCE in the 5 times we were at the \'Fest. \r\n\r\nNonetheless, it was a LOT of fun.\r\n\r\nTons of great beers were had, amongst which:\r\n\r\nHefeweizens:\r\nFranziskaner\r\nHacker-Pschorr\r\nErdinger\r\nHofbrau (at a bier garden - not as good as the others, could barely finish a Mass, I\'d give it a 6/10)\r\nFrstenberg (near Freiburg - Had never had it - excellent, 9/10)\r\n\r\nOktoberfest:\r\nAugustiner (my favorite of the Okto\'s)\r\nPaulaner\r\nSpaten\r\nLowenbrau (my 2nd fav)\r\nHofbrau\r\n\r\nOther beers:\r\nBitburger (Pils, in Frankfurt - same as here, not worth my trouble)\r\n\r\nBeers around Munich were around 3.30E just about everywhere, which would be pretty cheap if the Euro wasn\'t as strong. With exchange, it\'s 4.75$ or so, still not outrageous (helluvalot cheaper than Chicago!).\r\n\r\nJP');
