INSERT INTO `phpbb_posts_text` VALUES (3734,'b51b117e6c','','I think this thread is taking a life of its own!\r\n\r\nKatherine, did you ever expect to open such a can of worms!\r\n\r\nFrom my limited knowledge cold pitching has nothing to do with Dry Yeast and usually nothing to do with white labs/wyeast liquid yeasts (including starters).  \r\n\r\nSome of these guys (myself included) try to make things as complicated as possible, with each step saving either a little time or money.\r\n\r\nJamil\'s (mr. malty) web site is quite good about pitching rates,  I also think he is a very bright fellow and am looking forward to perusing his book-   I\'ve never tried one of his recipes but just looking at them they appear quite good!  The link Barry posted I refer to often when deciding some of my starters for my \"extra special\" beers.\r\n\r\nI\'m not sure if any/all of you listen to some of jamil\'s (or brewing network\'s) podcasts but some of them are quite good!  If I am thinking of a new style of beer I look at his old podcasts and listen to a bit of the history and his ideas to help me form a recipe-  http://www.thebrewingnetwork.com/jamil.php\r\n\r\n\r\n:)');
INSERT INTO `phpbb_posts_text` VALUES (1266,'9d9211285f','Simco Pale ale..','I\'ve been on a single hop pale ale thing for a while now and today I brewed a simco pale ale. I have never used them before. I used a half ounce at 60 and 45. IBU\'s 48. AA\'s were 14.0 Anyone else experiment with Simco. If so what did you think of them. \r\n\r\n11 lb. Belgian pale\r\n1 lb. Dextrine malt (Cara-Pils)\r\n10 oz. British crystal 50-60L \r\nMash: 68% efficiency \r\n150 for sixty min. \r\nBoil: 60 minutes SG 1.048 6.5 gallons \r\nwhirlflock at 15 min \r\nHops: .5 oz. Simco (14.4% AA, 60 min.)\r\n.5 oz. Simco (14.4% AA, 45 min.) \r\nYeast: Nottingham ferment at 68\r\nIBU\"s 48');
