INSERT INTO `phpbb_posts_text` VALUES (3729,'a3233d1247','','from my experience of collecting yeast and storing in the fridge for later use, i have cold pitched most everytime i could. now if the yeast collected is a month or two old - sure i\'ll need a starter - that\'s a gimmie. i have no fancy words and descriptives like some of you guys ... lol - i just know that cold pitching has consistantly produced great results. \r\n\r\n1056, ringwood, and a few others seem to lend themselves better to cold pitching. they seem to be able to be stored longer than anyother yeast i collect and have the ability to wake up and do their job.');
