INSERT INTO `phpbb_posts_text` VALUES (1272,'238e093e26','','That does look good Brian.  I did an all simcoe extract beer.  It had 9 ounces  spread out over 60 minutes plus a dry hop.  Simcoe X-1\r\n\r\nUgh.  It was tasty and you could smell the thing two countys over.\r\n\r\nFor Simcoe X-2 I think I\'ll back off a little on the hops.\r\n\r\nI really like the hop and adding an addition every 5 minutes or so gave me a very broad range of flavors and aromas.  It was complex and I should have let it age a couple of months for futhere development of flavors before tapping but I just couldn\'t wait.  \r\n\r\nEven though it has a high AA content consider using it as a finishing hop too!  I think you\'ll be pleased.');
