INSERT INTO `phpbb_posts_text` VALUES (1306,'9fbdaf2bf1','&quot;Kick A$$ Potato Salad&quot;','I found this recipe on the web and made it for Pete\'s Brew day last month.\r\nYet another way to make a \"salad\" a bit less healthy.\r\n\r\nOfficially called \"Blue Cheese Potato Salad\" \r\n\r\nAs Printed:\r\n\r\nIngredients:\r\n4 Slices of bacon\r\n2 pounds new red potatoes\r\n1/2 cup of olive oil\r\n3 tablespoons of white vinegar\r\n1 bunch of green onions, chopped\r\n1/2 teaspoon salt\r\n1 teaspoon black pepper\r\n1 1/2 onces of blue cheese crumbled\r\n\r\nDirections:\r\n\r\n1) Cook bacon, drain, crumble and set aside\r\n\r\n2) Boil potatoes unitl tender, but firm. Drain, cool and chop. Leaving skins on \r\n\r\n3) In large bowl, wisk oil, vinegar, green onions salt and pepper. Add Potatoes, bacon and blue cheese and toss.\r\n\r\nAs I made it:\r\n\r\nAbout 6 slices of precooked bacon used straight from the package. \r\nOnly about 1/4 cup of oil\r\nlet\'s say 2.5 onces of blue cheese (A.K.A. blue cheese to taste) \r\n\r\nI was a little worried when eveything was in the bowl, but then I gave it a good shake in a covered bowl and \"Poof\". Really good potato salad');
