INSERT INTO `phpbb_posts_text` VALUES (3725,'fb265840fe','','KS,  I refer you to Jamil Zainasheff\'s web site for the answer to all of your questions regarding yeast temperatures, starters, etc.\r\n\r\nhttp://www.mrmalty.com\r\n\r\nI chill my wort to a few degrees below the desired fermentation temp and pitch a 4L starter that is roughly within 5 deg of that temp.  My thinking is that the lower temp helps offset the metabloic energy released during the early replication stage.  I have also pitched warm yeast into 50 deg wort when making lagers and, of course, there is a several hour lag before fermetation begins.  As you will notice, JZ prefers to pitch lagers at 43 deg.  The next time I try something like that, I will acclimate my starter for a few hours in the fridge before pitching it.\r\nI hope this helps.\r\nCheers,\r\nBL');
