INSERT INTO `phpbb_posts_text` VALUES (3722,'15dec3d06b','','I\'ve not read any empirical data about the exact range but for ales I expect fermentation room temp is probably ok.\r\n\r\nI think the largest temperature concern is when the tube/smack pack is taken from the fridge (to be pitched either into the wort or the starter).  I try to let it warm to room temp 2-4 hours if possible prior to pitching into an ale wort.  \r\n\r\nI would assume that the freeze dried stuff is a little more stable in regards to temperature.  The freeze dried yeast has not fully formed cellular walls and can be damaged by many of the commercial nutrient packages so I usually rehydrate in water then pitch into wort with only O2-  no nutrients.   I will add the nutrients after a couple hours.\r\n\r\nAs for wort temp,   I try to bring it down to 3 degrees lower than my planned fermentation temp.  I suppose my starter is probably slightly warmer but I don\'t think this hurts anything!\r\n\r\n:)');
