INSERT INTO `phpbb_posts_text` VALUES (3721,'a6043dacc0','temps question','I have been reading a bit about this and am wondering what other people do regarding matching the temperature of the hydrated yeast / starter to that of the receiving wort. Generally I hydrate yeast in some wort or water prior to pitching. I am  wondering what tolerances are used to avoid shocking the yeast in either situation.\r\nAlso does anyone allow the wort temperature to stabilize to fermentation temperature prior to piching yeast. If so for how long. \r\n\r\nTIA,   :cheers: \r\nKS');
