INSERT INTO `phpbb_posts_text` VALUES (3674,'2afcb3c98e','','I musta just missed you!\r\n\r\nI showed up about 9ish and had a awesome time!  By 9 there was no line for the beer.\r\n\r\nThere where 4 beer choices-  Warsteiner Octoberfest, plain ole\' Warsteiner, Spaten Munich lager (I assume this is just plain Spaten Lager) and Spaten octoberfest.\r\n\r\nThe best part was watching the drunks dancing.  There where girls with mullet\'s dancing.  Some guy with his oriental wife who didn\'t seem to speak english doing some type of wacked our ballroom/newage/polka.   Did I mention a girl with a mullet?\r\n\r\nmy friends and I just couldn\'t stop laughing!   everyone was just dunk as skunks and having a grand old time!\r\n\r\nFor those who have been to a octoberfest-   It was like a tent of italians!!!\r\n\r\nI didn\'t try the food or anything but noticed that most/all of it was from the German Meat market.  The cakes where actually shipped from Germany frozen I think.  He makes the wurst and schnitzel himself.  His is NOT bavarian but more of from around nuremberg or maybe even Hessen.  \r\n\r\nI have seen his stuff be a little stale at times- only because he is one guy shop without a lot of turnover-   He usually makes the schnitzel each day to order- so he probably had to make and freeze it!\r\n\r\n:)');
