INSERT INTO `phpbb_posts_text` VALUES (3366,'610d546b33','','Brian does keep his recipes on a tight leash. We visited the brewery a couple years ago and talked with him for a good while. He wouldn\'t disclose any information. I guess he feels he has a solid recipe that pays the bills and there are soo many other DIPA\'s out there that he doesn\'t need to disclose his recipe. \r\n\r\nIf I had to guess, I would guess lots of Malt, biscuit, little crystal, not sure about the bittering, but maybe some Simcoe in the finish.');
INSERT INTO `phpbb_posts_text` VALUES (3685,'a7787ba238','At least you got German beer.','This seems very much like an Octoberfest my friend Doug and I went to years ago when I was in Columbia.  It was pretty crappy all around.  The only foreign beer was Corona and the only beer with a German name was Budweiser.');
INSERT INTO `phpbb_posts_text` VALUES (3684,'ed237e3030','','We got there around 5:00 or so on Sunday. It was $3 to get in. Saw JP there. Event was cash only which would have been fine if we had gotten lots of money before heading to Lake Carolina. $13 for schnitzel? Buzz and I pooled our money and were able to get 4 beers and a couple of wursts. The only ATM I found (in the pizza place across the street) was out of order. Buzz did win a T-shirt. Horrible DJ playing not-so-Oktoberfest music, more like for beach party.\r\n\r\nI think Harold\'s observations were right-on. Don\'t think I\'ll make the drive out next year unless they make some changes. The Spaten Oktoberfest was good.');
