INSERT INTO `phpbb_posts_text` VALUES (4868,'db49e1f53b','stuff for sale in Spartanburg found on green board','http://www.brewboard.com/index.php?showtopic=89408\r\n\r\n[quote:db49e1f53b]Due to down sizing to a smaller place, and not having enough time, I am selling all my homebrew set up.\r\nI am selling it all together and is for pick up only. I live in Spartanburg, SC...\r\nAll the stuff needs is a little dusting off.\r\nStuff includes\r\n\r\n7 gallon aluminum pot and cooker\r\n6 1/2 gallon glass carboy\r\n5 gallon glass carboy\r\n7 gallon plastic bucket with lid\r\nbottling bucket\r\ntwo corney kegs with faucet tap for a fridge and all the hoses needed\r\nfull co2 tank\r\ncaper\r\nbottle caps\r\nkeg lube, ss racking cane, hoses, new set of O rings, sanitizer\r\nair locks, bungs and some other little things. Everything you need to start brewing and kegging.\r\n\r\nPM me with questions or offers and come and take this stuff off my hands...\r\nThanks[/quote:db49e1f53b]');
