INSERT INTO `phpbb_posts_text` VALUES (4786,'438d7a4b32','Palmetto State Brewers Registration','Welcome to the Palmetto State Brewers, Inc. Homebrew Club forum. Palmetto State Brewers, Inc. is a non-profit homebrew club in South Carolina. Our purpose is to enjoy and promote the hobby of homebrewing. If you are interested in becoming a PSB Club member contact the VP of Recruitment when you sign up. The PSB forum is also open to neighboring homebrew club members.\r\n\r\nWhen registering please enter your [b:438d7a4b32]FIRST AND LAST NAME IN THE USERNAME BLANK[/b:438d7a4b32], aliases will not be approved to use this forum.\r\n\r\n[url=http://www.palmettostatebrewers.com/forum/profile.php?mode=register]PSB Forum Registration[/url]\r\n\r\nPlease introduce yourself and share your homebrewing background in the PSB Forum when you join.\r\n\r\n :cheers:');
INSERT INTO `phpbb_posts_text` VALUES (4787,'f3aad0f22d','March Meeting','[b:f3aad0f22d]Welcome to our New Members: Jessie Simoneau, Andy Thomas, and Craig Stover[/b:f3aad0f22d]\r\n\r\n[b:f3aad0f22d]Membership Update:[/b:f3aad0f22d]\r\nOverdue: Eon Melitz, Dan Derrick, Jim Griggers, Mike Kelly\r\nDue March: Robin Dial, Bill Garrett, Sam HEss, Brian Mosely\r\nDue April: Chris and Tina Cole, Gary Kunes, Bob Molchan\r\n\r\nThere were 33 people present at the meeting. This included 26 members. There are 52 paid members in PSB. \r\n\r\n[b:f3aad0f22d]Club Only Competition[/b:f3aad0f22d]- Porters: Only one entry and it was wonderful- Bob Leach\r\n\r\n[b:f3aad0f22d]Events Coming up: Check the forum for details on date,time, and any other details.[/b:f3aad0f22d]-US Open (May)\r\n-Highland Brewing Company\'s homebrew competition\r\n-Cigar and Pint night. Friday, March 14th at7PM. Post on the forum if you plan to go. A headcount is needed beofre beers and cigars are purchased. \r\n-Big Brew Day- May 3rd. A signup sheet will be posted on the forum very soon. There will be a 30% discount on ingredients for any club member that brews one of the Big Brew Day Official recipes.\r\n\r\nHarold Dowda is willing to give a BJCP benchmark test sometime in May or June since there appears to be a great deal of interest. If you are interested, go to the bjcp.org website and print the materials. You will have to study a great deal prior to the May/June test. After this benchmark test, Harold will consider having some study sessions (beer faults, etc) for those that are truly interested in BJCP. \r\n\r\nMatthew Ellisor- [b:f3aad0f22d]Education topic [/b:f3aad0f22d]- Hop and other herbs to use in brewing\r\nLow alpha acid hops are hard to find. Consider trading with fellow homebrewers or begin experimenting with herbs. Some examples of substitutions are: Ground Ivy, Bog Myrtle, and sage. For more infomation on this topic talk to Matthew.\r\n\r\nRaffle: Thanks to Carl for supplying a mash tun for the club raffle. The raffle raised $24.00.');
