INSERT INTO `phpbb_posts_text` VALUES (4777,'7957fea840','English Ales','Thanks for the kind words.\r\n\r\nAs you perhaps noticed The Free Times is revamping the Dining and Drink section.  Because of this change in format and to accomodate other items, the article was severely edited after I submitted it  (I was asked to submit on fairly short notice).  About 1/3 of the article was cut out by the editorial staff  including the main courses (curried chicken, steak, lamb) and chocolate mousse dessert all of which were paired with a different ale.   That\'s the newspaper biz. BTW, the pairing with the main courses were outstanding.\r\n\r\nWith respect to JP\'s comments about \"classic pairings,\" one of the points I was trying to make is that in England,  the beers that have survived pair well with the hearty but uninspiring cuisine in England.  The styles that have survived are bitters and brown ales.  Most of the other styles such as mild, IPA, Porter and Barleywine all but died out but were only recently revived because of  the American Beer Renaissance led by homebrewers.  In England, I suspect no one thinks of a classic pairing because bitter work well with most food and not much thought is required.  People on the outside looking in determine the \"classic pairings.\"\r\n\r\nSee you guys on Monday.\r\n\r\nCheers!  \r\n\r\nGerald');
