INSERT INTO `phpbb_posts_text` VALUES (4775,'d8fa4a5bf9','','While I find Gerald\'s writings quite impressive, I always kind\'a question the \"classic this or classic that\". The beer realm has changed dramatically in the UK in the last 10-20 years. \r\n\r\nI worked in the UK for nearly 1 year back in \'97, and the advent of the \"Lager period\" was rather advanced at that time. Not that many people do the traditional pairing of \"classic\" ales with classic foods.\r\n\r\nI think the only beer area that hasn\'t changed TOO much (while it still has) is the German beer field, and quite possibly the Belgian field. \r\n\r\nTimes-are-a-changing, as Bob Dylan once said. Yesterday\'s classics are on their way out.\r\n\r\nJP\r\nPS: I\'m having an Old Crusty from the Rogue Pub in Portland as I write this. :)');
INSERT INTO `phpbb_posts_text` VALUES (4480,'729a514295','','It seems the only difference between decoction and infusion mashes is where you get the water (or wort) to raise the mash temp....so why does decoction have such a rep of being so hard?');
INSERT INTO `phpbb_posts_text` VALUES (4481,'b769c69798','','An infusion mash is one step, one temperature.  For example...heat a quantity of water proportionate to your grain bill (1 qt per lb of grain for instance) and stir in your crushed grain.  ProMash can compute that temperature or you can use trial and error.  An example would be:  10 qts of water at 172 degrees for 10 lbs of grain.  When mixed, your mash temperature should stabilize at 155 degrees.\r\n\r\nA decoction mash is a multi-step process whereby you raise the temperature of your mash in certain steps.');
