INSERT INTO `phpbb_posts_text` VALUES (4476,'ab5ae2ee59','','For single infusion mash, I use promash. It has a strike water temp section that helps me determine what my strike temps need to be before doughing in. Once I hit my target temp, I add that water to my mash tun, add grain, and stir. Put the lid on and wait for a minute or two and check. If I reach my dough in temp within a few degrees I am golden.\r\n\r\nIf I miss it by a lot, then it usually becomes panic mode. :P');
