INSERT INTO `phpbb_posts_text` VALUES (4478,'0de76cab5c','','I also use ProMash, and as Phil can attest, at the brewing session, I hit my target temperature within 1/2 degree. I\'m always impressed when I do that. :D \r\n\r\nProMash also has \"mash designer\" for multi-step mashes, but I have never explored how it works.');
INSERT INTO `phpbb_posts_text` VALUES (4479,'e518835a5d','','Jim, I was so impressed with that  *)   , I went home and downloaded the free trial version of ProMash.   8)   \r\nHaven\'t used it yet, but I will.  Even as an extract brewer, I figure I will reap some benefit from the program.\r\n\r\nFolks, it was amazing to see that temp dial right in on his target temp, he had a thermometer in the grains, brought his strike temp to what ProMash indicated it should be (given the grain temp and target mash temp), and within about a minute or two of doughing in, the temp was settling within a degree of what he wanted.');
