INSERT INTO `phpbb_posts_text` VALUES (4377,'7714ebc686','','I bouced this question off a friend who is the audiophile type, he is also a DIY type, so he built his own speakers for much less than it would cost to buy retail stuff...here is what he had to say.\r\n\r\n__________________________________________________\r\n\r\nHmm whats he want it for? music or ht? Whats he got now?\r\n \r\nFor that price can always try the ebay route for a used one. \r\nOtherwise for $100 hard pressed to get anything, especially powered. Below are three places that carry lot of speaker stuff. Found their sub kits 200-300.  \r\n \r\nhttp://www.madisound.com/index.html\r\n \r\nhttp://www.madisound.com/catalog/product_info.php?cPath=35_41&amp;products_id=417\r\n \r\n \r\nhttp://www.speakercity.com/Merchant2/merchant.mvc?\r\n \r\nhttp://www.speakercity.com/Merchant2/merchant.mvc?Screen=PROD&amp;Store_Code=SC&amp;Product_Code=PS10Kit\r\n \r\nhttp://www.partsexpress.com\r\n \r\nTry putting this in a small box.\r\nhttp://www.partsexpress.com/pe/showdetl.cfm?&amp;Partnumber=295-466 \r\n \r\nLook at this subwoofer DIY forum for ideas. Do a search.\r\nhttp://www.diyaudio.com/forums/forumdisplay.php?s=e3d3f707139af1faa52d44c6f5e3a883&amp;forumid=63\r\n \r\n \r\n \r\nor if he just wants to augment the bass...could try this.  Silver Iris OB 10\" Augie     $125 (ea.) open baffle. One would work ok. Just mount it in a board. Could check out the forums for ideas. \r\n\r\nhttp://hawthorneaudio.com/drivers.htm');
