INSERT INTO `phpbb_posts_text` VALUES (4383,'7a57222bbc','','To follow up my post, I actually dry hopped for 4 or 5 days, with the pellet hops in a nylon bag suspended with mono filament. When the bag was removed, there was a fair amount of hop dust that flowed out of the bag. What I did was let the beer settle, and every day for about 2 weeks rotated the keg to move the yeast/hop sludge to the pick-up tube, then pulled off the sediment. Beer was starting to get clearer before it was carbonated and transported. Keg was pretty much drained about the time the party was shut down for noise (it spilled out into the hall of the hotel). I\'ll attach pictures of some other beers we had. And yes, I was starting to get sloshed by the time the Double Bastard was finished. :drink: \r\n[url=http://www.jimgriggers.com/pictures/DSC_0041rc.jpg]Double Bastard standing[/url]\r\n[url=http://www.jimgriggers.com/pictures/DSC_0046rc.jpg]Double Bastard story[/url]\r\n[url=http://www.jimgriggers.com/pictures/DSC_0057rc.jpg]Double Bastard pouring[/url]\r\n[url=http://www.jimgriggers.com/pictures/DSC_0058rc.jpg]Double Bastard sitting[/url]\r\n[url=http://www.jimgriggers.com/pictures/DSC_0049rc.jpg]Dragon\'s Milk[/url]\r\n[url=http://www.jimgriggers.com/pictures/DSC_0052rc.jpg]Unearthly IPA[/url]');
