INSERT INTO `phpbb_posts_text` VALUES (4391,'79eaf7fbba','','Hey Jim, I plan on coming to the brewsession.  Since I am a newbie, what do I need to bring?  I presume, my burner and kettle, and a fermenter, lid and airlock to put it in when done.  And of course, my ingredients.  Is that about it?  You have a wort chiller, or should I bring mine?  Do you normally pitch yeast at the session, or later when you get back home and get the wort settled into its final resting place??');
INSERT INTO `phpbb_posts_text` VALUES (4392,'efaf17e7d4','The Year In Beer','Interesting article:\r\n\r\n[img:efaf17e7d4]http://img3.freeimagehosting.net/uploads/acf0cda33e.jpg[/img:efaf17e7d4]\r\n\r\n[b:efaf17e7d4][size=18:efaf17e7d4][url=http://thebeergeek.com/]They\'re website[/url][/size:efaf17e7d4][/b:efaf17e7d4]');
INSERT INTO `phpbb_posts_text` VALUES (4393,'1ce68b1765','','Phil, everything on your list you should bring, and you will need to bring a wort chiller or borrow someone\'s. My wort chiller is a counter-flow chiller designed for my system. I do have a filtered water faucet on the kitchen sink, so brewing water is no problem. Another way to chill your wort is to float the brew kettle in the swimming pool (holding on to it of course and stirring the wort) The water is in the low 50s, so that would be a quick way to chill your wort. To be honest, I\'ve not taken my brewing on the road, so others are more qualified to answer that question, but personally, I would pitch the yeast as soon as the wort is cool and aerated (or oxygenated).');
INSERT INTO `phpbb_posts_text` VALUES (4394,'c8146dbc7a','','Using spent grain  adds more texture than flavor. It makes for a good rustic bread. We generally do our in a bread machine (mainly because I\'m lazy). You can really use any recipe for whole wheat bread and substitute a little spent grain for the flour...just cut back a bit on the water (since the grain will be wet).');
