INSERT INTO `phpbb_posts_text` VALUES (4402,'8cca0bd67c','brew session','Jim, thanks for hosting a fun brew session. \r\nThe chili was outstanding and I think you and Phil managed to brew successful beers despite my help.  \r\nI enjoyed sampling the beers that you, Brad, and Jamie/Ray created.  What a treat!\r\n\r\nEvery time I attend a brew session, I learn something new about beer and brewing.  \r\nThis event was no exception.  Berliner Weisse, Spiced Ales, Vanilla Maple Porters, Quigleys  Barleywine, boiling within 1  inches of the lip of the kettle with no boil overs, yeast culturing, slants, homemade stir plates, counter flow chillers, electric HLT, natural gas conversion, digital read outs, much, much moreand NEON!   WOW!\r\nThanks to all that attended!');
INSERT INTO `phpbb_posts_text` VALUES (4403,'3062664a44','Columbia Water Report','Here\'s the water analysis for December 2007. Note there are two sources: Canal and Lake Murray. I\'m not sure how you determine where your water comes from but I know mine is from the canal; I live in Earlwood. Those who live west of town might be drawing from Lake Murray. \r\n\r\nI also have this in Excel and HTML format but I don\'t think I can upload files to to forum ... Ray?\r\n\r\nBrew on.\r\n\r\n[img:3062664a44]http://lh6.google.com/bradpetit/R5zKexbqDUI/AAAAAAAAAY8/L3HMObtR2lg/s800/Water1207.png[/img:3062664a44]');
