INSERT INTO `phpbb_posts_text` VALUES (4405,'fed39c00ce','MALT Pint Night At The Thirsty Monk Asheville Friday Feb 15','I thought I would go ahead and post our invitation to you to join us for our monthly social.\r\nThe Thirsty Monk is a Belgian beer bar that opened Wednesday Feb 23 at 50 Commerce Street in Asheville.\r\nIf you are familiar with Jack Of The Wood, The Thirsty Monk is across the street (Patton Ave) and half a block down Coxe Ave on the left.  Commerce street is the first street on your left as you travel down Coxe toward Asheville Brewing Company.\r\nIf you pass the Post Office on your right, turn around. You just missed the street.\r\n\r\nThis will be our first Friday Pint Night. Previously, Pint Night was held on Thursdays the week before our regular meeting, which is the on the third Thursday of the month.\r\n\r\nOur Pint Night will be on the second Friday of each month with the location changing each month.\r\n\r\nI hope that PSB members that like to come to Asheville for the Weekend will put this open invitation on their calendar.\r\nCheck our forum for the latest info on Pint Night and other items of interest.');
INSERT INTO `phpbb_posts_text` VALUES (4406,'a0e1e8a874','','Great Brew session!! Sorry I got there late, but, better late than never.... right. 8) \r\nAt least I got to enjoy the Quigley\'s barleywine.. ehmm good stuff. The homemade salsa was excellent.\r\n\r\n\r\n :drink:  :cheers:');
INSERT INTO `phpbb_posts_text` VALUES (4407,'e227736bc9','','Alright folks!  The Wiston-Salem Marriott ((336) 725-3500) is about 4 blocks walking from Foothills and has rooms with 2 king beds for $119 / night.  I personally have no compunctions about packing 4+ people in there Friday night and walking to Foothills in the AM.\r\n\r\nApparently there is a gathering at Foothills planned for Friday night, then Saturday we\'d go over, buy our beer and hob-knob with other beer geeks.  Would like to leave no later than 8pm on Saturday, unless you guys are crazy enough to stay Sunday night as well!\r\n\r\nThoughts?  More info on the Foothills event when I get it.  It\'s a great bar and the food is good, it\'s quite easy to kill time there...\r\n\r\nOh yeah, they fill growlers and sell kegs too.   :drink:');
INSERT INTO `phpbb_posts_text` VALUES (4408,'09ab2594db','Road trip','Sounds good to me. I imagined leaving some time in the afternoon. I really had no set time in mind, nor any good reason to come back early.');
INSERT INTO `phpbb_posts_text` VALUES (4409,'0f44b4dc4b','','To follow up on my dry hopping adventures...\r\nI bottled the alleged alt bier yesterday and it was very clear. The (loose) hops (pelletized) used were were well water logged and settled to the bottom nicely. I did not use any filtering device for racking. I did disturb the trub a little with the racking cane but it seemed to settle in the bottling bucket. I am sure the last few bottles will have sediment, but if it is too bad I\'ll just give it to Pete since he is into that sort of thing.');
