INSERT INTO `phpbb_posts_text` VALUES (4413,'acab7badb2','Need residual sweetness','Ok I\'m gonna brew (hold your kettles y\'all).\r\n\r\nI intend on brewing a batch of maple porter. I want to keep a SLIGHT residual sweetness from the maple  - not from the malt.\r\n\r\nI know that maple syrup is fully fermentable when it is used as an adjunct.\r\n\r\nIs there any way to convert some of the sugars into non-fermentables?\r\n\r\nI\'m somewhat familiar with the candy-making process, and I could heat up part of the syrup to either soft-crack or hard-crack, but my question is, will the resulting sugars be changed in any way as far as fermentability? \r\n\r\nAnyone? Harold?\r\n\r\nJP');
