INSERT INTO `phpbb_posts_text` VALUES (4419,'e6db819fb0','','It\'s not going to make a difference in the residual sweetness whether I add it at 15-minutes or at flame out though.\r\n\r\nJP\r\n[quote:e6db819fb0=\"Jamie Sox\"][quote:e6db819fb0=\"JP_Boileau\"]I want sweet Maple Goodness.\r\nJP[/quote:e6db819fb0]\r\n\r\nAdd it at flame out.[/quote:e6db819fb0]');
INSERT INTO `phpbb_posts_text` VALUES (4420,'e00d49e0e2','','What is your reasoning for keeping the residual sweetness from the syrup and not the malt? If it is all balanced out, then it shouldn\'t matter? Do you not want a strong over powering Maple Beer or you trying to keep it from drying out?');
