INSERT INTO `phpbb_posts_text` VALUES (4423,'058eb669fc','','If I\'m not mistaken Maple Syrup is highely fermentable and because so will actually dry your beer out (think belgian with candi sugar).  \r\n\r\nThinking about Maple sweetness it seems to be that it is a lighter sweetness rather than maltiness that a beer provides?  I\'m wondering if you are actually wanting something more like a maple mead rather than a beer?');
INSERT INTO `phpbb_posts_text` VALUES (4424,'3f8ed35a6a','','If you are afraid of loosing the maple flavor along with it sweetness, you could do as winemakers do and add it along with potassium sorbate at packaging time as long as you are going to force carbonate the beer.');
INSERT INTO `phpbb_posts_text` VALUES (4425,'530d96846a','','[quote:530d96846a=\"Dan Adams\"]Add it in secondary.   :mrgreen:[/quote:530d96846a]\r\n\r\nThis is what we do for our Vanilla Thrilla (vanilla maple porter).. add 1qt at flame out and then add a couple oz at secondary. It\'s been well received by the judge several times.');
