INSERT INTO `phpbb_posts_text` VALUES (4428,'a63a3e87ba','','I\'ve always found malt sweetness to be on the caramel side of things, while maple syrup is on the \"woody\" side of sweet. THat\'s why I want the maple sweetness...\r\n\r\nRegardless of adding it at flame out, secondary, or 15-min before end of boil, it\'s not going to magically convert itself into non-fermentables!\r\n\r\nI agree with Lee that using sorbate(s) would work, however I plan on naturally carbonating, in the bottle.\r\n\r\nI think I may do a combination of 15-min, 0-min, secondary, and also use some as maple candy (hard-crack).\r\n\r\nHow much have you used for how big a batch, Jamie?\r\n\r\nI plan on using 4x 19oz cans for 12-gallons.\r\n\r\nJP');
INSERT INTO `phpbb_posts_text` VALUES (4429,'39d7281e25','','For what it\'s worth... I found my old recipe from \'95:\r\n\r\nhttp://hbd.org/brewery/cm3/recs/05_104.html\r\n\r\nJP');
INSERT INTO `phpbb_posts_text` VALUES (4430,'e86ceb3ab2','','[quote:e86ceb3ab2=\"JP_Boileau\"]I\'ve always found malt sweetness to be on the caramel side of things, while maple syrup is on the \"woody\" side of sweet. THat\'s why I want the maple sweetness...\r\n\r\nRegardless of adding it at flame out, secondary, or 15-min before end of boil, it\'s not going to magically convert itself into non-fermentables!\r\n\r\nI agree with Lee that using sorbate(s) would work, however I plan on naturally carbonating, in the bottle.\r\n\r\nI think I may do a combination of 15-min, 0-min, secondary, and also use some as maple candy (hard-crack).\r\n\r\nHow much have you used for how big a batch, Jamie?\r\n\r\nI plan on using 4x 19oz cans for 12-gallons.\r\n\r\nJP[/quote:e86ceb3ab2]\r\n\r\n1quart for 10gallons.. but keep in mind on our recipe we wanted to emphasize the balance of vanilla and maple with the porter base malt.');
INSERT INTO `phpbb_posts_text` VALUES (4431,'affa28e2df','','GREAT EVENT!! Holy Sheet what a good time.. Loose Cannon has my cheek bones numb.\r\n\r\nMet Jeff Levine, who distributes Clipper City aka Heavy Sea\'s from [url=http://www.carolinacraftdist.com/beers.htm]Carolina Craft Dist[/url] and Tom Cizauskaz. Who also works as the territory manager for Clipper City. He has a nice blog. http://thomas.cizauskas.net/\r\n\r\nCarolina Craft Distributors is now carrying  Bear Republic, Founders, and Stoudts.. Good beer will be arriving in SC!!\r\n\r\nBefore I forget: 8) \r\nWarrior for bittering\r\nPalisade, Amarillo, Simcoe, Chinook, and Centential for Hop back/ flame out and dry hop\r\n\r\n[quote:affa28e2df]\r\nClipper City Brewery owner, Hugh Sisson, let me look at the brewery Loose Cannon batch report following a brewery tour. Hops additions weights were not given (he verbally told the tour 3lbs per bbl=3.22oz per 5gal); hop additionns were specified as \"BB,\" time, \"HB,\" and \"Dry.\" \"BB\" and the start time for the boil were the same. \"HB\" is hop back. The single hop addition with a time had a time that was 45-minutes into a 60-minute boil. The hop bill/schedule was Warrior (P)=BB, Simcoe(P)=15-min remaining, Pallsade(L)=HB, Centennal/Simcoe(L)=HB, Simcoe/Palisade(P)=Dry.\r\n\r\nInitial gravity was 17.5-plato and final gravity was 3.7-plato. Recipe specified 1800kg(92.3%) 2-row, 50kg(2.6%) caramalt, and 100kg (5.1%) munich 40. Mash schedule was 20\'@60C (140F), 50\'@62C( 143.6F), 10\'@65C(149F), 20\'@70C(158F), mash out at 76C(168.8F). Mash Ph 5.5. 60-minute boil. Fermentation at 20.5C(68.9F). Yeast not provided. [color=red:affa28e2df](update: 1056)[/color:affa28e2df]\r\nTypical batch is 60-65bbl. Copper clarifier added to boil.[/quote:affa28e2df]\r\n\r\nSurprised I remembered all that Jim...  :mrgreen:');
INSERT INTO `phpbb_posts_text` VALUES (4432,'8439e13cca','','This event was a blast!  Both casks were quite good and tapped to great fanfare.  Jeff was there meeting with folks and there was a good number of PSB vets and craft beer folks alike.  The Loose Cannon IPA was the hit of the night; although the draft Flying Dog Barrel-Aged Gonzo Porter was pretty darn impressive as well...  if you missed this, you missed the first Columbia cask beer event in a long time!  (ever?)\r\n\r\nDon\'t worry, if this event was any indication, there will be more!   :P');
INSERT INTO `phpbb_posts_text` VALUES (4433,'70b2073c71','','I liked the IPA.  Loads of fun.  Lots of support.');
INSERT INTO `phpbb_posts_text` VALUES (4434,'80917b7b98','','I agree with everyone, it was a blast. Thanks Jamie for writing all that down, I\'ll put that in my brewing notebook.\r\n\r\nOf all the information given out, the one biggest thing said was the fact that more hops were produced last year than in recent history, and the \"shortage\" was caused by hops being purchased by overseas markets. Interesting.\r\n\r\nI enjoyed the Holy Sheet (my first of the cask ale), but my favorite was the Loose Cannon. I had the IPA earlier in the week at pint night, but the cask conditioned version was definitely better. Let\'s hope Flying Saucer continues with more real ale events.');
INSERT INTO `phpbb_posts_text` VALUES (4435,'11672851a1','Starkbierfest anyone?','I\'m tempted to do a 3-day wk-end in Munich on Feb 21st-24th for the Starkbierfest (the dark beer festival of lent).\r\n\r\nAnybody interested in going? The flights are pretty reasonable right now, a lot lower than in the summer (I show 477$ from Columbia on Delta, 427$ from Charlotte on United/Lufthansa combo - both all inclusive).\r\n\r\nIf you want to stretch out your stay, you\'re welcome to do that, but myself, I can only be there on those dates, and I\'d fly in from Philly to Munich [That\'s where I\'m gonna be for the next month - Philly]. Hotel rooms are pretty reasonable this time of year, under 100$ (yes $) for a 3-star...\r\n\r\nI know Munich reasonably well now, having been there 3 times. I know my way around the streetcars/underground reasonably well too.\r\n\r\nSo.... Anyone? \r\n\r\nOf course, you need a passport to go.\r\n\r\nJP');
INSERT INTO `phpbb_posts_text` VALUES (4436,'0feedbd732','','That sounds cool.  Lemme check to make sure my passport is up to date and I very well may go.  I could use a long weekend drinking beer!   :cheers:');
