INSERT INTO `phpbb_posts_text` VALUES (4440,'77d62aba42','Attended Wort Hawgs meeting','I\'ve been working in the Greensboro/High Point area since early december, and it\'s about to end next week, so I decided to finally drop by Foothills Brewing in Winston-Salem.\r\n\r\nWow, that\'s one BIG brewpub! I\'d say nearly twice the size of Aiken Brewing in square footage! The beers were excellent. I had their Pale Ale, their Hoppyum, their double IPA and their Porter. All were excellent, although I found 2-IPA to be a slightly \'muddy\'. Pints all were 2.50$ on tuesday - except for the 2-IPA.\r\n\r\nI happened upon the Wort Hawgs having their monthly meeting, and gladly partook in the tasting of homebrews. They made me feel very welcomed at their meeting.\r\n\r\nThey did mention that they will have a beer festival in conjunction with Foothills Brewing sometime this summer (I forgot the date), and they will have a homebrewers tent for clubs that want to attend [they hinted that Palmetto State needs to send representatives!].\r\n\r\nJP');
INSERT INTO `phpbb_posts_text` VALUES (4441,'f21d7402b9','','Just got off the phone with Foothills, here\'s the latest.\r\n\r\nThe Release Party is FRIDAY at 8pm at the brewery.  People drinking it on draft, music, food, etc.\r\n\r\nSexual Chocolate in bottles will go on sale at 11am Saturday.  The first 100 people in line will be given a bracelet that will let them purchase up to 4 bottles.  The next 50 people will get to buy 2.  After that it\'s one bottle per person who does not yet have any.  Of course there will be SC on draft and food, etc as well.  No official party for Saturday night.\r\n\r\nIf you want to carpool, post here!  As of this time there are no concrete plans for a hotel.  If you want to go up Friday night, post here and see who you can join up with!  It\'s roughly a 3 hour drive up I77 from Columbia.');
