INSERT INTO `phpbb_posts_text` VALUES (4474,'614acece57','Mashing','So far I\'ve only done extract brewing....but I was wondering....when you mash how do you raise the mash temps when you\'re mashing in a cooler?  If you keep adding boiling water, won\'t you get too much water in the mash?  I understand when you do a decoction mash you take some wort out and heat it up and add it back....but I was thinking of a multistep infusion mash.');
INSERT INTO `phpbb_posts_text` VALUES (4475,'078e2349a8','','You are basically correct, other than your statement \"too much water in the mash\". You are correct in that a decoction mash, a part of the liquid in the mash is heated to boiling and added back to the mash to raise the mash temperature to the next step. In a step-infusion mash, you start out with a rather low water to grain ratio, and as you add boiling water you dilute the mash. But under normal mashing, I doubt you would reach the \"too much water\" stage unless you have too small a mash tun.');
