INSERT INTO `phpbb_posts_text` VALUES (4769,'3fc55f9232','','Social Events Report\r\n\r\nIts March!  Already?  Yes!  By the time you read this, the Aiken Brewing tour will be behind us.  Hope your head is alright!\r\n\r\nHeres whats going down in the area.  This month is short on homebrew events but there are a few commercial beer happenings.\r\n\r\nMarch 19th Greenville\r\n[url=http://beeradvocate.com/events/info/17583]Flying Dog \"Garde Dog\" Release Party @ Barley\'s Taproom[/url]\r\n\r\nCome on down to Barley\'s Taproom and Pizzeria in downtown Greenville, South Carolina on Wednesday, March 19, 2008, starting at 7:00 pm for the Flying Dog Garde Dog Release Party with Adam Mundy from Flying Dog. This is the newest seasonal and the first time this style has been released by Flying Dog. There will be giveaways throughout the night, so get there early!\r\n\r\n\r\nMarch 20th, Asheville\r\n[url=http://beeradvocate.com/events/info/17635]Brusin\' Ales Unibroue 6 Course beer dinner[/url]\r\n\r\nBruisin\' Ales hosts this six-course beer dinner featuring the beers of Unibroue and the delectable tapas of Asheville\'s Zambra. Chef Adam is cooking with the beer in every single course! We can barely contain ourselves. This is one bad*ss menu.\r\n\r\nMarch 21st, Asheville\r\nThe Terrapin Brewery in Athens, Ga., is kicking of their little [url=http://beeradvocate.com/events/info/17636]Side Project at Brusin\' Ales[/url]. Side Project is a brand new single-batch 22 oz. bottle series. Can you guess the name? Hop Shortage Ale. \r\n\r\nJohn Wetzel will be representing the brewery on Friday, March 21 from 5-7pm where we\'ll be sampling: \r\nTerrapin Rye Pale (5.3% abv) \r\n\'06 Terrapin All-American Imperial Pilsner (7.5% abv) \r\nHop Shortage IPA \r\n\'08 Terrapin Rye Squared (8.5% abv) \r\n\r\nFinally, the March brew session will take place March 29th behind Bet-Mar.  Check the forum soon for details.  Hope to see you all out there!');
INSERT INTO `phpbb_posts_text` VALUES (4771,'6a8c36ba5e','','Late, sorry.\r\n\r\nReport from the VP of Competitions:\r\n\r\nShamrock is this Saturday the 15th.  Maybe some of you lucky brewers will be able to attend and judge.  I hear they put on a very good comp.  No word yet on the number of PSB entries but I know there was a quite a buzz on the forum about getting everybodys beers there.  A big thanks to Harold for taking the time to get our entries from Bet-Mar to Charlotte for pickup.  That was a fine gesture and someone should buy him a beer at Mondays meeting.\r\n\r\nThe next competition will be the U.S. Open in Charlotte on the 10th of May.  Make sure you dont drink your entire stash before setting aside a few for this important competition.\r\n\r\nLast month Dr. Leach won the club only competition in the Dark Lager category.  Sadly he did not win, place or show.  I suspect the bottles were broken or some other misfortune befell them.  Hopefully he has received his score sheet by now explaining why exactly they did not choose his beer.  If you would like more information about the Club-Only standings please follow this [url=http://beertown.org/homebrewing/club_winners.html. ]link.[/url]\r\n\r\nThis months AHA club only competition is the Perfect Porter Challenge.  Well critique them all and send the best to Indianapolis, Indiana where this category 12 competition will be hosted by Ron Smith and the Foam Blowers of Indiana (FBI).  The entries are due March 21 so in order to guarantee they will arrive at the competition on time it will be necessary to mail them on the 11th.  For that to happen you will need to bring two for the club to try plus two more to send off.  Bring out your best (and your worst) for the fun!  \r\n\r\nNext month is the AHA All Extract Extravaganza.  Entries can be from any category from 1 to 23 but at least 50% of the fermentables MUST be from extract.  My kind of competition!  We have a lot of very good extract only brewers so this will be a great meeting to attend even if you dont have a beer to enter.\r\n\r\n[url=http://beertown.org/homebrewing/pdf/entry_recipe.pdf]AHA Club-Only Entry Form[/url]');
