INSERT INTO `phpbb_posts_text` VALUES (4767,'748438aafa','Oak Available-Free','A large oak (60-80 ft) was blown done in my neighbors yard during the recent storm.  About half of it is in my yard.  The portion in my yard is the upper half with all the limbs which are a good size for burning.  If anyone uses oak for heating, they are welcome to this, free. It is a good chance to get aged wood for next year. It will likely be here for a week or two or three.  At the moment the ground is too soggy for trucks and will be for several days.  Wheel barrows should work fine.  Cut and haul your own.  Marsha and I will offer encouragement from the porch.');
