INSERT INTO `phpbb_posts_text` VALUES (4763,'596e8bf785','','Oops, a bit late myself!\r\n\r\nVP of Education and Recruitment\r\n\r\n 2008 has started out with a bang. Weve had some great speakers covering a variety of topics and they keep coming! This months topic will be hop substitutions. Talk about a timely topic! Weve also had a request to cover appropriate glassware, different types of grain, beer and cheese pairing, etc.. etc. Further topic suggestions are always encouraged! Lets all learn from one another. Theres a wealth of information in the club, time to take proper advantage of it! \r\n On the recruitment front, Spring is in the air which means festivals are right around the corner. Please spread the word of PSB to other beer brewing/loving brethren!');
INSERT INTO `phpbb_posts_text` VALUES (4762,'c7dda8501f','','[quote:c7dda8501f=\"Katherine Shavo\"]I have gotten away from kits but I do ususlly steep something, so I will keep your info on file for future use. I just made my first beer using water salts and it turned out pretty good. Sounds like I have something new to play with and learn about - thanks![/quote:c7dda8501f]\r\n\r\nOne advantage, of course, of steeping grains is you don\'t have to worry about conversion taking place -- all the sugars and applicable flavor components are available for the taking -- so pH is not an issue for you. But, like Chris pointed out, there are flavor purposes for adding salts too. If I\'m doing an IPA or a dark beer I\'ll sometimes add salts directly to my boil, such that I\'m getting the flavor benefit but I\'ve addressed my mash pH separately.\r\n\r\nAs for Pete and his affinity for uninvited guests, I\'m reminded of the scene in [url=http://www.imdb.com/title/tt0112508/]\"Billy Madison\"[/url] where they put a flaming bag of dog poo on the codgery old neighbor\'s doorstep.\r\n\r\n\"Old man Goodwin hates shit!\"');
