INSERT INTO `phpbb_posts_text` VALUES (4487,'76bcf48234','','What styles actually benefit from decoction mashing?  Which styles would expect to use a decoction mash?  How would you be able to tell?  Are there any known commercial examples available?');
INSERT INTO `phpbb_posts_text` VALUES (4488,'dc3ae3e605','','[quote:dc3ae3e605=\"Scott Hasty\"]What styles actually benefit from decoction mashing?  Which styles would expect to use a decoction mash?  How would you be able to tell?  Are there any known commercial examples available?[/quote:dc3ae3e605]\r\n\r\nHere is a little write up from a friend of ours. It gives a little input of Decotions.\r\n\r\n[quote:dc3ae3e605]DECOCTION, What is it?\r\n\r\nDecocting is a method of multi-temperature mashing that utilizes removing and then boiling and reincorporating portions of the mash to raise the temperature. It is said that the method developed centuries ago in central Europe many years before the invention of the thermometer. Decoctions were also a way for these early brewers to deal with the poorly malted grains of the time and obtain good starch conversion.\r\n\r\nWHY SHOULD I BOTHER?\r\n\r\nWell, you don\'t have to if you don\'t want to. Unless specifically designated all modern malts are well converted and will mash successfully with a single temperature infusion. However, there are those of us in the decoction underground who feel that there are positive side effects on the taste of the beer which decoction mashing provides, not obtainable with other methods.\r\n\r\nDuring the boiling of the mash portion (the decoction \"pull\") a couple of significant changes take place. First, the heat and mechanical action of the boil break down the granules of starch making them more easily accessible to the conversion enzymes. This breakdown of starch particles will usually mean that a decoction yields a bit more conversion efficiency than an infusion mash on the same malt.\r\n\r\nSecond, via the Maillard reaction sugars and proteins undergo a process that creates melanoidins and other tasty compounds. This is very similar to what happens when sugar is caramelized in a saucepan or a steak is grilled. These melanoidins provide the subtle enhancements in flavor and color that only a decoction can give you.\r\n\r\nHOW DO I DO IT?\r\n\r\nYou will need a decoction vessel, a stirring tool and a burner, preferably with an accurate flame control. The decoction vessel can be any non-reactive cooking pot large enough to comfortably hold the pulled mash. I use a 20 quart stainless steel stock pot and a large wooden spoon to stir. A scoop of some kind will also be needed to remove mash from the tun. I find a plastic-handled stainless steel strainer works well. A small pan or ladle can be used but a strainer allows the liquid to easily drain from the pulled mash when scooped.\r\n\r\nMashing in thick with a decoction is the way to go. I use a 1 Qt: 1 Lb water:grain ratio. The mash will thin out as you go and chances are you will add some water during the process. With a 1:1 ratio the total weight of the mash will be 2/3 water and 1/3 grain. For me this simplifies measuring the amount of mash to be pulled for decoctions. The ROT is 1/3 of the total mash by weight but in practice a little more, say 40%, is what I generally use. I think this is Ted\'s MO as well.\r\n\r\nCommercial breweries doing decoctions use steam heated kettles. The direct flame of a homebrew system does increase the chance of scorching and burning, things to obviously avoid. To take out some anti-scorch insurance I like to start the decoction vessel with a couple of quarts of water and bring it to the boil. This also adds a little bit of a heat fudge factor as you may be likely to undershoot your temps some on your first try. It is also probably a good idea to have both boiling and cold water on hand for quick emergency temp adjustments.\r\n\r\nMost of my decoctions are \"singles\" with a short protein rest at ~130F for 15 minutes and then a jump to sugar rest ~152F for 60 minutes. A decoction to mashout is usually added at my brewery too. Typically the rise in temperature from a decoction will be 20 to 22 deg F although YMMV. Once you get the hang of it you may be surprised how accurate the temperature steps can be. Of course if you wanted to do more steps just start at a lower temperature. The \"ultra traditional\" historic decoction would be mashed in with cold water and proceed to acid rest, low protein, high protein and sugar rests. I\'ve never gone this far but I have done a couple starting at the acid rest temperature of 95F.\r\n\r\nOK you\'ve mashed in and you have the decoction vessel ready. Pull 1/3 to 40% of the mash by weight taking as little liquid as possible and add it to the decoction vessel. Keep stirring CONSTANTLY even if you have started with a little water in the pot. Almost immediately you will start to see the color of the decocted mash darken, this is normal. Also don\'t worry about the beer being too dark. A double or even triple decoction with pils malt still will make a beautiful light colored beer. Keep stirring and don\'t forget to check the temperature. When the decoction reaches the next rest temp turn off the heat, cover and let sit for 15/20 minutes.\r\n\r\nAfter resting the decoction add more heat and continue stirring until the whole thing starts to boil and bubble. (you can also do a short rest at mashout temp if you want to go nuts) Keep stirring and boiling for at least 10 minutes, more if you want. I usually do 15 to 20 minutes. Kill the heat and immediately add the boiled mash to the mash tun. Mix and stir thoroughly until the temperature is uniform. If the stars were aligned you will be right at your target temp. If not you can adjust down with cold water. If low by only a degree of two leave it or add some boiling water to adjust. If the temp is way off on the low side you probably got scared and didn\'t pull enough mash for the boil. In that case just pull some more, bring it quickly to boil and dump it back into the mashtun.\r\n\r\nThat\'s about it. Everything else you do is just like any other brew. Just in case you have heard the uninformed questions about decoctions, NO IT DOES NOT CAUSE A TANNIN PROBLEM.[/quote:dc3ae3e605]');
INSERT INTO `phpbb_posts_text` VALUES (4761,'929fa4385a','March Newsletter','I\'m late again!  Sorry.....\r\n\r\n\r\nMarch Newsletter\r\n\r\n\r\nMeeting Agenda\r\nHop Substitutes\r\nClub Only Comp.  Porters\r\nEvents Planning\r\n\r\nFrom The President\r\nIts time to wear green, look for lucky four leafed clovers, cross your fingers, and hold your breath.  \r\nYou did your recipe research and formulation, purchased your grains and/or extract, begged your friends for hops, had a water analysis taken, mashed, boiled, chilled, racked, babied, bottled, registered, and sent perfect beer to Raleigh. Heres wishing the luck of the Irish to all that entered their home brewed beer in the March 15th Shamrock Open, 2008s first Carolina Brewer of the Year competition!  \r\n\r\nCongratulations and thanks to Joseph for hosting a fun, tasty, and educational brew session.  What a crowd of home brewers!\r\nBe sure to mark your calendars and attend the March 29th brew session to be held at Bet Mar. \r\n\r\nThis months meeting should prove to be interesting. With the infamous Hop Shortage of 08 swirling around us, we plan to discuss possible substitutes for hops in beer. Have you heard anything or have been gutsy enough to experiment?  Come share with the crowd. \r\nThink well find anything?...come find out.\r\n\r\nWe will also taste, and select a Porter to represent PSB in the AHA Club only competition.  Bring your home brewed Porters.\r\n\r\n It is time to PARTY!  The spring club party, The WurstOyster, is scheduled for Saturday, April 12 at the police hut on the river.  Bratwurst, beer and oysters, Oh My!  Sign up on the forum or at Mondays meeting.  Do you have a keg of home brew to show off?  Sign up and bring it along.  Youll be everyones hero.  COME PARTY!\r\n\r\nTheres lots of fun stuff going on\r\n		Aiken Brewery tour, Highland Brewery tour, cigar and pint night, Coast Brewery tour and food pairing, brew sessions, parties, education sessions, Big Brew Day, competitions, BJCP training, club glasses, etc., etc., etc.\r\nCome join in on the fun and of course, if you are going to be lucky, KEEP BREWING HOME BREW! \r\n\r\nSee you Monday, March 10th at Zorbas.  Dinner at 6:00, meeting at 7:00, and be sure to bring home brew.\r\nGO PSB!\r\nCarl Foster');
INSERT INTO `phpbb_posts_text` VALUES (4760,'212bdc6f61','','[quote:212bdc6f61=\"chriswillis\"][quote:212bdc6f61=\"Katherine Shavo\"]and what about extract brews, does the same apply?[/quote:212bdc6f61]\r\n\r\nYes and No-   From the mash standpoint this does not really apply except for chloramines and your specialty grains.\r\n\r\nFor your Beer it can.  If you are using most kits with the darker DME/LME there shouldn\'t be a problem.  If you use the pilsner type of DME/LME you might need a tad bit of calcium for your yeasties to be happy.  When I was doing extract I would put a little gypsum/calcium chloride in before I seeped my grains.  Gypsum is good for hoppy beers and calcium chloride in germans/belgians/ and most darker beers.[/quote:212bdc6f61]\r\n\r\nThanks Chris, After I asked the question it occurred to me it would not matter as much with extract. I have gotten away from kits but I do ususlly steep something, so I will keep your info on file for future use. I just made my first beer using water salts and it turned out pretty good. Sounds like I have something new to play with and learn about - thanks!');
INSERT INTO `phpbb_posts_text` VALUES (4759,'db86a735a7','','[quote:db86a735a7=\"Pete Goodwin\"][quote:db86a735a7=\"Chris Cole\"]It would be a great dateline expose\'.[/quote:db86a735a7]\r\n\r\nI love seeing jerkwad scammers getting burned.  Im sure there are companies that are legit but theyre not the ones going through your neighborhood while youre away and trespassing to put crap like this on your doorstep.  I abhor anyone that puts unsolicited flyers on, in or around my mailbox or doorstep.  Whenever I catch one I run them off and tell them never to come back.  Vagabonds the lot of em.[/quote:db86a735a7]\r\n\r\n\r\nYEA!\r\n\r\nJust yesterday I had two young girls come up and try to sell me cookies!   I should have run them off with my shotgun!  That would learn those Vagabonds!\r\n\r\n\r\nI got suckered into buying cookies though.');
