INSERT INTO `phpbb_posts_text` VALUES (4750,'0df3f20614','','I actually purchased an under-the-sink charcoal filter at Home Depot for about $100, and I can easily say it improves (or rather, diminishes) the taste of my city water.  I use it for all my brewing, when possible.  Would be fun to find out what exactly it\'s filtering.');
INSERT INTO `phpbb_posts_text` VALUES (4751,'cd7baf7360','','Pete, you better follow those instructions...they look official! \r\n\r\nFor what it\'s worth, I submitted labaratory pure deionized water to a company, possibly the very same one. They kept calling and trying to set up an appointment to come by and discuss their \"findings\" and I kept saying \"no, let some one tell me my results over the phone and then I\'ll decide if I want you to come by\".  Finally the manager called and informed me that I had high levels of heavy metals in my water. (Not remotely possible) I informed him that the water did not in fact come out of my tap and accused him of theft basically. He was very nervous and finally apologized and said one of his employees must have fabricated the results that he was looking at. Calling his bluff yet again I asked if he was currently viewing my results. He said \"yes\". I then asked him what my sample address and date of sampling was, knowing full well it would be on the report. Of course, he couldn\'t answer that either. I then re-iterated the fact that he too was a thief and a liar. It went back and forth a bit with multiple apologies. \r\n\r\nMoral: Some of these companies are Hellaciously dishonest. Do your homework! There are quite a few legitimate ones out there but even they can have a dishonest employee. Anyone considering a whole house water filter should have their water independently tested prior to shelling out $.');
INSERT INTO `phpbb_posts_text` VALUES (4752,'044d111c61','','[quote:044d111c61=\"Chris Cole\"]Anyone considering a whole house water filter should have their water independently tested prior to shelling out $.[/quote:044d111c61]\r\n\r\nUnless you want to make beer anywhere in the house-   at that point you can use your filtered toilet water.');
