INSERT INTO `phpbb_posts_text` VALUES (4756,'17a1386f7b','','[quote:17a1386f7b=\"Chris Cole\"]Pete, you better follow those instructions...they look official! \r\n\r\nMoral: Some of these companies are Hellaciously dishonest. Do your homework! There are quite a few legitimate ones out there but even they can have a dishonest employee.[b:17a1386f7b] Anyone considering a whole house water filter should have their water independently tested prior to shelling out $[/b:17a1386f7b].[/quote:17a1386f7b]\r\n\r\nI recently had a \"whole house\" filtration seminar at my house. It was great, hands on, and the guy was a real seller. We did a water analysis, showed the difference in \"clean\" vs \"tap\" water. Man.. I was ready to break out the check book and buy a whole filter. :roll:  Then the price came in at $5k.  *) and I knew the juice wasn\'t worth the squeeze.  I did receive a Gift Card for listening to the spill.  :cheers: \r\n\r\nFound the same set-up for $695');
