INSERT INTO `phpbb_posts_text` VALUES (4356,'09eac4a063','','[quote:09eac4a063=\"Jim Griggers\"]I also have a Polk Audio sub for my home theater. I think it is also around 100 watt. I got it simply because it was matching it to the other Polk Audio speakers I had. The Polk was probably twice or three times the cost of the Sony. Placement is important on a sub, the best bass reinforcement is with corner placement. It certainly shakes the floor and rattles the windows. It is connected to a Yamaha receiver through a line level subwoofer output.[/quote:09eac4a063]\r\n\r\nSo it sounds like 100 watts shouldn\'t [i:09eac4a063]necessarily[/i:09eac4a063] be a problem.');
