INSERT INTO `phpbb_posts_text` VALUES (4358,'18ebd810c8','2008 Highland Pro-Am Competition','Homebrewers!!!\r\n\r\nFire up your kettles...\r\n\r\nMALT and Highland Brewing Company have teamed up to put on a competition\r\nto choose a homebrewer\'s beer for Highland to enter the Brewer\'s Association \r\nProfessional/ Amateur Series this year. Malt will help organize the competition which\r\nwill take place on Saturday, April 5th at Skyland Distributing (same place\r\nas the BRBO). We will need volunteers for stewards and judges but most of\r\nall, we need entries!\r\n\r\nThe winner (Best of Show) will earn a trip to Denver with Highland for\r\nthe 2008 GABF in October to help Highland promote the beer. The winner\r\nwill brew the beer with the Highland brew team at the brewery and get some of it to take\r\nhome. \r\n\r\nMALT and Highland have met together and agreed upon some specifics for the brewing process. Here are enough of the details that\r\ncould allow you to get started brewing if you wished to enter. There are\r\nsome guidelines you will need to follow. More infornation will follow in the Registration Website. \r\n\r\nFirst.. brew to style as the winner will be chosen based on how well your\r\nbeer meets the BJCP style guidelines. The following guidelines will limit \r\nthe styles\r\nyou will be able to brew... for example, you would not be able to brew a \r\nlager or Belgian beer\r\nor a strong beer. They also do not want Fruit beers.\r\n\r\nThe ABV must be less than 8%.\r\n\r\nYou must use WL 001 for the yeast. Highlands will provide the yeast if you\r\nwish to use their yeast.\r\n\r\nMost malt\'s are allowable. However, They use Bonlander Munich which is\r\ndifferent from other Munich malts.\r\n\r\nHighland can\'t do decoction mashes.\r\n\r\nThe hops should be limited to Willamette, Cascade, Chinook, Summit, U.S. \r\nFuggle,\r\nMt. Hood, Sterling, and Centennial. Raw Cascade is not available to \r\nHighland at this time.\r\nThey strongly discouraged using substitute hops as they will be trying to \r\nduplicate your recipe.\r\n\r\nYou must of course be willing to share the recipe.\r\n\r\nHomebrewer must brew beer from start to finish. \r\n\r\nAny entries not following the guidelines will not be judged. Entry fees \r\nwill be $6 first entry and $5 each for additional entries.\r\n\r\nThis should be enough information to get started if you wanted to brew this \r\nweekend. There will be an official\r\nannouncement soon... in the next few days. The competition will be open to \r\nall. It will be advertised to all the\r\nCarolina homebrew and Tenn clubs and maybe more. You should have plenty of \r\ntime to brew up some tasty\r\nAles before the deadline which will be March 29. Highland Brewing will be \r\nthe drop-off point for entries.\r\nThe Malt website will host the on line registration which will be set up as \r\nsoon as more details are worked out.\r\n\r\nCheers and good brewing...\r\n \r\nMary Eliz McCrae\r\n828-299-3370\r\n \r\nmaryeliza@highlandbrewing.com\r\n \r\nwww.highlandbrewing.com');
