INSERT INTO `phpbb_posts_text` VALUES (4749,'5047fce82d','','A couple of weeks ago it was time for the local Water Scam A$$wipes (WSA) to make their annual attempt to deceive me into purchasing an ineffective and unnecessary water filtration system for my house.  One of these days Ill submit some water and wait for the report then nail them.  I wonder how many unsuspecting elderly people and soccer moms have been taken in by these snake oil salesmen.  The only good thing that comes out of it is each year I get a free plastic bottle which finds its way into my brewing equipment kit. \r\n\r\n[img:5047fce82d]http://img85.imageshack.us/img85/5035/waterscamlr6.jpg[/img:5047fce82d]');
