INSERT INTO `phpbb_posts_text` VALUES (4745,'4112ab0726','','[quote:4112ab0726=\"chriswillis\"]Gypsum is good for hoppy beers and calcium chloride in germans/belgians/ and most darker beers.[/quote:4112ab0726]\r\n\r\nHeck I\'d almost forgotten about that stuff.  Haven\'t used it in years but I do have a lot of recipes that call for it.  Yes, without a report the recipes called for gypsum.  Always wondered it you could use too much.');
INSERT INTO `phpbb_posts_text` VALUES (4746,'4f9da1bc49','','Harold,\r\nI will be dropping off my entries at Bet-Mar around 1:00 tomorrow (Thursday), so please don\'t pick-up too early.\r\nThanks,\r\nJohn');
INSERT INTO `phpbb_posts_text` VALUES (4747,'ddb9e325ef','','[quote:ddb9e325ef=\"Pete Goodwin\"][quote:ddb9e325ef=\"chriswillis\"]Gypsum is good for hoppy beers and calcium chloride in germans/belgians/ and most darker beers.[/quote:ddb9e325ef]\r\n\r\nHeck I\'d almost forgotten about that stuff.  Haven\'t used it in years but I do have a lot of recipes that call for it.  Yes, without a report the recipes called for gypsum.  Always wondered it you could use too much.[/quote:ddb9e325ef]\r\n\r\nyes you can-   some of these can give a metalic flavor or a sharp hop bite if used too much-\r\n\r\nFor an extract probably a teaspoon would be more than enough.  The target level for the yeast is about 50-100PPM.   Our water has 12-14ppm...   I\'ve heard the Calcium also helps with getting the proteins to come together in the boil to-   the hot/cold breaks\r\n\r\nOne teaspoon of chalk or Calcium Chloride is right close to 50 ppm in a 5 gallon batch.  We have to remember though that there should be some in the extract too-   we just don\'t know how much.');
INSERT INTO `phpbb_posts_text` VALUES (4732,'c680dadb1e','','Jim,\r\n For $50.00 DHEC tests well water for the following: Lead. Alkalinity, pH, Nitrate/Nitrite, Calcium, Magnesium, Hardness, Chloride, Iron, Copper, Manganese &amp; Zinc. More tests can be run that range anywhere from $25 to $50+ depending upon the analyte.');
