INSERT INTO `phpbb_posts_text` VALUES (4737,'a6eb7a254d','','I got this from the city of Columbia. They do this testing regularly and will give you the results for free. I have the e-mail address of a person at the lab whom I contact periodically to get an updated analysis. I can either publicize that address or just return here and post water reports every couple months as I get them.\r\n\r\nDan (and any others), the mineral content of your water can determine how well your mash converts starches, for certain styles of beer. Soft water lends itself to a lower mash pH when used with simple grain bills. So, light beers are best for soft water. Highly alkaline water is not conducive to optimum mash pH with a lighter beer so you need a grain bill with enough roasted grains to bring the pH down. This is of course the oversimplified explanation. See John Palmer\'s site: http://www.slate.com/id/2185819/pagenum/2/\r\n\r\nAlso very helpful is Palmer\'s mash residual alkalinity calculator, which will tell you what your ideal beer\'s SRM is given your water profile. You can then add different amounts of certain water salts and the calculator will readjust your ideal SRM. The calculator is at the bottom of this page. I use it for every brew. http://www.howtobrew.com/section3/chapter15-3.html\r\n\r\nSo you know, based on Palmer\'s RA calculator, the Columbia canal water is ideally suited for an all-grain beer of SRM 6-11. For darker or lighter beers you\'ll want to adjust your mash.');
