INSERT INTO `phpbb_posts_text` VALUES (4351,'0709a603cd','','[quote:0709a603cd=\"Dan Adams\"]I have been to this place and was not impressed.  The layout is weird and the selection isn\'t as good as Green\'s, nor are the prices good enough (for me) to justify a trip all the way out there.  Maybe they\'ll get better brews in as time goes on...[/quote:0709a603cd]\r\n\r\n\r\nThe point of this wasn\'t to steer business away from Green\'s. It was to recognize that there is a new small business in Lexington who has good beer,comparable prices, willing to get what you want if you need it and is convenient to those who live on this side of town. \r\n\r\nGreen\'s and their managers have supported the PSBO competitions for the last 3yrs and I\'ll continue repaying them back by shopping there.');
