INSERT INTO `phpbb_posts_text` VALUES (4354,'b4631f3893','Dark Lord Day - April 26th.  Munster, Indiana.  Madness!','Yes.  Dark Lord Day is nearly upon us!  For those brave souls who want to make the absurd trek to Indiana (roughly 12 hour drive) to stand in line in order to buy 6 bottles each, this is the thread for you.\r\n\r\n[url=http://beeradvocate.com/events/info/16561]What is Dark Lord Day?[/url]\r\n\r\n\"DarkLord Day 2008 is the only day of the year to buy [url=http://www.threefloyds.com/index.html]Three Floyds[/url] DarkLord Russian Imperial stout.  DLD is a festival where participants can meet other beer enthusiasts, sample beers from all over ,buy DarkLord, try Oak Aged Dark Lord Russian Imperial Stout ,eat BBQ, and listen to live music.\r\n\r\nDarklord Day 2008 will be greatly improved to accommodate larger crowds, including expanded parking, more porta johns, shorter lines and more food choices.\"\r\n\r\nSo far I know Brendon and Joseph and myself have expressed interest in going.  This will be a roadtrip to remember.\r\n\r\nIf you want to attend, book hotels soon.   The road trip will likely include stops at brewpubs along the way, and potentially a daytrip to Chicago.\r\n\r\nMore to follow....   :devil:');
INSERT INTO `phpbb_posts_text` VALUES (4731,'cccddf29a5','','Brad, I looked at the Ward Labs site, I didn\'t see any testing that was free. Is there something special to get free testing? (Maybe they have an deal with the City of Columbia?)\r\n\r\nThe site has good information, I may send a sample from my mountain house spring just to see what minerals are in the water, and if there are any harmful bacteria. The water does taste good. :-)  I KNOW the well water has lots of iron, but it was only tested for coliform.');
INSERT INTO `phpbb_posts_text` VALUES (4728,'512240c50c','April 12th- 2nd Annual WurstOyster PSB Club Party','Back by popular demand is the club oyster party. The club will purchase oysters and bratwurst for the evening out at the old police hut. As we have in the past, club members will volunteer to bring side dishes. \r\n\r\nPlease send me a message if you know what you would like to bring and I will add it to the signup sheet. Please also let me know if you will be bringing a guest. I will also have the signup sheet at the meeting. The club has leftover utensils and plates from previous events, so I will bring those items. It\'s a good idea to bring your own tasting glass and old rag/cloth...they do get messy.\r\n\r\nIdeas:\r\nbratwurst buns\r\nPotato salad\r\nChips/chex mix\r\nDeserts\r\nsoft drinks\r\nketchup\r\npeppers and onions\r\nsaltines\r\nsoftdrink cups\r\nnapkins\r\n\r\nGary Kunes- Dragon Droppings (just wait to find out, they look amazing), homemade mustard\r\nChris Willis- Hot Sauce, horseradish, cocktail sauces, lemons\r\nDan Adams- Mustard, small saurkraut, chips\r\nChris and Tina- Large hashbrown casserole\r\nBrendon Kelly- Mac and Cheese\r\nPhil Osczepinski- Cole Slaw\r\nPreston Craig- Potato Salad\r\nBill Poole- Saurkraut\r\nBob Molchan- Hot sauce\r\nMark and Jessie Simoneau- Brat/hoagie Buns (2 packs)\r\nCraig Stover- approximately 50 cups\r\nMark and Sonya Burris- Cookies\r\nMoffatt Bradford- will decide later\r\nHarold Dowda- Will decide later\r\nGerald Jowers- will decide later\r\nMatthew Ellisor- will decide later\r\nBrad Petit- desert\r\nJoseph Ackerman- will decide later\r\nAndy Thomas- will decide later\r\nAdam Bedenbaugh- will decide later\r\nJim Griggers- brownies (and possibly pretzels)');
