INSERT INTO `phpbb_posts_text` VALUES (2717,'712f902493','','TASTE NEW BEERS TONIGHT\r\n\r\nThanks to the state legislature, you now have access to \"high gravity\r\nbeers\"-beer with slightly higher alcohol content. You may know these\r\nas \"craft beers\" or \"micro brews\". No matter what you call them, if\r\nyou enjoy a great beer, plan to visit Vino 100 Friday night for our\r\nfirst-ever \"Beer Tasting\". The tentative line up includes:\r\n\r\n* \"Horn Dog\" Barley Beer\r\n\r\n* \"Gonzo\" Imperial Porter\r\n\r\n* Terrapin \"Big Hoppy Monster\" Ale\r\n\r\n* Chimay Blue\r\n\r\n* Maudite Red Ale\r\n\r\n* Carlsberg \"Elephant\" Pilsner\r\n\r\n\r\nAll beer will be available by the bottle or multi-packs. In addition,\r\nwe will have chips and some of our fantastic salsa at this \"drop-in\"\r\ntasting. \r\nCost: $5/person, $2.50 for wine club members ($2.50 credit toward the\r\npurchase of any multi-pack of beer)\r\nFriday, May 18, 5:00-7:30 p.m.\r\n\r\nClick\r\nhttp://cts.vresp.com/c/?JulieBrittCommunicat/9e2ee71248/ecb107ea77/af77df195e \r\nfor all of our upcoming events, including the Romanian tasting, Wining');
