INSERT INTO `phpbb_posts_text` VALUES (4714,'affc6e3e4c','Wednesday the 5th','Do you plan on being bored this coming Wednesday night? \r\n\r\nWill you be wandering around downtown aimlessly, wondering why all the pawn shops have shut down for the night? Will you be holding your regular Wednesday night vigil at the Confederate Veterans Memorial in front of the state house? Will you need a break from your Wednesday night routine of trying to get your silly mug on ABC\'s news broadcast from Main &amp; Gervais? \r\n\r\nThen head downstairs to The Whig, where you\'ll find myself and others gleefully sucking down $2 pints.\r\n\r\nI have class that evening so I\'ll be rolling in around 8-8:30.\r\n\r\nMy girlfriend tells me it has something to do with a birthday, but I\'m mostly interested in the cheap beer.\r\n\r\nbp\r\n504.914.6644');
