INSERT INTO `phpbb_posts_text` VALUES (4717,'c00d8324e7','','Cock N Bull: A Breath of Fresh Air\r\n\r\n\r\nRosewood Pub Earns Four 1/2 Stars\r\n \r\nBY TAD TRENCHERMAN\r\n\r\n \r\nCock N Bull Pub-Grille     &#9733;&#9733;&#9733;&#9733;1/2\r\nShandon/Rosewood: 2910 Rosewood Dr., 251-4474\r\n\r\nRecently, I stumbled home from a certain subterranean hipster bar to crash on the couch. No, the missus wasnt on me about my drinking, whether she ought to be or not. She was already in bed, actually, and I was essentially sober. The problem, put simply, was that I reeked. Not of booze or the enduring Columbia summer or even some imaginary huntresss gathered perfume, but of an ashtray.\r\n\r\nToo often, this is the case, at least here in the land that timeand health-conscious legislationforgot. You go out for a couple pints and wake up less worried about your liver than your lungs. Your eyes itch, your skin cracks and your entire person, from your hair down to there, smells like youve been humping through the desert on the back of Joe Camel.\r\n\r\nHow grateful I am, then, for Rosewoods Cock N Bull Pub-Grille.\r\n\r\nAs someone desperate to give up secondhand smoking  if wholly unwilling to forgo lifes pint-sized pleasures  Ive become quite enamored with this recent, smoke-free addition to the cloudy Columbia bar scene. Im likely burning a few venerable bridges by airing my grievances thusly, but at least Im not burning a hole in my sleeve or my bronchial tubes.\r\nOf course, Cock n Bull is about more than sensible policy and the right not to stink. The folks behind this cozy watering hole, beneath and in back of the Fifth Avenue Deli on Rosewood Drive, have put considerable thought into every aspect of their business, beginning with their menu.\r\n\r\nPublick House clichs notwithstanding  a dartboard does adorn one corner, and a subtle soccer-and-rugby motif runs throughout  the attention here is on good beer and the foods that pair well with it. \r\n\r\nRather than flaunt 300-plus largely interchangeable brews, Cock N Bull pours a couple dozen lagers and ales representing the best of the major styles. Got a taste for pale ale? Theres the light-bodied Bass as well as Terrapin Rye. Prefer an American Maibock? You wont do better than a Rogue Dead Guy. Like Porter? Sierra Nevada. Brown ale? Theres Newcastle, of course, but also a chocolaty-caramel offering from the Brooklyn Brewery, which kegs possibly the tastiest example of the style this side of the pond.\r\n\r\nFoodwise, were talking Beer Simmered Bratwurst ($6), Beer Cheese Platters ($9.20) and, yes, the ubiquitous Tavern Wings ($8), here sauced spicy-sweet and resting atop a less obvious dice of fresh pineapple. Sandwich options include a gloriously meaty South Philly Cheese Steak ($7), prepared per tradition with Cheez Whiz instead of sliced provolone, and an equally worthy Corned Beef Reuben ($8) on marble rye. They put a fresh twist on Chicken Fingers ($7), too, breading them in crushed pretzels to surprising effect and matching them with Guinness mustard. Friday evenings, fish and chips are served, but F.Y.I: They apparently sell out pretty quickly. \r\n\r\nIf all of the above sounds a bit, well, unhealthy  I can already hear the nicotine apologists huffing about trans fats and cholesterol and equal treatment  it might be worth mentioning a few lighter offerings. Ive been impressed by the salads, particularly the Emerald Isle ($9) and the Crispy Oyster ($8). The first lays a chicken breast or lean strips of well-seasoned steak over baby greens with balsamic vinaigrette, tomato, roasted red peppers, red onion and blue cheese. The second substitutes a light bacon dressing for the balsamic, excludes the tomato and onion and adds to the mix not only fried mollusks but a fistful of fittingly briny capers. The Duck Quesadilla ($9.90) with goat cheese and caramelized red onion, meanwhile, defies my greasy preconceptions about the titular ingredients, especially sampled with the accompanying pineapple chutney.\r\n\r\nAs for that smoldering debate, I know: old habits die hard. The unfiltered butts of the jokes herein will still get a fair share of my business. Theyve earned it, despite their EPA ratings. But judging by the sizable Cock N Bull crowd this past Friday night, people are sick of getting sick and hungry for a change.');
