INSERT INTO `phpbb_posts_text` VALUES (4684,'d4deff4cbc','','[quote:d4deff4cbc=\"Chris Cole\"]Didn\'t Pete mention someplace directly across the street from there? There\'s also a pretty tasty Indian restaurant in Fortune Square, not that we have to meet there..., just throwing it out for discussion.[/quote:d4deff4cbc]\r\n\r\nWhat is Fortune Square?  I thought Old San Juan was the mex place next to the English pub we went to last time. \r\n\r\nI\'m totally confused on the matter so I\'ll just suggest meeting at the Cock and Bull pub down on Rosewood Ave.  It is next door to the Publix.  They have a nice menu with some English dishes and best of all Fuller\'s ESB on tap along with a number of other delicious malt beverages. \r\n\r\nEven if we dont have our meeting there y\'all still need to check it out.  Friday night they serve beer battered fish n chips.');
