INSERT INTO `phpbb_posts_text` VALUES (2790,'5b1f2c6dab','More new brews! Hurrah!!','[b:5b1f2c6dab]SWEET! Samichlaus and Delerium now in town![/b:5b1f2c6dab]\r\n[b:5b1f2c6dab]Vino 100[/b:5b1f2c6dab] @ 120 Sparkleberry Crossing\r\nMore High Gravity Beers\r\n\r\n\r\nFollowing the strong response to our initial line up of new High Gravity Beers, we are actively expanding our selection. This week we more than doubled the number of HG Beersfrom five to elevenand plan to continue adding choices based on your feedback. (A special thank you to Tina and Chris Cole for your suggestions.)\r\n\r\nAny beer sold in 4-packs is also available by the bottle, so stop by today and stock up on these great HG Beers:\r\n\r\nHorn Dog Barley Beer\r\nGonzo Imperial Porter\r\nWild Dog Barrel Aged Porter (750ml)\r\nTerrapin Big Hoppy Monster Ale\r\nChimay Blue Grand Reserve\r\nUnibroue Maudite Red Ale\r\nUnibroue La Fin du Mond (750ml)\r\nSt. Bernardus ABT-12\r\nDelirium Tremens\r\nSamichlaus\r\nThree Monts Flanders Golden Ale\r\n\r\nCome see us, and have a great day! \r\nAdele and Kevin Wyatt \r\n \r\n \r\nWhat is High Gravity Beer?\r\nYouve probably seen a lot of information about High Gravity Beer lately. So, what is it? The short explanation is HG beer has a high alcohol content. That became important recently when SC enacted laws raising the maximum alcohol content of beer from 5 to 14%. \r\n\r\nBut High Gravity brewers monitor a beers fermentation by tracking Specific Gravity, which is a measure of density. \r\n\r\nIn the beginning, the original gravity is high due to the sugars in the liquidcalled wort. During fermentation, yeasts consume sugar in the wort lowering the gravity and also creating alcohol as a byproduct. \r\n\r\nAs more sugar is consumed, more alcohol is produced and the gravity continues to drop. If the difference between the original gravity and the final gravity is a larger number, it is said to have High Gravity. \r\n\r\nEveryday Mix-and-Match Discounts\r\n\r\n\r\n5% off six packs \r\n10% off cases \r\n15% off three or more cases');
