INSERT INTO `phpbb_posts_text` VALUES (4646,'e99b64898b','Starkbierzeit','Well I was indeed in Munchen this past week-end. I didn\'t attend the actual starkbierzeit in particular, but I did have a few starkbiers here and there.\r\n\r\nAugstiner had a Maximator (8.5%). Schneider-weisse had a StarkbierWeizen (strong dark wheat based beer 8.2%). To me those beers were very good, however I think it\'s more of a fad than an actual style. [Of course who am I to argue about fads when they\'ve been brewing since 1328   *) (Augustiner)].\r\n\r\nI ended up going to all of the following places:\r\n\r\nAugustiner, Hacker-Pschorr, Schneider, SpatenHof and HofBrauHaus, and numerous little hole-in-the-wall places.\r\n\r\nJP');
