INSERT INTO `phpbb_posts_text` VALUES (2806,'000b63e8f1','','Here is my \"lite\" bock-  I\'ve got it on tap if you want to try one-  I keep this always as one of my house beers-   it is crystal clear (amber color) and always a favorite of anyone that drinks it.\r\n\r\nit started as a Weizen beer but the gravity... well... now its a bock!\r\n\r\n6lbs wheat DME (I perfer mutons)\r\n8oz Carfoam\r\n8oz Carahell\r\n1 1/2 lb Wheat Malt\r\n1lb Munich Lite Malt\r\nHallertauer- 60min\r\nIrish Moss 15min\r\n1oz Saaz- flameout\r\nwyeast 3056 (I\'ve done 3068 too- liked this one)\r\nPrimary for a week\r\nsecondary for 2\r\nkeg for a couple more till crystal clear\r\nIts also decent early-  with a bit more banana from the yeast (this falls out over time)\r\n\r\nI personally think it doesnt keep very well-   I think it is best drank from 5 to 10 weeks- then again I\'m a bit of a perfectionist!  my old brew buddy would drink this in 2 weeks and love it (and in 6 months and still love it)\r\n\r\n\r\nLast time I brewed this I put in 2lbs of munich and wheat-   and some extra 2005 yr hallertaur I had laying around-  it tastes good but it needs a little something to make it \"summery\".   I\'m thinking a single jalapeno-   not enough to taste- just a light  \"accent\" flavor');
INSERT INTO `phpbb_posts_text` VALUES (2807,'1542d39040','','Hmmmm...  What kind of yeast could we put in there and not get rid of those fruity esters?');
INSERT INTO `phpbb_posts_text` VALUES (2808,'c55df58897','','[quote:c55df58897=\"Scott Hasty\"]Hmmmm...  What kind of yeast could we put in there and not get rid of those fruity esters?[/quote:c55df58897]\r\n\r\nLOL   Just drink it in 2 weeks!   ;)   the esters dont all drop out-   I like a hint of banana- not overpowering!   you can also ferment it a bit warmer than I do-   I try to hit 68 with this one.   Try 72 or so');
