INSERT INTO `phpbb_posts_text` VALUES (4623,'af95ef9c66','2008 Aiken Brewing trip - March 8th','Randy &amp; Company at Aiken Brewing have agreed to give us the grand tour, once again, of Aiken Brewing. The game plan so far:\r\n\r\nSaturday, March 8th, meet in the parking lot of Bet-Mar at 10am unless you have other ride plans.  We will pick out DDs and carpool.  I imagine two cars will be sufficient.\r\n\r\nWe\'ll eat lunch and drink at Aiken, get the tour, see what\'s new, swap stories, buy some growlers, leave Aiken whenever you guys feel like it.  It\'s a one hour drive back to Columbia.\r\n\r\n[url=http://maps.google.com/maps?q=Aiken,+SC,+United+States+of+America&amp;sa=X&amp;oi=map&amp;ct=title]Here\'s the Google map![/url]\r\n\r\nOh yeah, post here if you plan on going. \r\n\r\nI will not be able to attend this one, so you\'ll have to work out some of the logistics on game day!');
