INSERT INTO `phpbb_posts_text` VALUES (4622,'f82ecc95c3','','Just to wrap things up:\r\n\r\nFriday night we ran into the Worthogs homebrew club @ Foothills were we proceeded to drink some seriously good homebrew (although most was gone by the time we arrived) and some rare commercial beer (Lost Abbey Angel\'s Share, Dark Lord, 2003 Anchor Christmas ale, Firestone 11, etc).  Good times!\r\n\r\nBrendon, Preston and I arrived in line at Foothills Saturday morning at 9am.  We were about 40 people back.  There were eventually about 90 people in line before the doors opened at 11.\r\n\r\nAll 500 bottles of Sexual Chocolate sold out in under an hour.\r\n\r\nI personally met people from 5 states (the Carolinas, GA, VA, Alabama) and heard of a guy who came down from Maryland.  !!\r\n\r\nPreston managed to score bottle 500/500, sure to be a collectors item in 80 years or so.   :mrgreen: \r\n\r\nIt was a little exhausting, but oh-so worth it.\r\n\r\n :drink:');
