INSERT INTO `phpbb_posts_text` VALUES (4606,'752bcea8c9','','To elaborate on the availability of Chimay Cheeses from Earth Fare, I should note that Earth Fare has, not one, but three (3) of their cheeses, the basic, the Het Bier and the Grand Cru.  All are presented as wheels from which a piece the size you want may be cut.  Earth Fare had no \"slices\" being offered when we were there this past Saturday.');
INSERT INTO `phpbb_posts_text` VALUES (4607,'448b9691f1','cheese','Of the three cheeses, which is your favorite (anyone who\'s tried them)? I\'ve had one of them but don\'t know which it was (and that was a long while back). I\'m always looking for a good cheese. I do believe cheese tops even higher on my list of indulgences than beer. When you can pair cheese with beer it\'s a win win!');
INSERT INTO `phpbb_posts_text` VALUES (4608,'f8df3d5eaf','Beer tasting this Friday @ Robin\'s','Yeah, it\'s late notice.  There will be a craft beer sampling at Robin\'s this Friday at 7:30pm.  Bring a bottle of something special to share.  We\'ll be tasting some Russian River beers from California and other things, to be determined by crowd wishes!  Robin lives downtown  on Barnwell Street off Gervais in Abermarle apartments next to the Dial, Dunlap and Edwards offices.   Call me at 600-7750 for further details.  This will be fun.   :mrgreen:');
INSERT INTO `phpbb_posts_text` VALUES (4609,'122de455f6','','Of the three, just to eat, I prefer the Grand Cru.  The Het Bier has a creamy and soft texture (not soft like Brie but firmer).  Its flavor reflects the beer with which it is bathed; nutty with a flavor that fleetingly suggests (but is not) smoke.  The Grand Cru like the Het is creamy but lacks the pronounced nuttines/smoke and, to me, has more complexity. Both have a long pleasant palate. I like the Grand Cru with Chimay Red and the Het with the Chimay Blue.  I have not had the \"Classic\" cheese in a while so I will not comment.  There is a fourth cheese, which I would love to find, the \"Old Chimay\" which is a 36(?) month hard cheese.  None of these cheeses are inexpensive.  I recall them being $12-15 a pound.  I could be wrong as it seems the wheel was $58.');
INSERT INTO `phpbb_posts_text` VALUES (4595,'710237d8b7','stuff','This looks great Pete. We have been needing more options:-). They don\'t happen to have tasting cups, do they?\r\n\r\nchecks can be mailed to: Make sure they make the check out to \"Palmetto State Brewers\"\r\nPalmetto State Brewers\r\n2022 Fairlamb Ave\r\nColumbia, SC 29223\r\n803-738-8244');
