INSERT INTO `phpbb_posts_text` VALUES (4597,'645ed3144b','Chimay Cheese','The Gourmet Shop in 5 Points usually has a wheel of Chimay Cheese.  Meredith, the cheese monger, is very knowledgeable and will slice any amount you like.  Cheese cut from the wheel is much better than the packaged slices that some grocery stores like Earth Fare carry.\r\n\r\nChimay Cheese and Chimay Blue together  is an incredible taste experience.   The taste is truly seemless, ie, its hard to tell where the cheese ends and the ale begins and vice versa.\r\n\r\nCheers!\r\n\r\nGerald D. Jowers, Esq.');
