INSERT INTO `phpbb_posts_text` VALUES (4594,'61fe8de52b','Hop Rhizomes (roots) for 2008','Hop lovers,\r\nWe have just received the list of rhizomes which will be available to those of you who want to grow hops. There are 15 different varieties* &amp; they will sell for $4.95 each.\r\n\r\nWe are taking pre-paid orders through Feb 29th, so contact us if interested or for more info.\r\n\r\nThanks for your business,\r\nMark &amp; Sonja             Bet-Mar Liquid Hobby Shop     798-2033   1-800-882-7713\r\n\r\n*VARIETIES:  Cascade  Centennial  Chinook  Fuggle  Glacier  Golding  Hallertau  Horizon  Liberty\r\n                     Mt Hood  Nugget  Santiam  Sterling  Tettnang  Willamette');
INSERT INTO `phpbb_posts_text` VALUES (2879,'265b21f216','Smoked Cabbage','Like Preston, I too love taking something that\'s normally healthy and tainting it!\r\n[b:265b21f216]Smoked Cabbage[/b:265b21f216]\r\n1 small/medium head cabbage\r\n4 strips of bacon\r\nVinegar\r\nMustard\r\nButter\r\nSalt &amp; Pepper\r\n\r\nCore cabbage about 2/3rds of the way down. Fill core with vinegar and mustard. If you wish, add some cooked ham, bacon, pepperoni, etc...\r\nAfter about 30 minutes or so, when the vinegar mustard mixture has been mostly absorbed, fill core with butter.\r\nRub the exterior with butter and apply salt and pepper.\r\nLay 4 strips of bacon over the top, covering as much of the cabbage as possible.\r\nSit upright on foil or in a pan in a smoker (roughly 200-225F)\r\nSmoke for 4-4.5 hours.\r\nRemove rubbery exterior leaves and chop.\r\nAdd cheese if desired.\r\n\r\nConsume with beer.  :cheers:');
