INSERT INTO `phpbb_posts_text` VALUES (4590,'cd95b1d26d','','After looking at printfection, cafepress and zazzle it looks like cafpress has the largest selection and is easiest to use.  Printfection has better prices on bulk items and zazzle has one or two neat items not available elsewhere.\r\n\r\nThere is little to no risk for the club in setting up a store.  Basically it works on a per order basis.  If a person wants to buy a shirt then cafepress will make the shirt for 9.99.  We then set the markup anywhere we like; say $2.  The retail amount displayed will be $11.99 before shipping.  When our account collects a minimum of $25 they will cut a check to the PSB.\r\n\r\nI went ahead and set up about 20 items on cafepress and the store is [url=http://www.cafepress.com/psbstore]viewable here.[/url]  To make it official they will need an address to mail our earnings, phone contact info and our federal tax id number.  \r\n\r\nIf this is something we want to do then we need to promote it heavily at the grand opening.  I would think releasing it at a meeting and on the website simultaneously would have the biggest impact.  I dont expect many sales but the more we build up the shop the more we might be able to capitalize on any momentum a grand opening could have.  Maybe even wait a few weeks and promote it in the forum heavily first.\r\n\r\nThoughts?');
