INSERT INTO `phpbb_posts_text` VALUES (2939,'072cb92091','First All-Grain','Just looking for a simple/easy AG recipe to test out my NEW system.  Style doesn\'t matter, the only two requirements are for it to be easy with very good taste.  I want to try a batch sparge in my 70 qt MLT.  Like I said easy in order to ease into this process.\r\n\r\nThe dark side is so compelling!\r\n\r\nTIA\r\n\r\n :devil:');
