INSERT INTO `phpbb_posts_text` VALUES (4817,'cf58feade2','Last Call...','Any late-comers? We need an accurate count ASAP for beverage planning! Speak now or forever hold your peace! Brad, I have you listed as a \"maybe\"... Join us! \r\n\r\nHere\'s the tentative lineup:\r\n\r\n*Don Tomas Special Edition Connecticut 100 (7.5 x 50) paired with a Whitbread.\r\n\r\n*A rye pale or double rye as a palate cleanser.  lol \r\n\r\n*Rocky Patel Vigilante paired with a Gonzo Porter! \r\n\r\n*Appetizers galore. \r\n\r\nFun for all ages! See everyone there. Also, non-cigar smokers will get in at a reduced rate!');
INSERT INTO `phpbb_posts_text` VALUES (4320,'9d2d396a3d','','It\'s pretty simple why they don\'t want you to use an alcohol related box: If it were alcohol, it would require a signature on delivery, and that would mean the UPS truck driver would have to check for ID  (I\'m not kidding). In other words, it\'s the \"don\'t ask don\'t tell\" of shipping.\r\n\r\nIf you\'re the least bit crafty, you can turn a beer case inside out and the inside is not labeled. It takes a bit of packing tape, but I\'ve done it before.\r\n\r\nJP');
