INSERT INTO `phpbb_posts_text` VALUES (4824,'2b08dfa5b5','Portland trip','I did a one day trip to Portland about 10 years ago, and just based on that I would recommend the trip to any beer lover. If my memory is clear enough to remember some of our stops. Bridgeport was a very impreessive place with good beer. The Full Sail taproom was a little too high class for my liking. We did find a little place downtown called Tugboat brewing that would the H.G. looks large by comparsion. Oregon used to put out a Brewery map for the state that had the location of most of the breweries and brew pubs. It was with the other tourist information. I think I managed to hit most of the ones along I-5 at one time or another.');
