INSERT INTO `phpbb_posts_text` VALUES (2956,'9144ff64cd','','[quote:9144ff64cd=\"Scott Hasty\"]Yeah I might do a decoction for my second All-Grain.  I just want a stinking recipe that is easy to follow.  Considering that I am all alone over here, it looks like I am going to just have to fumble through it.[/quote:9144ff64cd]\r\n\r\nHasty -\r\n\r\nThis is a recipe I used for my first AG batch.  It was put together by a very good brewer I know from another brewboard.  I made both the AG and extract (of my own design).  Both were contaminated and smelled like boiled cabbage but I\'m sure that was my fault and not the recipe designers.  Anyho, it had great potential and smelled wonderful during fermentation and brewing.\r\n\r\nGood luck.\r\n\r\n\r\nRecipe Specifics\r\n----------------\r\nRecipe Name: Theo\'s Dark Mild\r\nBrewed On: 3-31-2006\r\n\r\n\r\nBatch Size (Gal): 6.00\r\nEst. IBU: 18.0\r\nActual OG: 1.034 Plato: 8.44\r\nActual FG: 1.012 Plato: 3.07\r\n\r\n\r\nGrain/Extract/Sugar\r\n\r\n% Amount Name Origin Potential SRM\r\n-----------------------------------------------------------------------------\r\n88.9 6.50 lbs. Marris Otter Great Britain 1.038 2\r\n5.1 0.38 lbs. Crystal Malt 85 Brtain 1.034 85\r\n5.1 0.38 lbs. Carafa Chocolate Malt Germany 1.030 525\r\n0.9 0.06 lbs. Carafa Special Germany 1.030 600\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\nAmount Name Form Alpha IBU Boil Time\r\n-----------------------------------------------------------------------------\r\n0.40 oz. Fuggle Whole 5.00 7.6 90 min.\r\n0.45 oz. Bramling Cross Pellet 5.50 10.3 90 min.\r\n\r\n\r\nExtras\r\n\r\nAmount Name Type Time\r\n--------------------------------------------------------------------------\r\n1.00 Unit(s)Whirlfloc Fining 15 Min.(boil)\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP022 Essex Ale\r\n\r\n\r\nMash Schedule\r\n-------------\r\n\r\nMash Type: Single Step\r\n\r\nGrain Lbs: 7.31\r\nWater Qts: 10.01 - Before Additional Infusions\r\nWater Gal: 2.50 - Before Additional Infusions\r\n\r\nQts Water Per Lbs Grain: 1.37 - Before Additional Infusions\r\n\r\nSaccharification Rest Temp : 155 Time: 90\r\nMash-out Rest Temp : 168 Time: 15\r\nSparge Temp : 170 Time: 60\r\n\r\nAll temperature measurements are degrees Fahrenheit.');
