INSERT INTO `phpbb_posts_text` VALUES (4312,'7a030fb2ac','February road trip!  Sexual Chocolate in Winston-Salem','More information at the January meeting.  Going to get a van or car caravan to take some PSB members up.  This is the first time Foothills has bottled any of their brew.  Should be a great time.  Sign up below!   :drink: \r\n\r\nFrom [url=http://www.foothillsbrewing.com/]Foothills Brewing[/url]:\r\n\r\nSexual Chocolate will be released in 22 oz. bottles beginning at 11:00am, February 2nd, 2008. Please lineup on Fourth St. near the front door of Foothills Brewing. The first 100 places in line will receive a bracelet for the purchase of 4 22oz. bottles of SC. Should there be more than 100 in line, the next 50 will receive a bracelet to purchase 2 22oz. Carpooling is your friend, folks.\r\n\r\nShould we not go through the entire allotment, bracelets will be redistributed to those interested in purchasing additional bottles.\r\n\r\nThe price on Sexual Chocolate 2008 will be $15 per bottle. In addition, all Foothills merchandise will be available for purchase. Growlers of all other beers on tap will be available -- due to the limited volume of Sexual Chocolate, no growlers will be available. Tours will be availble for those 1st timers....Saturday will also see some special beers on tap at Foothills, so come and hang out for a while. \r\n\r\nParking should be readily available on 4th St---if the street is full, please use Foothills back lot on Holly Ave. (Holly serves as 3rd St. behind Foothills) If you intend to hang out, trade, tailgate, etc.---PLEASE use the back parking lot. We will allow access out the back door after the sale begins. The brewery will be accessible for tours and looksies, as well as our brewery and sales staff.\r\n\r\nIn addition, for those of you close or travelling from afar, Foothills will be hosting a gathering on Friday night in our upstairs mezzanine for anyone wanting to stop by...RateBeerians, Beerinators, BA\'s, homebrewers, general beer lovers...Feel free to bring a few samples to share, but please leave serious trading for off the premises. (legal disclaimer) This gathering will begin 7ish and will include light snacks/appetizers--please join us if in town.');
INSERT INTO `phpbb_posts_text` VALUES (2964,'843b2ca5a5','','Thanks good buddy, never tried a dark mild.  It should be fun! If not I will scale this back and try a 5 gallon batch.\r\n[code:1:843b2ca5a5]\r\nBeerSmith Recipe Printout - www.beersmith.com\r\nRecipe&#58; Secret Recipe\r\nBrewer&#58; Scott Hasty\r\nAsst Brewer&#58; Obi-wan Kenobi\r\nStyle&#58; Belgian Strong Golden Ale\r\nTYPE&#58; All Grain\r\nTaste&#58; &#40;35.0&#41; \r\n\r\nRecipe Specifications\r\n--------------------------\r\nBatch Size&#58; 10.00 gal      \r\nBoil Size&#58; 13.20 gal\r\nEstimated OG&#58; 1.071 SG\r\nEstimated Color&#58; 3.8 SRM\r\nEstimated IBU&#58; 17.8 IBU\r\nBrewhouse Efficiency&#58; 76.5 %\r\nBoil Time&#58; 90 Minutes\r\n\r\nIngredients&#58;\r\n------------\r\nAmount        Item                                      Type         % or IBU      \r\n19 lbs 14.4 ozPilsner &#40;2 Row&#41; Bel &#40;2.0 SRM&#41;             Grain        85.0 %        \r\n3.00 oz       Saaz &#91;3.00%&#93;  &#40;75 min&#41;                    Hops         15.6 IBU      \r\n1.25 oz       Styrian Goldings &#91;5.40%&#93;  &#40;5 min&#41;         Hops         2.2 IBU       \r\n0.28 oz       Ginger Root &#40;Boil 10.0 min&#41;               Misc                       \r\n0.28 oz       Seeds of Paradise &#40;Boil 10.0 min&#41;         Misc                       \r\n0.84 oz       Coriander Seed &#40;Boil 10.0 min&#41;            Misc                       \r\n3 lbs 8.0 oz  Cane &#40;Beet&#41; Sugar &#40;0.0 SRM&#41;               Sugar        15.0 %        \r\n2 Pkgs        Belgian Strong Ale &#40;Wyeast Labs #1388&#41; &#91;StYeast-Ale                  \r\n2 Pkgs        Belgian Ardennes &#40;Wyeast Labs #3522&#41; &#91;StarYeast-Wheat                \r\n\r\n\r\nMash Schedule&#58; Secret Recipe\r\nTotal Grain Weight&#58; 19.90 lb\r\n----------------------------\r\nName               Description                         Step Temp     Step Time     \r\nSaccharification   Add 3.78 gal of water at 160.0 F    143.0 F       45 min        \r\nMash Out           Add 2.98 gal of water at 181.6 F    158.0 F       30 min        \r\nSparge             Add 2.38 gal of water at 208.7 F    170.0 F       10 min        \r\n\r\n\r\nNotes&#58;\r\n------\r\n\r\n\r\n-------------------------------------------------------------------------------------[/code:1:843b2ca5a5]');
