INSERT INTO `phpbb_posts_text` VALUES (4311,'65fffb41a3','','I don\'t know about audiophile, but I have done sound and sound systems for a while. Largest sub I have personally used was a Peavey sp118 with an 18\" woofer. Used this in a show at Workshop Theatre, it was amazing what that would do indoors. Also, it was the size of a large dorm fridge.\r\n\r\nI have a little Sony SA-WM250 sub I bought at Circuit city on sale for around $100. It has a 100 watt RMS rating, does quite well on my PC. It connects through the speaker leads to the satellite speakers.\r\n\r\nI also have a Polk Audio sub for my home theater. I think it is also around 100 watt. I got it simply because it was matching it to the other Polk Audio speakers I had. The Polk was probably twice or three times the cost of the Sony. Placement is important on a sub, the best bass reinforcement is with corner placement. It certainly shakes the floor and rattles the windows. It is connected to a Yamaha receiver through a line level subwoofer output.');
INSERT INTO `phpbb_posts_text` VALUES (2969,'2b5c8486e7','','How about 9lbs british pale. 1ounce cascade at 45. Mash at 153,boil for sixty min and use a dry ale yeast . ferment at 65ish. Thats one of my simple recipes. I did several batchs aimed at seeking different hop profiles. same recipe different hop each time. It works real well. simple but very tasty. also if this is your first ag I\'d do a run thru with a batch of water.If you have any adjustments to make its better to find out befor wert is involved. My thoughts.  :drink:');
