INSERT INTO `phpbb_posts_text` VALUES (4290,'29ad88f704','','8)  heehee..smirk, smirk... I have lots of hops.  Many kinds, including Cascade and Centennial which I don\'t particularly care for.  All have been stored frozen, many in their original shrink packages.  They are a couple of years old but work fine, smell great.  Available at, shall we say,  \"appropriate\" prices.  Leaf and pellet.  None more than $10 an ounce  :devil: .  I need some Spalt (original lable only  :wink: ).  May swap.');
INSERT INTO `phpbb_posts_text` VALUES (4291,'e9190e2181','Odd yeasts and yeast ranching','I was going through my yeast collection and found a slant of the old Danstar \"Manchester\", discontinued several years ago.  An \"old\" English strain with wonderful esters and a woody flavor common in many of the northern English bitters.  If anyone wants to use this will be happy to make a slant.  Let me know a week or so before.\r\n\r\nIs anyone doing any yeast ranching? It is very useful for those strains which are only around once in a while.\r\n\r\nSource for agar.  Agar is painfully expensive IF you can find it.  I found a supply at  a very reasonable price.  The oriental market at Wescott and St Andrews has small packets for a couple of bucks.  Food grade, not scientific grade.');
