INSERT INTO `phpbb_posts_text` VALUES (4298,'dc4f1ad269','','I USED to play around with yeasts, just starting to get back into it. Only expensive thing I didn\'t get around to buying was a hemocytometer, even though I got the Methyl blue for staining. I have the lab microscope, culture tubes, autoclave, loops, torches, incubator, magnetic stir plate, etc.\r\n\r\nI just bought some agar last week at 14 Carrot, and you are right, it was expensive. They have two forms, flakes and powdered. I used to buy my ranching supplies from a home brew shop in California that Maribeth Raines was associated with. (Brewers Resource or BrewTek comes to mind)\r\n\r\nI have two booklets: \"Yeast Culturing for the Homebrewer\" by Rog Leistad and \"Advanced Yeast Culturing for Homebrewers\" by Maribeth Raines, Ph.D. I have not checked, but I\'m sure it is still out there: \"YEAST INFORMATION AND TECHNIQUE RESOURCE\". I downloaded it from somewhere, maybe the HBD years and years ago (my copy shows a date of May 26, 1994). Has good information, such as yeast washing and sending yeast samples through the mail.');
