INSERT INTO `phpbb_posts_text` VALUES (4257,'b0957916e8','This is kinda scary- Hops are selling out','www.hopsdirect.com sold out today....\r\n\r\nThings are looking pretty bad for hops-  freshops still has some but I hear they don\'t have much.  Northern Brewer just got their \"yearly\" shipment in and just about don\'t have any available.  I guess they are not putting the hops they use in their kits on the market.\r\n\r\nI hear that some of the 2007 european hops that have not hit the market yet...   but it sounds like there might not be any!');
INSERT INTO `phpbb_posts_text` VALUES (4258,'3e8fe72bb7','This is kinda scary','The hop situation is unprecedented.  Panic buying and bulk buying are making a bad situation even worse.  2008 and 2009 will be very difficult for small brewers and homebrewers.   I am concerned for all beer enthusiasts, especially homebrewers and small brewers. (BTW, my column in Free Times this week concerns this crisis and was intended to inform the general public.)\r\n\r\nPSB with Bet-Mar\'s help may need to investigate bulk buying, that is, form a coop.\r\n\r\nGerald');
