INSERT INTO `phpbb_posts_text` VALUES (4264,'e2324145e1','','Gerald\'s article paired well with a hoppy brew last night, probably made me savor it more  :) \r\n\r\nIt seems a good time to utilize the hop tea method to maximize what you have. Pete and Ray helped me develop my slacker style that produces a good pale ale (especially with Simcoe hops - yum). I understand Dan Derrick is a knowledgeable source on this technique as I am sure are others.\r\n\r\nIs anyone growing hops? I would like to but the curent plot of land does not get enough full sun.\r\n\r\nI would be intereseted in participating in a coop, but would be a small player. I like variety and figure I use [u:e2324145e1]&lt;[/u:e2324145e1] 2 lb. of mixed hops over the course of a year, in my modest concoctions.\r\n\r\nKGS');
INSERT INTO `phpbb_posts_text` VALUES (4265,'082866c2d6','','We generally grow Cascade hops up our back fence. They do poorly since we are too lazy to water them. When hops are available...it\'s so much easier to just purchase them. We bulk buy our hops except when we need just a little bit at the last minute...in which we have to scramble to get to Bet Mar.');
