INSERT INTO `phpbb_posts_text` VALUES (4578,'df48ba549e','PSB Merchandising','I was snooping around trying to get results for this past Saturdays AHA Club Only competition when I came across this:  [url=http://prairiehomebrewers.org/merchandise.htm]http://prairiehomebrewers.org/merchandise.htm[/url].  The Prairie Homebrewing Companions is a club about the same size of ours and yet they manage to have all of this merchandise.  Maybe we need to rethink how we go about getting t-shirts and glasses.  I know it would be nice to have something similar set up if it doesnt cost anything.  I\'ll look into this a little further.');
