INSERT INTO `phpbb_posts_text` VALUES (3028,'f90119fff8','','Kroger- two notch has in Chimay and unibroue!  Also several other High Gravity brews (including one from AB???)\r\n\r\nI didn\'t check the price-   but at Kroger in VA it was 20-50% less than the \"beer\" stores.  For example at Kroger DFH 90/120 was cheaper than my old beer store\'s distributer\'s price!!!!');
INSERT INTO `phpbb_posts_text` VALUES (3029,'ab9a0249bb','','&gt; I didn\'t check the price- but at Kroger in VA it was 20-50% less than the \"beer\" stores. For example at Kroger DFH 90/120 was cheaper than my old beer store\'s distributer\'s price!!!!\r\n\r\nSometimes grocery stores will drastically mark down prices (to below cost even) to move beers that they have cut out of their set. Don\'t know if that\'s what was going on here. But if you see those kind of deals, grab some for me!\r\n\r\nAs for Morganelli\'s, they were supposed to be getting Schlenkerla Rauchbier this week, per my request. I should probably head over there to buy some... I suggest everyone else do the same! \r\n\r\nThey have more room set aside for high grav beers, and are willing to bring in whatever customers ask for.');
INSERT INTO `phpbb_posts_text` VALUES (3030,'a17267b765','','[quote:a17267b765=\"BradPetit\"]\r\nSometimes grocery stores will drastically mark down prices (to below cost even) to move beers that they have cut out of their set. Don\'t know if that\'s what was going on here. But if you see those kind of deals, grab some for me!\r\n[/quote:a17267b765]\r\n\r\nNaw- I\'m talking normal prices- not specials!\r\n\r\nKroger in Va regularly stocked i\'d say 80+ good craft brews (40+ hi grav)  I could usually get 3-5 different beers from each-DFH, Troegs, Unibraue, Chimay, and in addition several more from about 20 other decent craft brewers.  The shelf space was more than Greens-   I\'d say the \"specialty beers\" where about 10\' of the cooler and in addition 25-30\' in the wine section. I\'m not counting beers like blue moon/Spaten/Hoegarden and samual adams- only \"real\" craft types.  Then again-   the wine selection in VA was much better too- I guess it really was not a law thing- more of market demand- I could get much more specialty foods too-\r\n\r\nLets just hope that organtic growth of SC consumer preferences can grow in addition to all us \"transplants\"-   I heard today 37% of the people that live in the greater Columbia area where born outside of SC.');
INSERT INTO `phpbb_posts_text` VALUES (4570,'f7e0b34fa5','Solving tap madness - a proposal','Hey guys.  In response to club members needing this or that type of tap for commercial kegs, I make the following modest proposal.\r\n\r\nWe can purchase, as a club, all major keg couplers (or full setups with tap + pump and party tap) for a rather minimal cost -- under $200 for all the five couplers alone and under $400 for the four major couplers with pumps.  Check prices and info at:\r\n\r\nhttp://www.micromatic.com/draft-keg-beer/keg-pumps-cid-10.html\r\n\r\nSo to recap:\r\n\r\n1. Club purchases and holds taps / pumps\r\n2. PSB member requires tap, pays $20 deposit, gets $15 back when they return tap\r\n3. No one has to wait to get into a keg\r\n4. The club provides a valuable service to its thirsty members!\r\n\r\nI would be willing to spearhead this, and we could have a simple sign in / out tap thread on the forum at all times.\r\n\r\nThoughts?');
