INSERT INTO `phpbb_posts_text` VALUES (4563,'4510e33dce','','[quote:4510e33dce=\"Jamie Sox\"][quote:4510e33dce=\"Dan Adams\"]I can\'t tell if Pete is being sarcastic or if he just doesn\'t like beer.   :mrgreen: \r\nSome Left Hand brews have hit Greens, and Bear Republic should be there later today or Friday.\r\nAlso they\'re doing growler fills of Old Chub!  Yumma.[/quote:4510e33dce]\r\n\r\n\r\nBear Republic (Red Rocket,Racer 5, HopRod, and Xtra Pale Ale ) are available at Greens on Piney Grove. Some how 12 of the Bear Republic \r\nfound their way into my shopping cart. :mrgreen: \r\n\r\n :drink:[/quote:4510e33dce]\r\n\r\nI hope that Bear Republic beers will be available in NC, otherwise I guess I could go to Green\'s in Greenville.\r\nI have a great fondness for the Bear Republic brews. I\'ve been to the brewery in California.\r\nI picked up a mixed case while in Ohio last year. Glad the beer is available closer to home.\r\nNow if we could just get Russian River, Alesmith, Stone.........');
INSERT INTO `phpbb_posts_text` VALUES (3121,'f6edcd7725','','Well my first all-grain was completed using the recipe that follows.  With that being said, I have a few questions!\r\n\r\n[code:1:f6edcd7725]BeerSmith Recipe Printout - www.beersmith.com\r\nRecipe&#58; Belgium &#40;5 Gallons&#41;\r\nBrewer&#58; Scott Hasty\r\nAsst Brewer&#58; \r\nStyle&#58; Belgian Specialty Ale\r\nTYPE&#58; All Grain\r\nTaste&#58; &#40;35.0&#41; \r\n\r\nRecipe Specifications\r\n--------------------------\r\nBatch Size&#58; 5.00 gal      \r\nBoil Size&#58; 6.89 gal\r\nEstimated OG&#58; 1.071 SG\r\nEstimated Color&#58; 3.9 SRM\r\nEstimated IBU&#58; 20.1 IBU\r\nBrewhouse Efficiency&#58; 75.0 %\r\nBoil Time&#58; 90 Minutes\r\n\r\nIngredients&#58;\r\n------------\r\nAmount        Item                                      Type         % or IBU      \r\n10 lbs        Pilsner &#40;2 Row&#41; Bel &#40;2.0 SRM&#41;             Grain        85.0 %        \r\n1.50 oz       Saaz &#91;3.40%&#93;  &#40;75 min&#41;                    Hops         18.1 IBU      \r\n0.50 oz       Goldings, East Kent &#91;5.70%&#93;  &#40;5 min&#41;      Hops         1.9 IBU       \r\n0.14 oz       Ginger Root &#40;Boil 10.0 min&#41;               Misc                       \r\n0.14 oz       Seeds of Paradise &#40;Boil 10.0 min&#41;         Misc                       \r\n0.40 oz       Coriander Seed &#40;Boil 10.0 min&#41;            Misc                       \r\n1 lbs 12.3 oz Cane &#40;Beet&#41; Sugar &#40;0.0 SRM&#41;               Sugar        15.0 %        \r\n1 Pkgs        Belgian Ale &#40;White Labs #WLP550&#41; &#91;Starter Yeast-Ale                  \r\n1 Pkgs        Belgian Golden Ale &#40;White Labs #WLP570&#41; &#91;SYeast-Ale                  \r\n\r\n\r\nMash Schedule&#58; Secret Recipe\r\nTotal Grain Weight&#58; 10.00 lb\r\n----------------------------\r\nName               Description                         Step Temp     Step Time     \r\nMash In            Add 2.50 gal of water at 158.1 F    143.0 F       45 min        \r\nSacharification    Add 0.90 gal of water at 209.9 F    158.0 F       30 min        \r\nMash Out           Add 1.20 gal of water at 210.6 F    170.0 F       5 min         \r\n[/code:1:f6edcd7725]\r\nOk so I was trying to follow the water additions that Beersmith produced, and had to add the following;\r\nextra .25 gallons water at first addition\r\nextra 1.5 gallons water at second addition\r\nextra 1 gallon water at third addition\r\nThis lead to a sparge amount of 1 gallon as opposed to my original 3.5 gallon sparge calculated.  Ok so for the mash I took my preboil SG (1.046) which was 8 points less that the supposed 1.054.  No biggie.  Now in the boil I had about 8.5 gallons to boil instead of the predetermined 6.89, which lead to a 2.5-3 hour preboil to get my volume right.  I was really trying to get the color right on this one, so I added the sugar late (15 min) left in the boil so no caramelization would occur.  Everything smelled great I made a .5 gallon starters for each yeast. The thing took off in less that 10 hours.  My questions are why did the color not turn out right, was it because of the prolonged boil when getting the volume to 6.5?  Why were my volumes off, I preheated the mash tun and used a 1:1 ratio (qt/lb) for initial absorption, 1.35 qt/lb ratio for sacharification, and 1.85 qt/lb ratio for mash out.  I ran the calculation that Palmer talks about in \"How to Brew\" and they checked out with what Beersmith calculated.  At least I hit my all of my temps and I even got 86.8% brewhouse efficiency!  I guess all in all it wasn\'t too bad for my first attempt.  Any help on these matters are greatly appreciated.\r\n\r\nThanks\r\n\r\nOh yeah needless to say it was 10 hour brew session! :(');
