INSERT INTO `phpbb_posts_text` VALUES (4562,'065dec9c28','','Memories...\r\n\r\nI started brewing with a friend back in \'69...way before it was legal. Living in Rochester NY we would drive 90 miles to Ft Erie, Canada where you could buy Ovaltine Bru-Mix hop flavored malt extract  in the grocery store. I think Ovaltine still is a major extract producer. My friend\'s dad was a consultant for the local power company and obtained some yeast for us from the Genesse Brewery where he was working for a while. We also did the cotton in the mouth of a Guiness bottle trick :roll: \r\n\r\n The directions were on the back of the extract can label. 1 can of extract and 10 cups of sugar as I recall. We had a homebrew book from Canada. We followed the frementation instructions and put a plastic garbage bag inside  a  garbage can, poured in the so called wort and gathered the bag at the top and secured with a rubber band that would allow the pressure to escape. We had no knowledge of sanitation issues at that time and every couple days would open the bag and dip a glass into the wort to taste it..often dumping some back into the vessel.  When we figured it was done we  followed the brewbook directions and filtered it by pouring it through a flannel shirt and bottled it with 1/4 tsp sugar per bottle and let it carbonate. We were always very happy with the results, which tasted horrible.\r\nWe finally found Atlantic Baking Co in Rochester. It was a wholesale baker\'s supply house. In amongst the cans of malt extract used by bakers were some cans of Blue Ribbon Hop Flavored malt extract. Then over in the yeast section were some envelops marked \"Brewer\'s yeast\" and in yet another section were hydrometers with a red mark on them that said \"bottle here\". Our beer was noticablely better after obtaining these ingredients. It went form horrible to terrible :mrgreen: \r\n\r\nTo this day all i use for a fermentation lock is a piece of plastic wrap stretched over the mouth of the vessel secured with a rubber band *)');
