INSERT INTO `phpbb_posts_text` VALUES (4554,'7091a1452b','','[quote:7091a1452b=\"Pete Goodwin\"][quote:7091a1452b=\"Dan Adams\"]I can\'t tell if Pete is being sarcastic or if he just doesn\'t like beer. [/quote:7091a1452b]\r\n\r\nThe beer is not bad I\'m just really unimpressed.  Maybe I bought into the hype and had my expectations too high.  I was expecting to fall in love in one sip.\r\n\r\nI do think a smaller serving at FS would be more appropriate.  That is a lot of uber-chocolaty beer to get through.[/quote:7091a1452b]\r\n\r\nI have to agree. I love beer and I love chocolate equally, but think the whole chocolate beer thing is overrated. I do not think it was an accident this was released close to V-Day. Fortunately I asked for a taste and that was more than enough for two of us. But then again, I\'m not into the whole \"over the top\" beer craze; different drummer I guess.\r\nI can attest to the drink of beer / bite of chocloate theory - it is yummy, most beers work well  - Hershey kisses are a personal favorite.');
