INSERT INTO `phpbb_posts_text` VALUES (4557,'9960ddd7b2','Benefits for Aged Brewers','We need to take the present hardships and contributions of older brewers into consideration.  Many of these folks have dedicated their lives to the art of making beer often at great personal risk.  These folks are the generation who fought to make homebrewing legal, risking jail and physical harm for the rights the younger generation takes for granted.  Getting high grav beers, hah a battle fought by gentlemen in suits.  Imagine making home brew in the fifties and sixties with hopped Blue Ribbon Malt Extract, sugar and bakers yeast when detection would get the dogs siced on you.  Black market cappers and caps. Flying glass from beer bombs.  Then drinking the product making believe it was good (it was, sometimes).\r\n\r\nWhy doesn\'t PSB waive the dues of a member who is, let\'s see, retired on SS worn out by decades of schlepping carboys and whose mental facilities may be in decline from the trauma of drinking too much bad beer in an effort to assure the younger generation wouild have the techniques and freedom to brew great beer.');
