INSERT INTO `phpbb_posts_text` VALUES (3147,'f3f1a5db3f','Re: clone','[quote:f3f1a5db3f=\"chriswillis\"][quote:f3f1a5db3f=\"Tina Cole\"]Yep, we\'ll be doing a Raison D\'Etre[/quote:f3f1a5db3f]\r\n\r\nRaisions and all?\r\n\r\nYummy!\r\n\r\ndo you put them in the mash or just in secondary or???[/quote:f3f1a5db3f]\r\n\r\nRaisins get pureed with wort and dumped into the boil along with candy sugar with 10 minutes remaining. It\'s off to a vigorous fermentation! We used a 2 quart starter that lived on the stir-plate for about 24 hours prior. Lag time was virtually non-existent! It literally started fermenting the instant the yeast was added. Polar opposite of the \"ghetto wheat\" brewed at the beach! \r\nOn a side note, Brian, thanks again for the pump! It\'s awesome! Saved my back!\r\n :cheers:');
