INSERT INTO `phpbb_posts_text` VALUES (4525,'cccd635865','Pint And Cigar Night','OK, let\'s get this thing off the ground. Ideally, as we said at the meeting, we\'ll eventually procure a venue for this event.  However, the first one will be at my house.  \r\nI want to do a Friday night, probably in March.  With the rest of the scheduling of events, what Friday in March would work the best for the most people? That\'s the 7th, 14th, 21st, or 28th.  I\'m leaning towards the 14th myself, let me know if I\'m missing an event in my calendar... but who could make that if we had it?  Tentatively, the cost will be around $15 or $20 per person, which will include four beers and two cigars.  We\'ll have a potluck style for food. Thoughts?');
INSERT INTO `phpbb_posts_text` VALUES (4524,'8dd30cf08f','','Sooo... I looked at these and they don\'t seem to be any more inclusive than the old guidelines.  Did they actually update the guidelines? Or do they just call them the 2008 guidelines because it\'s now 2008?  I love BJCP and want to get certified... but the guidelines are woefully inadequate and outdated IMO, missing tons of great styles that have many commercial examples.');
INSERT INTO `phpbb_posts_text` VALUES (4523,'233031b5d7','','I have 1 available to the highest \"beer\"dder, LOL!! :drink:\r\nI can get it to you by friday Carl, let me know where to meet 4 lunch.');
INSERT INTO `phpbb_posts_text` VALUES (4521,'1a3719c1b7','sankey','I need it by this Friday morning.\r\nIs there somewhere local to buy one?');
INSERT INTO `phpbb_posts_text` VALUES (4522,'eae37da98e','','Tina and I looked and made a few phone calls with no success. We never called a restaurant supply store so that may be an option. None of the gas suppliers had a clue what I was talking about. Do you have any friends in the restaurant business? You might convince a local watering hole to loan you one if all else fails.');
INSERT INTO `phpbb_posts_text` VALUES (4137,'1936a5a262','','[quote:1936a5a262=\"BradPetit\"]Heretofore left unasked is the (I believe) pertinent question of:\r\n\r\nWhy in the name of holy hell should it be illegal for a private citizen to send beer to a private recipient via private carrier? \r\n\r\nSeriously, the government seems to love to come down on alcohol \"just because.\" Half the time, there appears to be no proper justification for it.\r\n\r\nOn a side note, I recently shipped some beer to a friend by way of the UPS Store ... Without even thinking I included his nickname \"Beeriac\" on the address label. As soon as I got to the counter at the store I knew this was stupid of me. But they never asked any questions.[/quote:1936a5a262]\r\n\r\nBrad, never question the wisdom of Big Brother. He knows what\'s best for you. If \"The Man\" deems it inappropriate to send alcohol then we must trust in the Man.  A tidbit from 1984 is in order to get you back in line:\r\n\" In a way, the world-view of the Party imposed itself most successfully on people incapable of understanding it. \"');
