INSERT INTO `phpbb_posts_text` VALUES (4141,'daa71590a1','introduction','Just wanted to say Hi, I\'m a grad student at Clemson and am really getting into brewing. Found the site and am looking forward to gaining some knowledge and maybe entering the competitions if I have something suitable.');
INSERT INTO `phpbb_posts_text` VALUES (4142,'67fd61e412','','Welcome Richard! Our competition the [url=http://www.palmettostatebrewers.com/psbopen/]PSB Open[/url] was a few weeks ago. We have the final competition in the [url=http://hbd.org/cboy/index.html]CBoY[/url] circuit. We will start the \'08 comps in March. How long have you been brewing? Once again, welcome.\r\n\r\nCheers, \r\nRay');
INSERT INTO `phpbb_posts_text` VALUES (4143,'703a927fda','Allagash','Holidaze are crazy!  Family, cooking, travel, etc.  No time for me until the new year.  \r\n\r\nIf the Allagash lasts until 08, Im in.\r\n\r\nMerry Christmas to all!');
INSERT INTO `phpbb_posts_text` VALUES (4144,'5c246f1dc5','','Thanks, I was looking ahead to the coming comp\'s. In particular the extract one since thats really all I know how to do right now I imagine the others might have some guidelines against that. I\'m starting my second batch next week, but I have two more I\'m working out the details of. I just need another carboy and some more bottles.');
