INSERT INTO `phpbb_posts_text` VALUES (4156,'3dacac213e','Hoppy Brewdayz and to a New Year','In celebration of a wonderful year of brewing in 2k7, JR decided to squeeze one more brew session in. We turned out 15 gallons of malty goodness.  (10gallons of IPA and 5gallons of Sweet Southern Blonde)\r\n\r\nWe couldn\'t decide which choice of meat was right  for the occasion so we smoked a couple racks of ribs, a brisket, and some pork chops to satisfy a long day of brewing.\r\n\r\nHappy New Year and brewing in 2008\r\n\r\nCheerz!\r\n\r\n[b:3dacac213e]Here\'s to the Hop Shortage of 2007?[/b:3dacac213e]\r\n\r\n[img:3dacac213e]http://www.jrbrewing.com/jamie/Hop%20Shortage.jpg[/img:3dacac213e]\r\n\r\n[b:3dacac213e]Pork.... the other white meat[/b:3dacac213e]\r\n\r\n[img:3dacac213e]http://www.jrbrewing.com/jamie/Smoker.jpg[/img:3dacac213e]');
