INSERT INTO `phpbb_posts_text` VALUES (4160,'c9aba32100','Primary Fermenters','Right now I am using a plastic bucket for primary, but I have two 5 gal secondary fermenters (better bottles).  Has anyone ever used a 5 gal primary fermenter with a big blow off?\r\n\r\nI know it can be done, I\'m just curious what ya\'ll think and what effect \"blowing off\" most of the foam will have vs letting it settle back into the beer.\r\n\r\nThanks,\r\n\r\nRyan');
INSERT INTO `phpbb_posts_text` VALUES (4161,'ce7b6008f3','','Normally an active fermentation will result in a lot of krausen that will blow out. I ferment in 6.5 gallon carboys and used to rack in 5gallon cboys. (now i rack into kegs) \r\n\r\nIMHO, I would ferment either in the bucket or buy a 6.5 cboy and rack to your better bottles or invest in a 6 gallon better bottle.');
INSERT INTO `phpbb_posts_text` VALUES (4162,'197b5ad7e7','','When I first started brewing, I only had 5 gallon carboys, so that is what I used for primary (what is this secondary you speak of?).  Using a large blow-off tube and a pitcher full of water I never had any troubles.  It\'ll blow off a good bit of nastiness, just refresh the water/sanitizing solution in the pitcher every so often and you should be fine.\r\n\r\nHeck, I think some of my best beers were my first ones that came out of that 5-gallon primary.');
INSERT INTO `phpbb_posts_text` VALUES (4163,'ae8e1c2e21','','Looks like a great way to end the year. In the middle of an extreme drought and watern restrictions here. Takes 35 gallons of water to chill 5 gals of beer so I can\'t bring myself to brew. May have to come down to thew state capital and brew some.\r\n\r\nBeen smokin tho:\r\n\r\nBierschinken and Csabai\r\n[img:ae8e1c2e21]http://img.villagephotos.com/p/2004-12/915445/BGLUP-P1010793.JPG[/img:ae8e1c2e21]\r\n\r\nMontreal Smoked Beef\r\n\r\n[img:ae8e1c2e21]http://img.villagephotos.com/p/2004-12/915445/AJYQV-P1010732.JPG[/img:ae8e1c2e21]\r\n\r\nRing Bologna and Hot Dogs\r\n\r\n[img:ae8e1c2e21]http://img.villagephotos.com/p/2004-12/915445/UIBJV-P1010795.JPG[/img:ae8e1c2e21]');
