INSERT INTO `phpbb_posts_text` VALUES (4166,'c88762dff7','','I have heard a lot of good things about [url=http://morebeer.com/view_product/15464/]Foam Control[/url] but have never used it. Since your fermenter is limited on size you don\'t want to waste any beer. \r\n\r\nBrendon, the secondary is for clearing the beer. If you can cold condition the beer it will help the sediment fall out of suspension.');
