INSERT INTO `phpbb_posts_text` VALUES (4175,'fb054c9a29','2008 Brew Session locations &amp; signup','Alright folks, a new thread for a new year!  Everything is same as before, and last year\'s disclaimer still applies!\r\n\r\nThe below list is a tentative sign up for hosting the monthly PSB brew sessions. As always, unless otherwise noted, it will take place on the last Saturday of the month. Many legendary tales of disaster and debauchery have sprung from these brew sessions, not to mention some real good food and beer! They\'re a great place to learn if you\'re new to brewing, and there are always plenty of helping hands to get your brew off the ground. If you feel like hosting, PM me and I\'ll edit this post to reflect your addition.  The dates listed below are the last Saturday, if the date changes we will let everyone know.\r\n\r\nHosting an event generally means it will take place at your home, unless you have an alternate venue. The dates below are not set in stone, but merely guidelines for planning. All it takes is a willingness to open your doors and learn! (And to clean up after the guests leave.)\r\n\r\nJanuary 26th: Jim Griggers\r\nMarch 1st: Joseph Ackerman\r\nMarch 29th: Bet-Mar\r\nApril 17th: Phil Osczepinski\r\nMay 31st:\r\nJune 28th: Brian Moseley (Beach Brew 2008)\r\nJuly 26th: Robin Dial\r\nAugust 30th:\r\nSeptember 27th:\r\nOctober 25th:\r\nNovember 29th:\r\nDecember 27th:');
