INSERT INTO `phpbb_posts_text` VALUES (4853,'7af820f94d','Re: Invite to party on the 22nd','Here is the message Madonna sent out-  so I was wrong- it is a 80\'s theme and NOT a St. Paddy\'s theme\r\n\r\n[quote:7af820f94d=\"Madonna\"]I am having a get together at my house on Saturday March 22nd (7:30-ish?) and all the SCENT chicks are invited. This was originally planned to celebrate birthdays for the March birthday girls Mandy and Steph, and my St.Pattys Day birthday, but has morphed into just a party to unwind and hang out for some of our friends as wellwe all deserve a drink (or 5), dont you think?\r\n[/quote:7af820f94d]\r\n\r\nSCENT being South Carolina Ears, Nose and Throat and does in no way imply their bathing habits.  The Doc\'s are all male (except Madonna) and everyone else in the office is female- thats why it is just written to the chicks... (hint hint Brendon and other single homebrewers- of course they all could be old and married or something- I dunno)\r\n\r\n \r\n[quote:7af820f94d=\"Madonna\"]\r\nThere is an 80s themeso wear your big hair and as much spandex, neon, bangle bracelets, and acid washed denim as you canor dress like your favorite 80s icon (yes, this includes Smurfette and Cyndi Lauper)this is not required, but sure makes pictures a lot funnier! \r\n[/quote:7af820f94d]\r\n\r\nIf only I where able to forget the 80\'s...   I wonder where my parachute pants are. \r\n\r\n\r\n[quote:7af820f94d=\"Madonna\"]\r\nIt will be BYOB, just let me know what mixers you want. Bring your significant other, friends, etcthe more the merrier, but adults only please. I just need a rough head count before then (to have Chris bribe the neighbors if needed), so let me know if you will be able to make it. I will send another email out with directions to my house next week for those who want to come.\r\n[/quote:7af820f94d]\r\n\r\nI still don\'t think Madonna has noticed the 30 gallons of beer on tap and 15 more on deck.  So feel free to just come as you are and help me kill the keg of Stout that I brewed JUST for this St. Paddy\'s party...  Of course if anyone wants a mixer just let me know!  \r\n\r\nI guess a rough head count would be nice too!   :cheers:');
