INSERT INTO `phpbb_privmsgs_text` VALUES (4481,'fa0fcc89fd','[quote:fa0fcc89fd=\"chriswillis\"]I just got mine and they where good for some laughs-   :D \r\n\r\nI submitted some beers that where WAY past their prime and 2 that need another 6-12 months to balance out. \r\n\r\n\r\n\r\nDon\'t worry-   I am in no way upset or pissed-   I\'m sitting here laughing my ass off actually....\r\n\r\nOne of the funniest scores I got was a IIPA that I brewed in July-   120IBU dry hopped with another 2 oz of simcoe/warrior/amarillo-   you said it had low hop aroma and low bitterness and was more appropriate for a APA-  Man I wish I tasted the beer you tried came before it!\r\n\r\nThe other guy actually put that it needed more maltiness....   \r\n\r\nI didn\'t expect to win anything with this beer-   I actually expected to be told that it was too strong for style   :mrgreen:  :mrgreen:  :mrgreen:[/quote:fa0fcc89fd]\r\n\r\nheh I think I actually remember that one..  IIRC the carbonation was low on that one. \r\n\r\nHopefully I didn\'t say anything to out of whack. :mrgreen:  I think it ended up going to mini best of show, but, got dinged out by the two BJCP judges. \r\n\r\nyea.. all of them were mediocre.');
