INSERT INTO `phpbb_privmsgs_text` VALUES (796,'640c8e9965','Hi Tina,\r\n\r\nI heard about PSB through Mark Molchan and Bob Molchan.  I am good friends with Mark and his family.  I traveled with them to the Oktoberfest  in Charlotte and had a great time. That was my 1st time there and briefly met some of the people at PSB\'s booth. I have never made beer, but I enjoy hearing Mark talk about the fun all of you have with your get togethers and I like tasting the different beers Mark makes and shares. He educates me on the different beers. \r\n\r\nIf I should not have signed up to look at your web site, please let me know.  It was curiosity. I wanted to see what Mark talks about. You have a really nice looking website and some cool photos on you beermaking get togethers.  It looks like you all have a great time.\r\n\r\nTake Care,\r\nCathy');
