INSERT INTO `phpbb_privmsgs_text` VALUES (4626,'5ad2d60dd2','Here\'s my input:\r\n\r\nWe start off 2008 \"flying blind\" -- with no idea about this year\'s supply of hops (or grain, for that matter). Hopefully we will eventually encounter some optimism about these vital beer ingredients. In the meantime, this is your chance to demonstrate your creativity to continue to make great beers, even with limited resources.\r\n\r\nThe good news is that we can still get plenty of equipment, bottles, caps, yeast -- let us know if we can help out in any way.\r\n\r\nMARK YOUR CALENDAR for Big Brew Day 2008 on May 3rd.\r\n\r\nStill 10% off for paid-up PSB members.\r\n\r\nSupport your local homebrew store,\r\nSonja\r\nBet-Mar Liquid Hobby Shop');
