INSERT INTO `phpbb_privmsgs_text` VALUES (4890,'3d838c7695','Hi-   I\'ve heard a rumor you either are a welder or do some welding!  I\'ve been thinking of starting to build a beer structure and was looking for either someone who would let me use their gear or a reasonable shop to hire to do the welding!\r\n\r\nI think I\'m going to do a simple structure something like this-   \r\n\r\n[web]http://morebeer.com/images/thumb/phpThumb.php?src=/product_images/morebeer.com/1/6107.jpg&amp;w=250&amp;h=250&amp;far=C&amp;fltr[]=wmi|../../themes/morewinepro/images/thumbnail_watermark.png|C|15[/web]\r\n\r\nAlso,  one of the beer club members backed over my mailbox and I was looking for someone to weld it back together!  My neighbor did the same thing so he probably needs to hire someone too-   I\'ve been bugging my dad to come down but he doesn\'t have a portable welder he can bring.\r\n\r\nIf you had any suggestions I\'d love hear them!\r\n\r\nThanks!\r\nChris');
