INSERT INTO `phpbb_privmsgs_text` VALUES (3093,'da117a3228','(Carl, I tried to send this a few days ago but it may not have gone through to you.)\r\n\r\nMr. President, \r\n\r\nWe have not discussed in any detail our competiton other than setting a date. Its time to get to work. \r\n\r\nIn the past, I have treated the competition as a project of the club handled by an ad hoc committee tasked with the job of holding the competition. In other words, the competition was not handled by the standing officers of the club. As president, I appointed myself as Organizer and then as Organizer sought out and appointed others to handle specific tasks. Some of our new officers never quite understood this but that was the way I handled it for seven years. \r\n\r\nAt this point, I am still willing to continue as Organizer for another year, however, if someone has expressed an interest, I will be delighted to step aside. I am fairly busy these days with my law practice, teaching beer classes at USC, writing for FreeTimes, judging competitions and spending time with my new granddaughter (plus I am ready to start brewing again) but I am still interested in PSB Open and if I am interested, I can get the job done. This is especially true since Harold Dowda is still willing to serve as Registrar which is the most time consuming task. \r\n\r\nSo, the decision is yours. Appoint the Organizer or if you want to, appoint the Organizer and committee. \r\n\r\nSee you at Big Brew Day. \r\n\r\nCheers! \r\n\r\nGerald Jowers');
