INSERT INTO `phpbb_privmsgs_text` VALUES (4782,'926b92a6be','Jamie,\r\n\r\nI was reading your vanilla blond ale recipe and am slightly confused about the bean usage.  Are you chopping the outside portion of the vanilla?  If so are you actually scraping the inside of the bean to clean it?  Or are you actually using the tiny beans from the inside?  The tiny beans are where most of the flavor is I thought.   :roll:');
INSERT INTO `phpbb_privmsgs_text` VALUES (4534,'1e9d3810eb','&gt; Phil,\r\n&gt; I started steeping the grain and peels Friday the 14th. Do you think\r\n&gt; there\'s any chance it would be ready on the 22nd? I know you said 2 weeks\r\n&gt; but I was hoping to bring some to my family in Georgia. You know how alcohol\r\n&gt; often enhances family gatherings. I\'m amazed how yellow it\'s become. It\r\n&gt; looks like a highlighter. Also, do you prefer it with water or milk? I can\'t\r\n&gt; wait to try it and I\'ll wait the full two weeks if need be, just antsy! I\r\n&gt; used 10 lemons and 4 mandarin oranges. Funny how the peels harden up... Damn, I\'d forgotten how strong Everclear was also. It\'s literally like rubbing alcohol!');
INSERT INTO `phpbb_privmsgs_text` VALUES (3419,'46dec4fc2a','Hey Chris,\r\nHow did you get your magnets centered?  I did the old trial and error with a  piece of tape, then marked it.  Then I epoxied the best I could, it is a little wobbly, but if I secure the fan well, the wobble goes away.  Did you use only one of the crescent shaped magnet plates, or did you not use the plate?\r\n\r\nDid you build the lm317 circuit?  I know next to nothing about TTL so I will basically just follow instructions  that someone else did...\r\nhttp://www.homebrewtalk.com/showthread.php?t=8850&amp;page=3');
