INSERT INTO `phpbb_privmsgs_text` VALUES (3872,'7d711fd212','What do you use for your primary fermentation vessel?  I have a v-vessel but was thinking about doing multiple batches and possibly using a carboy since they\'re always nice to have around.  Check this out, I have a Samuel Smith Nut Brown clone in primary and in secondary I have an old ale, an Affligem Noel Christmas Ale, a British IPA (dry hopping) and two different one gallon meads.  I plan on doing a kolsch and a Stille Nacht this weekend.  At some point it will be a beerfest at my house!   :cheers:');
