INSERT INTO `phpbb_privmsgs_text` VALUES (4599,'c781c05cd7','Good question. I was thinking about the very same thing today. I\'m not a master by any means either, so, I was thinking I could possibly bring a laptop with it loaded and then see if I can get a projector. Once it\'s up, just show a simple \"here\'s ProMash\" demo and then simply open the floor to tips and tricks from any users in attendance, let them come up and take the mouse and show whatever.... The \"problem\" at the moment is:\r\n1) I don\'t have a projector. I\'ll ask IT if they have a cheapo floating around. I\'m not sure one way or another. \r\nAnother thought I had if the ProMash falls through is a hop identification/comparison. I\'ve started collecting baby food jars from a co-worker for this express purpose. (I\'m sure you\'ve seen the new commercially available hop kit?) At any rate, I was thinking that maybe 6 hops could be sent around the room with accompanying literature, smelled, tasted and discussed. Either way, I think both of the above warrant an educational segment in the very near future. I\'d like to proceed with the ProMash. Any thoughts?');
