INSERT INTO `phpbb_privmsgs_text` VALUES (2816,'e693ccc8b1','Brendon, Sorry your plans fell through! Glad on the other hand that you\'ll make it! We actually just finalized our plans and decided we\'d go. Looks like Pete will be there as well. I think we\'re gonna try to get there around 6. RJ Rockers is the brewer I believe. They\'re lackluster at best but I really want to support CW\'s. Even mediocre beer is better than no beer! \r\n :drink:');
