INSERT INTO `phpbb_privmsgs_text` VALUES (3223,'4d8ae14db2','Hey Chris,\r\nHow about at the meeting on Monday? Let me know how much I owe you so I\'ll have the correct change. Thanks.\r\n\r\nJim');
INSERT INTO `phpbb_privmsgs_text` VALUES (906,'3010f53596','Allen,\r\n\r\nThanks for your interest in the Aiken Brewing Co.\r\n\r\nAs far as the Menu listed on the home page, I have a narrow interest at the ABC that would be the beer.  To inquire about the menu I would recommend calling the pub and asking bout menu items and /or specials.\r\n\r\nAs for yeast, we typically dump about 8 gallons of yeast slurry each week.  We don\'t have a problem in you using some of the extra yeast for your home brewing hobby.  The issue would be in timing.  We typically harvest/dump yeast prior to transfers and/or prior to brewing.  The best time to get yeast would be on Fridays or on Sundays.  But if you are panning a trip let us know in advance and we may be able to work it out.  Our house yeast is White Labs WLP 001, American Ale.\r\n\r\nHope that this information is helpful!\r\n\r\nRandy');
INSERT INTO `phpbb_privmsgs_text` VALUES (2413,'cc331d5c52','EXCELLENT!!!\r\nI\'ll send directions and phone numbers to the two e-mail addresses.\r\nSee you Monday...BRING YOUR TOYS!\r\n\r\nCheers!\r\nCarl');
INSERT INTO `phpbb_privmsgs_text` VALUES (1366,'588ea268f0','Gerald,\r\n\r\nI was wondering if you still had that extra carboy laying around that you were willing to donate to my brewing cause.');
INSERT INTO `phpbb_privmsgs_text` VALUES (3046,'c588e04fb4','Hey Brian, I am a fellow PSBer recently moved back home to Mullins, SC.  We are not that far from each other, but I am in an area that has next to nothing of a sort for brewing supplies and CO2.  I was wondering if you had any suggestions for me as to where I may find some supplies and most importantly (at this point) CO2 because I am [u:c588e04fb4][b:c588e04fb4]OUT[/b:c588e04fb4][/u:c588e04fb4].  I have been getting my CO2 from National Welders in Florence, but they are unappealing to my schedule (no weekends) and I think they were shanking me on my CO2.  It seems that when I place my primary regulator on the tank it gets no higher than 500 psi and I am paying $20 for 15# CO2 that I am not getting.  I have heard of a place that might would fill me up or exchange somewhere near the beach, but just not sure if there was any truth to it.  If you could please let me know your ideas on my CO2 problem and as to where I may find some supplies in the area; I am just tired of paying shipping charges.  Thanks in advance.\r\n\r\n\r\nScott Hasty');
INSERT INTO `phpbb_privmsgs_text` VALUES (1032,'bfea3aaec2','well i know they\'re out there. homebrewing and craft brewing have hit all new levels in recent history. i don\'t think there\'s much use in trying to entice the older generation (god at 41 i never thought I\'d refer to my peers as old) into being excited about forum participation. i grew up with technology so it comes as a second nature way of communicating. \r\n\r\ni am pretty sure that there are more brewers in the upstate than those we know. i am working on a few ideas - they may not work but it\'s worth a shot. and i have been promoting the site every chance i get.');
INSERT INTO `phpbb_privmsgs_text` VALUES (3097,'da04348154','Sonja, \r\nAfter I recieved your email I went and checked and I am missing 1# of munich malt. My address is 3706 S.C. highway 64 Barnwell sc 29812 and p.o. box 1757 barnwell, sc 29812. IF I was going to be anywhere near Cola on Tues, I would come by and get them. it is no rush though, the recipe that uses the munich is about a week or so away. thanks for everything. I enjoyed today and I think my Father enjoyed it even more. clay');
