INSERT INTO `phpbb_privmsgs_text` VALUES (916,'616df088ca','I didn\'t have your email on here. If you don\'t mind updating on here.\r\n\r\nI understand you are coming to CW\'s taproom tonight. If so, can you please bring all the information you have on Pop the Cap SC. I would like to look at them. Also Thomas Creek will be there and he is interested as well.\r\n\r\nJamie');
