INSERT INTO `phpbb_privmsgs_text` VALUES (907,'00c581cc32','AWESOME!!!!  \r\nThanks for the generous offer.  My wife and I just had our first child, so our first date night out will be at least a few weeks away, but I plan to come to the Aiken Brewing Company when we do.  I am curious, do you bottle your beers for sale at the brewpub, or is it all on tap?  If there are bottles or growlers of your beer I will swing a trip to Aiken sooner than a \"date night.\"  I am really anxious to try the Red and Pale Ale.');
