INSERT INTO `phpbb_privmsgs_text` VALUES (4360,'6b3ae97c27','Hey Tina--\r\n\r\nJust wanted to double check the quantity for the Competition lunch. I don\'t think you need more than 1 brat per person but it\'s your call. I will probably bring the smoker and cook them there. Thinking about making smoked polish sausages.\r\n\r\nGary');
INSERT INTO `phpbb_privmsgs_text` VALUES (4822,'00caec0643','I do indeed have a plasma cutter. I believe I can cut the Stainless ones but not the aluminum ones. I think I\'m an average plasma cutter operator, as in, it would be super-duper pretty but it\'ll work fine. I think if I stick the nozzle next to the keg\'s rim I could probably do a decent round cut.\r\n\r\nLet me know when you\'d like to do this. Sat/Sun\'s are better for me, as I travel the rest of the time.\r\n\r\nJP');
INSERT INTO `phpbb_privmsgs_text` VALUES (4986,'4d6aadd024','Yikes!  $13 for the Hawthorne berry powder?  Well it is for a good cause.  Looks like I owe you a check for about $60 plus.  The cost is not too different than an extract beer or mead so Im used to it.\r\n\r\nIt is pretty tough for me to brew during a week unless I leave work early.  How about trying next Friday?  I can maybe plan to leave work about 1pm.\r\n\r\nI plan to be at your party on the 22nd.  What can I bring?');
INSERT INTO `phpbb_privmsgs_text` VALUES (4824,'9aac53971e','I will be at the brew session @ Joseph\'s in Columbia on March 1st, but maybe I could swing by your place on the 2nd.  (Sunday.) Have 3 stainless kegs I\'ve been sitting on for a year, would love to pay you with beer to lift those lids off!   :mrgreen:');
