INSERT INTO `phpbb_privmsgs_text` VALUES (1484,'f7f10b665f','[quote:f7f10b665f=\"Tina Cole\"]You can mail the check to me (but still make out the check to Palmetto State Brewers. $20.00\r\nWe didn\'t give away the shirts free. They are $8.00 but we do have all sizes.[/quote:f7f10b665f]\r\n\r\nTina,\r\n\r\nThanks for the quick response.  I\'ve written a check for $28 for the membership dues and a t-shirt.  I\'ll send it out with Friday\'s mail.\r\n\r\nI\'d like to get an XXL t-shirt.  (Are they natural color or white?  I prefer natural if you have it.)  I won\'t be up in Columbia until Saturday, July 29.  I could pick it up at Bet-Mar if you drop it off there and Mark and Sonya don\'t mind.  Let me know if that\'s OK.\r\n\r\nThanks,\r\nJonney\r\n\r\nThe check is in the mail.   :mrgreen:');
