INSERT INTO `phpbb_privmsgs_text` VALUES (4829,'e5dc922b5c','Sounds excellent, are you coming to the brewsession on Sat?  I\'ll be there most of the day, so let\'s shoot for Sunday if not.  What\'s your address?  Can probably make it by 2 or so, got to work till about 12:30.\r\n\r\nWhat sorta styles you like?  :)\r\n\r\ndan');
INSERT INTO `phpbb_privmsgs_text` VALUES (3862,'ced938d1cf','[quote:ced938d1cf=\"Dan Adams\"]Will do.  See you guys up there!\r\n\r\nI\'m going to bring a reg / Co2 tank for use with our sodas. They need to sit around ~30 psi, so I figured we could put them on at that and then crank it down when we run out and put someone else\'s on.\r\n\r\nd[/quote:ced938d1cf]\r\n\r\nSounds good.. Chris Willis is bringing a 4way splitter and picnic taps.. so we should be good. \r\n\r\nAs requested by CBM, they would like us to spread out the servings so that the club can make the beers last all day.. so i figure we will serve 4-6beers at a time. I\'ll prolly bring a dry erase board and we can write what\'s on tap.');
INSERT INTO `phpbb_privmsgs_text` VALUES (3741,'070bb63905','Jim;\r\n     That is a sweet setup. Love the motor/coupler setup! Did it come yellow?\r\n\r\nHere is mine:\r\nhttp://img.photobucket.com/albums/v83/tprofera/102_0204.jpg\r\nhttp://img.photobucket.com/albums/v83/tprofera/102_0206.jpg\r\nhttp://img.photobucket.com/albums/v83/tprofera/102_0201.jpg\r\n\r\nCheers\r\nTony');
INSERT INTO `phpbb_privmsgs_text` VALUES (4650,'ea268df637','Hope things get better. Sorry you\'re dealing with all that. Rough. Just let me know what works and we\'ll work something out. I do think the boat belongs in SC!');
INSERT INTO `phpbb_privmsgs_text` VALUES (3507,'aea7e9b4aa','Chris,\r\n\r\nMy next column that will be in the August 8 issue is a prepatory one to a series that I plan to do from time to time  on pairing food and beer.   Do you think the club would be interested in a presentation on pairing beer and food?  There is a, of course, overlap between this subject and judging because analyzing the flavors in the beer is a first step to good pairing as well as good judging.\r\n\r\nWhat do you think?\r\n\r\nGerald');
