INSERT INTO `phpbb_privmsgs_text` VALUES (1514,'045e71be63','Dave-\r\n Yes, I responded to the address it originated from. usc_cop I believe?? Anyway, we bought the converted keg. Tried to make one but it is extremely difficult to cut. It can be done but I lacked the proper grinding wheels etc... If I were you, I\'d check morebeer.com. They have free shipping on most items over $60.00. Another good resource is Sabco. They specialize in converted kegs (Keggle\'s) Might be a good idea to post on this site as well. Someone might have one for sale or know how to obtain one cheaper. In our case Jamie knew a guy that could do it for a reasonable price. I hope this answers your question... responding from memory. Sorry the first response got lost in cyber-world!\r\nTalk to you later\r\nChris');
INSERT INTO `phpbb_privmsgs_text` VALUES (2642,'36adeae1dc','Hi Tina, Good to hear from you. The june brewsession is solid. We are looking forward to it. I think camping is a great Idea. We go to huntington a couple times a year and love it.  So yes , \"The brew at the Beach\" is a go.');
INSERT INTO `phpbb_privmsgs_text` VALUES (3799,'e91ea52f17',':cry: Bummer about the phone!  I have regular bottles I can give you.  I selfishly keep the swing tops for me.  I remember how you wanted the bottles they were auctioning off at the club meeting.  Chris tells me you keg and only needed the bottles for the wedding.  It\'s cool if you no longer need them.  The trash man will be happy to cart them away. Just lemmeno.  When do you think you might brew?  I\'m thinking about doing a brown ale Saturday morning.  Give a call if you\'re interested in coming over.\r\n\r\nhome 865-7251\r\ncell 803-480-9221\r\nwork 740-7930');
INSERT INTO `phpbb_privmsgs_text` VALUES (4653,'f6411a31f6','[quote:f6411a31f6=\"Gerald Jowers\"]Ray,\r\n\r\nI have been trying for several years to get the CBOY website upgraded in order to enhance the prestige of the competition circuit.  I am thinking about more pictures and information about competitions as well as archives of winners, etc.\r\n\r\nI would like to approach CBM about getting the website from them.   Gary  Caffey is handling the site now and he is not putting much effort into it.\r\n\r\nWould you be willing to take over the site management?\r\n\r\nAdvise, please.\r\n\r\nGerald Jowers[/quote:f6411a31f6]\r\n\r\nI agree that it hasn\'t been kept up that well. Unfortunately for me at the moment I can\'t take on another site. I keep 4 sites up now in my spare time for free. You might want to post a message in the events section to see if anyone else would be interested in doing the site. I don\'t know what Joseph Ackerman can do. He has the programs to do the website stuff but I haven\'t seen anything yet from him. He will be doing the newsletters starting next month. \r\nThere is a hosting issue too. Not sure who CBM has hosting, how it\'s paid, etc. It may be linked with the CBM site and Charlotte Oktobefest. \r\n\r\nRay');
