INSERT INTO `phpbb_privmsgs_text` VALUES (4706,'cf2f23a07f','Heck Yes!  were down for june if its still open. I have a couple new brewers I have been working with and they\'ll be here too. We had a great brew session yesterday and I invited both to join PSB. We discussed coming up to columbia soon also.  Looking forward to seeing ya\'ll again.Prost');
