INSERT INTO `phpbb_privmsgs_text` VALUES (3250,'3d0add96bf','Chris:\r\nThe following was sent out via e-mail to all club members.  I must not have your address correct since the e-mail was returned.\r\nHope you are well.\r\nCheers!\r\nCarl\r\n\r\nDear Fellow PSB Member:\r\nMany of the club members would like the club to move the monthly meeting place to CWs Taproom on Bower Pkwy in the Harbison area of Columbia. Since many of our members are passionate about their preference, I am asking for an advisory vote from all club members.  Please go on-line to the PSB Forum at PalmettoStateBrweers.com and log your preference.  A new thread was set up last night and if you selected a preference with the old poll, you will need to vote again on this new thread.  The forum will allow only one vote per club member and will be open for seven days.\r\nIf you have not signed up for the Forum, then you will need to do so.\r\n\r\nThank you for your input and be sure to BREW ON!\r\nGO PSB!\r\n\r\nCarl Foster/President');
