INSERT INTO `phpbb_privmsgs_text` VALUES (3910,'19ab14e22a','Hey Mark, \r\nI\'m glad you liked it! \r\n\r\nHere\'s the recipe for 10 Gallons:\r\n\r\nDead End Brewery\r\nTread Gingerly Ginger Ale\r\n5 pounds fresh ginger washed and VERY finely diced (&lt;1mm) without removing skin\r\n10 lemons in 6mm slices\r\n10 cups plain white sugar\r\n10 cups demara sugar (can find at Wal-Mart under Florida Crystals Brand)\r\n\r\nUse a full boil, add ingredients as the water is heating about 20 minutes before boil begins, stirring to keep ginger suspended. Boil for 70-90 minutes or to taste. Add to taste an additional bit (.5-1.5 cups) of sugar for sweeter ginger ale, omit for more dry ginger ale. Cool and rack to bleached (bleach or anything that will kill all yeast, not star-san) carboys and let settle for about 24 hours. Rack to kegs and carbonate to 3.3 volumes.\r\n\r\nOf course if you have any questions please ask. \r\n\r\nAny if I may ask, could I trouble you for the recipe for that Bourbon Barrel magic? It was amazing!!');
