INSERT INTO `phpbb_privmsgs_text` VALUES (3420,'24b4209941','Phil,\r\n Your wobble sounds exactly like mine. Once the fan is secured it goes away. I used 1 crescent shape magnet. It looks much larger than the 2 in the picture. As far as wiring, it was basically trial and error and a friend with far more electrical knowledge than I. It  consisted of 2 potentiometers in relay and an on/off switch. One is inside the box and the other pokes through for speed control. I\'m sorry but the wiring diagram referred to is Greek to me! If you want to look at the innards of mine I\'ll gladly pop it open.\r\nHeading to Hunter Gatherer this Saturday to meet the MALT club? If so, let me know and I\'ll bring mine.\r\nChris');
