INSERT INTO `phpbb_privmsgs_text` VALUES (3739,'2059d7f20a','Actually, I was speaking of the output chute on the mill. I built a box that sits on top of the mill, so I can load it up with about 12 or so pounds of grain. The output falls into a tub that originally held cat liter. It is almost cubical, and only holds about 12 pounds crushed grain. The problem is the grain piles up under the chute, and if I\'m not there to shake the grain down, it will back up the chute and I have a mess. I\'ll see if I can put some links in to some pictures I took a few years ago.\r\n[url=http://www.jimgriggers.com/pictures/P0006715.JPG]Glatt mill[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006717.JPG]Glatt mill[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006719.JPG]Glatt mill[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006729.JPG]Glatt mill[/url]\r\n[url=http://www.jimgriggers.com/pictures/P0006730.JPG]Glatt mill[/url]\r\nWhat I want to do is to cut an arc out of the base board, and put legs to raise the base up. That way I could fit a 6 gallon plastic bucket under the chute.\r\nJim');
