INSERT INTO `phpbb_privmsgs_text` VALUES (5078,'1016d19c12','Hi Mark,\r\nSorry I never got back to you. I learned about this from Pete and Ray; Pete learend about it from Dan Derrick. I tried to look up some info but didn\'t find what I was looking for. My understanding is that lower specific gravity of the pot liqour = higher aa extraction- but there is a limit to tasty extraction. If you boil the hop in low SG liquor too long you get nastiness. I do not go past 25 minutes before adding extract, as instructed, but this is not to say that is the threshold. Sorry I am not much help. I suggest asking Ray, Pete or Dan D.\r\n\r\n :cheers: \r\nKatherine');
