INSERT INTO `phpbb_privmsgs_text` VALUES (4413,'77ae0c8760','This is definitely my style of beer.  I love the corriander and orange peel combo in beers.  I used slightly more corrinader in my Corsendonk clone than what was called for.  While you can tell it\'s different than the original it is great.\r\n\r\nI was reviewing Joel\'s braggot recipe.  It is very easy.  ALL extract, no grains.  15 minute boil.  It\'s about 2.5-3 gallons though.  I might want to double the recipe to get a full 5 gallons.  This could be brewed in under 1 hour including clean up.  If my IPA ingredients aren\'t here by tomorrow I might consider this for a quick Sunday brew.');
