INSERT INTO `phpbb_privmsgs_text` VALUES (3736,'b9435e48a6','Didn\'t get a chance to speak to you at the meeting, but WAY TO GO!!!\r\nI knew that English Ale of yours was something special  :drink: \r\n\r\nMy TRPA clone (well, sort of...) scored 37 and an Honorable Mention, which I consider a pyrrhic victory, considering it was up against 26 others in the division...hey, I beat about 22 others out.  As you say, it is a numbers game, I have a few more bottles of it left, and I will enter it in the PSBO.  Gerald was one of my judges, and he gave it a 38, or an \"Excellent\".  The other beer I made scored 21, and garnered a couple of \"flawed\" checks...about what I expected, I just wonder if that hurt my overall score??\r\n\r\nI brewed an Oktoberfest (bet-mar kit) on Sunday, I guess I will bottle some of that for possible future competitions as well...maybe I will bottle it all since I would rather have a more \"popular\" offering on tap for the party...maybe an APA or something.');
