INSERT INTO `phpbb_privmsgs_text` VALUES (4198,'92cd8e0d7a','Pete,\r\nHere\'s my input (which includes what I had in Oct minus State Fair stuff):\r\n\r\nHops, hops, hops. Y\'all know as much as we do about the \"panic buying\" that precipitated this year\'s shortage. Supply &amp; demand dictates the results.  On our end, we\'re being forced to commit to \'08 purchases without knowing our cost!  We\'ll get what hops we can &amp; let the chips fall where they may.\r\n\r\nLooking forward to our brewsession on Saturday, Nov 17th. Stop by for a brew!\r\n\r\nWere stocked up &amp; ready for mead &amp; beer-makers, and taking any special-order requests.\r\n\r\nSupport your local homebrew store,\r\nSonja &amp; Mark\r\nBet-Mar Liquid Hobby Shop');
INSERT INTO `phpbb_privmsgs_text` VALUES (5058,'f6067edcdb','well...\r\n\r\nWhat he is saying first is test your flow rate.  What he says is turn your grill on high and stand by the meter and see how long for 1CF.  Being that I was told that we can run multiple appliances off of one meter I don\'t know this is totally true though.  I\'m running probably close to 200BTU with my furnaces and I\'m told I can run a stove, hot water and even a fireplace at the same time.  This would probably be almost 500,000BTU....\r\n\r\nI just called SCE&amp;G,  thats the easy way right?\r\n\r\n:)');
