INSERT INTO `phpbb_privmsgs_text` VALUES (3828,'c71f621989','I will have to check. Just remember you get what you pay for, often in food there is a reason it is so cheap. Find out if the detail on them (i.e. all meat and pure beef/pork mean different things; also there may be a filler). If they are 3# each that means you will have to cut them to size and that brings in a new food safety handling issue ad this is deadly serious. Bottom line: Do you want to take a chance on serving less than 1st quality meat at the club\'s premier event? Don\'t be penny wise and pound foolish.\r\n\r\nKS');
