INSERT INTO `phpbb_privmsgs_text` VALUES (3103,'45bf87a3ae','um...   I sorta kinda messed up the recipe-\r\n\r\nit is supposed to be SG 1.077 w/~ 31 IBU\r\n\r\nMy recipe works out to be SG 1.099 and 34 IBU-   And my observed SG seems to be about right-   just a little lower- 1.095 (I probably only got about a 50% conversion rate of the partcial mash)\r\n\r\n\r\n\r\nBig Brew Day \r\nMay 7, 2007  \r\n \r\n\r\nRecipe Type Partial Mash \r\nBatch Size 5 gal. \r\nVolume Boiled 2.5 gal. \r\nMash Efficiency 50 % \r\nTotal Grain/Extract 12.80 lbs. \r\nTotal Hops 3.3 oz. \r\nCalories (12 fl. oz.) 397.8 \r\nCost to Brew $37.00 (USD) \r\nCost per Bottle (12 fl. oz.) $0.76 (USD) \r\n \r\n 3 lbs. Belgian Pils\r\n .5 lbs. Belgian Cara-Pils \r\n 3.0 oz Belgian Aromatic \r\n 5 lbs. Briess Pilsen dry Extract \r\n 2 lbs. Briess Dry Wheat Extract \r\n 1 lbs. Candi Sugar Dark \r\n 1.1 lbs. Jaggery Sugar \r\n 2.25 oz. East Kent Goldings (Pellets, 4.75 %AA) boiled 70 min \r\n 1 oz. Czech Saaz (Pellets, 3.5 %AA) Flameout \r\n Yeast :  White Labs WLP570 Belgian Golden Ale \r\n             White Labs WLP500 Trappist Ale \r\n  \r\nOriginal Gravity 1.095\r\nTerminal Gravity 1.020\r\nColor 22.92 SRM \r\nBitterness 34.6 IBU\r\nAlcohol (%volume) 10.1 %\r\n\r\n\r\nObserved OG- 1.095');
