INSERT INTO `phpbb_privmsgs_text` VALUES (4853,'92f653f5bc','I brewed a midas touch yesterday and was looking at the muscat juice and realized I only need 2 of the 4 pounds for it.  I looked around for something to use up the rest and I came across the following recepe.  I\'ve got enough malt, muscat juice, and hops to do this.  If you wanted to brew this together sometime in the next little while we could split a 10 gallon batch?\r\n\r\n\r\n\r\nChateau Jiahu clone\r\n \r\n \r\nChateau Jiahu clone\r\n(5 gallons/19 L, all-grain)\r\nOG = 1.088 FG = 1.014\r\nABV = 10%\r\n\r\nIngredients:\r\n11 lb. 6 oz. (5.2 kg) two-row pale malt\r\n3.0 lbs. (1.4 kg) orange blossom\r\nhoney\r\n2.0 lbs. (0.91 kg) rice syrup\r\n1.0 lb. (0.45 kg) Alexanders Muscat\r\ngrape juice concentrate\r\n0.5 lbs. (0.23 kg) Hawthorn berry\r\npowder\r\n0.25 oz. (7.1 g) Simcoe hops (60 mins)\r\nWyeast 4134 (Sake #9) yeast\r\n\r\nStep by Step\r\nThe day before brewday, prepare a 1 qt. (~1 L) yeast starter. Mash with 3.5 gallons (13 L) of water to achieve a temperature of 149 F (65 C). Rest for 30 minutes. During the rest, heat 4.5 gallons (17 L) of water to 170 F (77 C) for sparging. After the 30 minute rest, vorlauf until wort of acceptable clarity is obtained. Begin collecting wort in the brew kettle. Sparge as normal. Collect 6.25 gallons (24 L) of wort. Once the kettle is full, add rice syrup. Boil 15 minutes. Add Simcoe hops. Boil for 60 minutes. Turn off heat and stir in honey and hawthorn berry powder. Stir to create a whirlpool. Chill, aerate and pitch sake yeast starter. As fermentation starts to subside, add Muscat grape juice concentrate. Cool the beer after 1214 days. Cold condition for 21 days. Keg or bottle as normal. Allow whatever time you deem necessary for proper conditioning and enjoy!');
