INSERT INTO `phpbb_privmsgs_text` VALUES (3913,'a1c4466fe7','Thanks. One question though. Why do you say not to use Star San in the carboys? \r\n\r\nHere is the recipe for the BB RIS. Once you add the oak cubes you\'ll want to taste it every 4 or 5 days until you get to the level of oak you like. Horizon hops are getting hard to find with the current hop shortage so I would use something like Magnum to get he same IBU\'s and clean bittering. I don\'t use WLP001 or 1056 anymore either, 2 fresh packs of US-05 will be fine.\r\n\r\nRIS\r\n\r\nA ProMash Recipe Report\r\n\r\nRecipe Specifics\r\n----------------\r\n\r\nBatch Size (Gal):         6.00    Wort Size (Gal):    6.00\r\nTotal Grain (Lbs):       23.75\r\nAnticipated OG:          1.097    Plato:             23.13\r\nAnticipated SRM:          59.7\r\nAnticipated IBU:         108.8\r\nBrewhouse Efficiency:       68 %\r\nWort Boil Time:             90    Minutes\r\n\r\nPre-Boil Amounts\r\n----------------\r\n\r\nEvaporation Rate:      15.00    Percent Per Hour\r\nPre-Boil Wort Size:    7.74    Gal\r\nPre-Boil Gravity:      1.075    SG          18.26  Plato\r\n\r\n\r\nGrain/Extract/Sugar\r\n\r\n   %     Amount     Name                          Origin        Potential SRM\r\n-----------------------------------------------------------------------------\r\n 75.8    18.00 lbs. Maris Otter                   England        1.037      2\r\n  6.3     1.50 lbs. Roasted Barley                Morebeer       1.031    510\r\n  4.2     1.00 lbs. Munich Malt                   Best Malz      1.038      7\r\n  3.2     0.75 lbs. Flaked Barley                 America        1.032      2\r\n  2.1     0.50 lbs. CaraMunich Malt               Belgium        1.033     75\r\n  2.1     0.50 lbs. Chocolate Malt                Great Britain  1.034    475\r\n  2.1     0.50 lbs. Chocolate Malt (Pale)         Great Britain  1.034    225\r\n  2.1     0.50 lbs. Crystal 75L                   Great Britian  1.034     75\r\n  2.1     0.50 lbs. Special B Malt                Belgian        1.030    120\r\n\r\nPotential represented as SG per pound per gallon.\r\n\r\n\r\nHops\r\n\r\n   Amount     Name                              Form    Alpha  IBU  Boil Time\r\n-----------------------------------------------------------------------------\r\n  3.00 oz.    Horizon                           Pellet  10.00  99.6  55 min.\r\n  1.50 oz.    Goldings - E.K.                   Pellet   5.00   5.0  10 min.\r\n  1.50 oz.    Goldings - E.K.                   Pellet   5.00   4.2  1 min.\r\n\r\n\r\nYeast\r\n-----\r\n\r\nWhite Labs WLP001 California Ale\r\n\r\n\r\nMash Schedule\r\n-------------\r\n\r\nMash Type: Single Step\r\n\r\nGrain Lbs:   23.75\r\nWater Qts:   30.71 - Before Additional Infusions\r\nWater Gal:    7.68 - Before Additional Infusions\r\n\r\nQts Water Per Lbs Grain: 1.29 - Before Additional Infusions\r\n\r\nSaccharification Rest Temp : 152  Time:  90\r\nMash-out Rest Temp :         168  Time:  10\r\nSparge Temp :                175  Time:  45\r\n\r\n\r\nTotal Mash Volume Gal: 9.58 - Dough-In Infusion Only\r\n\r\nAll temperature measurements are degrees Fahrenheit.\r\n\r\n\r\n\r\nNotes\r\n-----\r\n\r\n3oz medium toast oak cubes previously soaked in bourbon for 1 month added    \r\nto secondary. I cup of bourbon added to keg.');
