INSERT INTO `phpbb_privmsgs_text` VALUES (3139,'153f36e448','Chris,\r\nThat vinometer you just bought -- I wanted to let you know that (as the name suggests) it\'s best used for wine or mead, which ferment out to dryness (S.G. = 1.000).\r\n\r\nIf you use it on flat beer, I\'d suggest a slight correction if the beer is 1.010 or more. The vinometer may overshoot the actual % alcohol by a couple percent.\r\n\r\nThanks &amp; have a fun grillin\' tomorrow,\r\nSonja\r\nBet-Mar Liquid Hobby Shop\r\n798-2033');
