INSERT INTO `phpbb_privmsgs_text` VALUES (3166,'3a1e81ccd5','Sorry about the tank not working out. I wonder how it got \"horribly pitted\" if it only had CO2 in it. Who knows. Did he get the tank back or leave it with them? I\'m sure if it was left there, they will \"tumble\" it and resell it. Maybe I\'ll take my tank to National Welding or Palmetto Welding and see if they will swap out the tank. Caraway has gone up since I bought my used tank from them (their prices are always a crap shoot). I think I paid $35 for a full 20# tank. A brand new 20# tank (not filled) is around $110.\r\n\r\nI was wondering how you went through so much beer in a day. A party is a good excuse.  :drink:');
