INSERT INTO `phpbb_privmsgs_text` VALUES (5042,'00dd199188','Did the Tornado hit yall?\r\n\r\nI was stuck at Publix listening to it and watching the golf balls bounce off the car.  We lost a couple shingles and my pretty yard is trashed.   I had just totally finished with cleaning the pool and the yard soon after I saw ya....    its going to take me 15 hours to clean up this mess.   I don\'t feel bad though,  I think I\'m about the only one who didn\'t have a tree down- and all the houses 4 houses up (for the block) lost most/all the trees and their roofs are totaled.\r\n\r\nDid it hit Lake Carolina after here?');
INSERT INTO `phpbb_privmsgs_text` VALUES (4718,'11d0f66e9f','Good to hear.  I brewed a batch and clearly did something wrong.  It tastes fine, a little dark because I got lazy, didn\'t weigh the dark grains and just mashed in what I had, but it is essentially crawling down the gravity scale.  Mostly it\'s stuck at about 50% attenuation.  Repitched with safeale #5 yeast even.  I\'m not giving up on it though.  I will be very interested in tasting your version.');
