INSERT INTO `phpbb_privmsgs_text` VALUES (3188,'af38397681','Hey Jim,\r\nI now have the fridge in my garage  :P \r\nJust from eyeballing it, I think the 3 inch shanks are going to be too short.  It looks like I have about 3 in of door/plastic although I have not made any holes or anything yet.  I would rather not get into trying to remove the plastic inner door if possible, it will be nice for storing bottled beer and so forth.  And, I\'m a little concerned with the dripping one, do you think a new o-ring is needed, will it completely shut off as long as you are diligent in pushing it all the way back?  Maybe the emery cloth would fix it...  You know the ultimate party foul would be to come in and find 4 3/4 gal of homebrew on the floor of the garage :cry: \r\nWould you want to sell the faucets without shanks??');
INSERT INTO `phpbb_privmsgs_text` VALUES (3190,'af38397681','Hey Jim,\r\nI now have the fridge in my garage  :P \r\nJust from eyeballing it, I think the 3 inch shanks are going to be too short.  It looks like I have about 3 in of door/plastic although I have not made any holes or anything yet.  I would rather not get into trying to remove the plastic inner door if possible, it will be nice for storing bottled beer and so forth.  And, I\'m a little concerned with the dripping one, do you think a new o-ring is needed, will it completely shut off as long as you are diligent in pushing it all the way back?  Maybe the emery cloth would fix it...  You know the ultimate party foul would be to come in and find 4 3/4 gal of homebrew on the floor of the garage :cry: \r\nWould you want to sell the faucets without shanks??');
INSERT INTO `phpbb_privmsgs_text` VALUES (3191,'6d3eebf319','Sure, I\'ll sell any combination of stuff. Let me know what you want, and you can return what you don\'t.  As far as the drippy faucet, I can take it back to see if I can figure out what is causing the drip. It could be as simple as tightening the nut on the back of the slider to push out the O-ring some more, or it might be solved by putting some silicone grease (keg lube) on the O-ring. I have never seen replacement O-rings for faucets, but I can do a search. I have a Dremel tool, so it wouldn\'t be too bad to polish the inside mating surface.\r\n\r\nI would at least put some drip trays under your faucets to catch any drips anyway. The (really) cheap way would to get one of those window planters from a garden center and either set it on the floor or come up with a way to mount it on the fridge. Or spread a towel to catch the drips.\r\n\r\nOne note on mounting the shanks. Depending on what is used as insulation in the refrigerator, you may have to cut a larger hole inside so you can tighten the shank properly to the wall. If the wall is filled with fiberglass, it doesn\'t have the rigidity to really tighten down the mounting nut. In that case, the 3 inch shanks would probably work since the nut doesn\'t tighten on the inside plastic panel. This assumes you are putting the faucets on the door. The side walls are usually steel and won\'t flex as much as plastic when tightening.');
INSERT INTO `phpbb_privmsgs_text` VALUES (3192,'6d3eebf319','Sure, I\'ll sell any combination of stuff. Let me know what you want, and you can return what you don\'t.  As far as the drippy faucet, I can take it back to see if I can figure out what is causing the drip. It could be as simple as tightening the nut on the back of the slider to push out the O-ring some more, or it might be solved by putting some silicone grease (keg lube) on the O-ring. I have never seen replacement O-rings for faucets, but I can do a search. I have a Dremel tool, so it wouldn\'t be too bad to polish the inside mating surface.\r\n\r\nI would at least put some drip trays under your faucets to catch any drips anyway. The (really) cheap way would to get one of those window planters from a garden center and either set it on the floor or come up with a way to mount it on the fridge. Or spread a towel to catch the drips.\r\n\r\nOne note on mounting the shanks. Depending on what is used as insulation in the refrigerator, you may have to cut a larger hole inside so you can tighten the shank properly to the wall. If the wall is filled with fiberglass, it doesn\'t have the rigidity to really tighten down the mounting nut. In that case, the 3 inch shanks would probably work since the nut doesn\'t tighten on the inside plastic panel. This assumes you are putting the faucets on the door. The side walls are usually steel and won\'t flex as much as plastic when tightening.');
