INSERT INTO `phpbb_privmsgs_text` VALUES (4536,'070b1d15b8','I wondered if you\'d notice the peels hardening.  I find that the most amazing.  Nice combination with the lemon and orange.  I\'ve tried to suck the everclear out of a piece of pineapple before...BIG mistake.   :cry: \r\n\r\nI\'d give it try on the 22nd.  Giada on foodnetwork only steeps hers 3 days.  I think she\'s nuts (beautiful though).  The everclear is pretty strong so it may leach out enough flavor.   *) \r\n\r\nI prefer the clear version, although in the cooler weather the creamy works well.  Instead of all milk, use 1 can of sweetened condensed milk and the remainder being milk to fill your bottle.  Several cautionary statements doing this method.  Do NOT overheat the milk as it WILL burn.  Be sure the milk is cooled completely before mixing with the everclear otherwise it breaks up and somewhat curdles.  Also I use the empty everclear bottle to measure how much to add back and have found cutting back on the non-alcoholic fluid volume helps, especially with the milk to prevent it from freezing.  Give me a call Saturday, if I have time maybe I can swing by and help.  Catch me in the mash out period.  I plan on brewing a Hen\'s Tooth clone.');
INSERT INTO `phpbb_privmsgs_text` VALUES (4935,'6224c210d0','I do think you are scared of malt!\r\n\r\n 8)');
INSERT INTO `phpbb_privmsgs_text` VALUES (4491,'f88c315505','Chris,\r\n\r\nPlease bring your score sheets to the meeting on Monday, I would like to review them and  I would like to taste the beer again if you have any left.\r\n\r\nSorry about the judging.  Things like that happen in competitions, esp. in a category like yours.  The palates of the judges become numbed very quickly.\r\n\r\nMandatory classes is a good suggestion.  We are finally getting to the point in our competition that we can be more selective with non-BJCP judges so that is something to do for next year.  In the past we have not had enough BJCP and exp. judges, however, this year we actually had too many non-BJCP judges.\r\n\r\nCheers!\r\n\r\nGerald');
INSERT INTO `phpbb_privmsgs_text` VALUES (5026,'00e246b67d','Brad,\r\n\r\nI still have 2 oz. of pellets and 2 oz. of leaf Centennial.  Both unopened and frozen since I got them. Alpha 8.8-9.0.  They are likely 2-3 years old.  If you have any Spalt will trade.  Otherwise, what are they worth to you.... lol \r\n\r\nWhen is Big Brew?');
INSERT INTO `phpbb_privmsgs_text` VALUES (4527,'b93d10662d','Chris,\r\nThe White Labs Trappist ale yeast arrived yesterday. As for the brett, they haven\'t given me an expected date of arrival, but they\'re going to call me when they have it, so at that time I can let you know when I expect it.\r\n\r\nThanks for your business,\r\nSonja\r\nBet-Mar Liquid Hobby Shop');
INSERT INTO `phpbb_privmsgs_text` VALUES (4580,'537bd046d8','I\'m getting more comfortable with where the RIS is at.  I almost dropped in the oak this weekend.  I think I\'ll do it pretty soon.  Clearly the gravity is quite stable.  Mine\'s holding at 1.038 for 3 weeks now.  I agree with MAZ that carbonation will take away some of the maltiness from the palate and we can always do a dry stout.  I\'m thinking about doing that for St. Pat\'s.  One of the best beers I brewed was an all extract dry stout from Bet-Mar\'s can collection.  No grain, just add water and yeast.\r\n\r\nI was looking at your stupid beer recipe yesterday thinking I would like to make that for the summer.  Similarly, I have the braggot cold conditioning in the cooler Pete gave me.  It\'s holding at between 50-54 degrees.  I\'ll need to leave it there for 2 months.  Tasted great the last time I tested it.\r\n\r\nI\'ve been reading the Ale Trail book I won at the open.  I\'ll give it to you when I\'m done.  It\'s very fun.  I just finished the chapter on IPA\'s.  Great stuff.  Alcohol and hops as a preservative!\r\n\r\nHave you started the yeast for the Sami?  We need to get working on that bad boy pretty soon.  Marlene cleared out a piece of furniture from my brew room already.');
INSERT INTO `phpbb_privmsgs_text` VALUES (4421,'d811e55a74','Alas, no entries.   :(   Too lazy to transfer beers from swing top to crown capped bottles.  The only crown capped beer I have is in 22 ouncers so that\'s over the limit.  I have changed my bottling so I always have some crown capped bottles in the 7-16 oz range.   :D \r\n\r\nNow about this Friday night stuff.  Is there judging on Friday and all the food too.  I thought we needed the food for Saturday and were just setting up on Friday night.  I was brining bread, actually rolls because they\'ll be easier for eating and to use for cleansing the palate, but wasn\'t planning on bringing these until Saturday.  Same with coolers.   :oops:');
INSERT INTO `phpbb_privmsgs_text` VALUES (4412,'497f016a3e','Good point on the math.  The Brooklyn recipe does show I have hit my target FG.  You\'re assessment of the bourbon addition is very salient.  I think the additional bourbon/alcohol will counter any sweet/cloying/maltyness.  I also completely concur that this will be a marvelous beer.  It\'s just going to take time.  I think we both expected that with such a high OG.  Stick it in the corner of a room and wait.');
