INSERT INTO `phpbb_privmsgs_text` VALUES (5047,'f6067edcdb','well...\r\n\r\nWhat he is saying first is test your flow rate.  What he says is turn your grill on high and stand by the meter and see how long for 1CF.  Being that I was told that we can run multiple appliances off of one meter I don\'t know this is totally true though.  I\'m running probably close to 200BTU with my furnaces and I\'m told I can run a stove, hot water and even a fireplace at the same time.  This would probably be almost 500,000BTU....\r\n\r\nI just called SCE&amp;G,  thats the easy way right?\r\n\r\n:)');
