INSERT INTO `phpbb_privmsgs_text` VALUES (4331,'af0f0d978f','Hopefully Randy will email me soon and I will ask him.  Who knows how he is about checking email though.  I have already prepaid Bet-mar for 10 lbs of brown malt and suppossedly it should be delivered by Friday.  When it gets in I am buying the rest of the ingredients I need for batch.  then.... after that I think I will send bet-mar a note about customer loyalty and ingredient prices.  Last night I added up every purchase I made at bet-mar from one year ago to now and it topped $1,300.  Hopefully, I can draft an email to them without sounding like a jackass and let them know that if I find better prices via mail order, bulk buy, aiken brewing, or hunter gatherer, then bet-mar will loose my business.  what do you think?');
