INSERT INTO `phpbb_privmsgs_text` VALUES (4216,'9cfd6920f0','[quote:9cfd6920f0=\"Sonja Burris\"]Yes, Nov 17th is perfect. \r\nWe need to know the approx. # of people so we can get brats (assuming that someone brings a grill).  Of course, umbrellas, tents etc never hurt either.\r\n\r\nThanks for following up. We are looking forward to it.\r\n\r\nSonja &amp; Mark[/quote:9cfd6920f0]\r\n\r\nAre you supplying buns? \r\nWas there a estimated head count at the meeting last night? If not, I would say 4-5 packs of the stadium brats. Gary Kunes will be cooking ribs.\r\nI\'ll be bringing a side dish and chips to snack on.');
INSERT INTO `phpbb_privmsgs_text` VALUES (4987,'0043f616e1','Vienna:\r\n$4.50   1.5 oz tettnanger (did you bring some or did we use all mine?)\r\n$1.00   0.6 oz herbrucker\r\n$11.24  10.3lbs pilsner malt, vienna malt, munich malt\r\n$1.50   .75lbs caramunich I, caramunich III, Crystal 120L, Carafa\r\n$4.00  1lb DME (for starter)\r\n$3.00 1/2 of the yeast\r\n\r\nSamiclaus:\r\nwe both have the pilsner malt we need\r\n$ 2.0 lbs Vienna malt\r\n$ 1.5 lbs Carahell malt\r\nWE NEED! cane sugar\r\n$6.00 2.0ish oz Northern Brewer Hops (did you say you had some of these hops-   I *think* I have enough if we need it.)\r\n$1.50 .5ish oz Tettnang hops\r\n$1.50 .5 oz Hallertauer mittelfruh hops\r\n\r\n\r\nAlt Bev: (there is a 10% discount but then we have to pay 6% tax...   to make it easy I just charge 4% for gas  :wink: )\r\n$63.39 Fawcet Marris Otter malt\r\n$58.99 Weyermann Pils malt\r\n\r\n\r\nOh and BTW-   JP (the guy who posts but never shows up) says he can weld AND has the equipment-   so probably 20 bucks and a 6 pack of homebrew or something to fix the mailbox!');
INSERT INTO `phpbb_privmsgs_text` VALUES (4895,'4da62ea456','Yeah Chris, that would be great.  I think i\'ll stick to Briess for now.  Let me screw up a cheap bag before going for the expensive stuff.  The price on his site was 39 something.  How much do you want me to kick in for gas money?  Let me know and i\'ll get a check to you.');
INSERT INTO `phpbb_privmsgs_text` VALUES (4219,'a62929bdd9','I noticed that about the refractometers.  The $47 price is for ATC and 0-32 brix.  We could bag the whole Bet-Mar thing and do it at one of our houses.\r\n\r\nSorry I didn\'t make the meeting last night.  I was up by 5:30 Sat and Sun for soccer games.  Evan broke his finger Sunday.  It was stepped on when he made a save.  I also over served myself Sunday and had to clean up my brewing equipment in the pool area.  I was in bed early last night.');
INSERT INTO `phpbb_privmsgs_text` VALUES (4835,'792d323dca','Gary,\r\n\r\nI hope your doing well!\r\n\r\nMy wedding is firming up and I hope your still available on August 9th for our reception.\r\n\r\nI guess we need to figure out the details so my fiance can stress out about other issues!\r\n\r\nBased upon our conversations earlier I recall $350 will cover enough BBQ for 80 people including the pig, the rub, the sauce, and the equipment required.  What do you usually like for a deposit?\r\n\r\nthx!\r\nChris');
