INSERT INTO `phpbb_privmsgs_text` VALUES (4227,'f876b522cb','Jamie, \r\n\r\nHere is the plan:\r\n\r\nOn the 24th, Arrive Alternative Beverage @ noon, pick up beer and swag, deliver beer to Harold(most of it, I may get thristy), sort through swag and see what got \"Lost\", give rest to Harold. \r\n\r\nYou said something about a sink you need to go up?');
INSERT INTO `phpbb_privmsgs_text` VALUES (4228,'ca01debd94','[quote:ca01debd94=\"PrestonCraig\"]Jamie, \r\n\r\nHere is the plan:\r\n\r\nOn the 24th, Arrive Alternative Beverage @ noon, pick up beer and swag, deliver beer to Harold(most of it, I may get thristy), sort through swag and see what got \"Lost\", give rest to Harold. \r\n\r\nYou said something about a sink you need to go up?[/quote:ca01debd94]\r\n\r\nCool. some how we need to meet up and load the sink in your truck. Will Friday (after Turkey Day or Saturday be better?) I am going to Asheville on Friday morning. I should be back around 3:00 or so.\r\n\r\n\r\nTodd Bowman will meet you at Alt Bev on Saturday and give you a envelope *) You look around to see if anyone is following you and high tail it back home. I\'ll meet you at a discreet location and scream \"The eagle has landed\" \r\n\r\nBe sure to sort out the good \"Lost\" stuff and remember, if you drink, don\'t drive. You may hit a pot hole and spill it.');
