INSERT INTO `phpbb_privmsgs_text` VALUES (4869,'1e6f4e610a','Hi!\r\n\r\nNo worries-    The way I view AIM is if someone is free they can get back to me-   if they are busy then they won\'t!\r\n\r\nA couple of us are going to brew the Chateau Jiahu and I had a couple questions;\r\n\r\na) Did you find a good place to get the Hawthorn berry\r\npowder?   I\'m finding all kinds of Chinese herb shops online, some of which seem a little um... dodgy!  \r\n\r\nb) how did you like the Sake yeast?  Did you make a starter?  It looks like Northern Brewer keeps it in stock-   we are hoping to brew Fri but the yeast starter might be the biggest hold up!\r\n\r\nThanks in advance!\r\n\r\nChris');
