INSERT INTO `phpbb_privmsgs_text` VALUES (4921,'d4cef500c9','http://www.herbalremedies.com/hawthornberry.html\r\n\r\nthe sake yeast was fine. we kind of jacked the recipe - 11 lbs of honey. we ended right at 25 brix ... at the topend of what sake yeast can handle. \r\n\r\ni took an og and an fg and ran it through promash and my batch at least was around 12%.\r\n\r\nwe also used yeast nutrient.\r\n\r\ni don\'t know if i\'d classify it as a beer - prob more in line with a braggot since we did use grain to supliment the process. \r\n\r\nwe did make a big starter and stepped it once\r\n\r\nmine is a little sweet like a meed but not dry. tasty - different.');
