INSERT INTO `phpbb_privmsgs_text` VALUES (4875,'3e618a3e09','Carl,\r\n\r\nI\'m not sure if I can make it sat but the \"rumor\" is that Randy might be interested into letting people tack onto a bulk grain buy.  If I\'m not there would you mind asking? \r\n\r\nMy personal thought is that as much as I would love to see the club form a buying co-op for grain.  That this might not be in the best interests of the club.  My vote would be the co-op though! If Randy would let us do it via him we can avoid pissing her off too much!  \r\n\r\nWe do not get any members from Sonja BUT if we alienate her she could bad mouth PSB.  One fellow I\'ve been talking brewing with a lot lately bought something like $2,500 worth of stuff from Sonja in the past year and she not once told him about the club.  I wonder if it might have to do with her not wanting to give the 10% discount!  As a side note he might show up and meet you all in Aiken-  His name is Allen.  He met us at the last Bet-Mar brew session-   was just there by luck.\r\n\r\n-C');
