INSERT INTO `phpbb_privmsgs_text` VALUES (4985,'ebe57d182f','The UPS guy loves me!   He brought everything today for our brew!\r\n\r\nI also went though and figured up your portion-   wow this is the most expensive beer I\'ve brewed in a while even with no hops.  I guess its the rice, honey and mostly that hawthorn berry power.  \r\n\r\n$13.50 11 lb. 6 oz. (5.2 kg) two-row pale malt\r\n$8.75 3.0 lbs. (1.4 kg) orange blossom honey\r\n$10.00 2.0 lbs. (0.91 kg) rice syrup\r\n$3.75 1.0 lb. (0.45 kg) Alexanders Muscat grape juice concentrate\r\n$13.00 0.5 lbs. Hawthorn berry powder\r\n$0.50 0.25 oz. (7.1 g) Simcoe hops (60 mins)\r\n$2.87 1/2 of the Wyeast 4134 (Sake #9) yeast \r\n$3.00 DME for starter\r\n$4.00 shipping\r\n\r\nThe starter looks like it should be a 3 step starter (little over 700 billion cells)  or otherwise call it 6-9 days-   we can probably cheat a little and shorten the time though depending on your availability.  I look available anytime before sat.  I think I\'m busy sat-mon and then available tue-friday.  We might be able to do it next sat before our party too-  are you planning on coming on the 22nd?\r\n\r\nSo- what does your schedule look like?\r\n\r\n1L\r\n1/2G\r\nsplit then 2- 1/2G');
