INSERT INTO `phpbb_privmsgs_text` VALUES (4492,'f88c315505','Chris,\r\n\r\nPlease bring your score sheets to the meeting on Monday, I would like to review them and  I would like to taste the beer again if you have any left.\r\n\r\nSorry about the judging.  Things like that happen in competitions, esp. in a category like yours.  The palates of the judges become numbed very quickly.\r\n\r\nMandatory classes is a good suggestion.  We are finally getting to the point in our competition that we can be more selective with non-BJCP judges so that is something to do for next year.  In the past we have not had enough BJCP and exp. judges, however, this year we actually had too many non-BJCP judges.\r\n\r\nCheers!\r\n\r\nGerald');
