INSERT INTO `phpbb_privmsgs_text` VALUES (5064,'871ec4b8c6','[quote:871ec4b8c6=\"Pete Goodwin\"]Yikes!  $13 for the Hawthorne berry powder?  Well it is for a good cause.  Looks like I owe you a check for about $60 plus.  The cost is not too different than an extract beer or mead so Im used to it.\r\n\r\nIt is pretty tough for me to brew during a week unless I leave work early.  How about trying next Friday?  I can maybe plan to leave work about 1pm.\r\n\r\nI plan to be at your party on the 22nd.  What can I bring?[/quote:871ec4b8c6]\r\n\r\nAre we still on for tomorrow?\r\n\r\n\r\nI\'ve been cutting down trees and brewing a whitte today!   Sawdust helps in the mash I think   8)');
