INSERT INTO `phpbb_privmsgs_text` VALUES (4783,'46b22c0069','slicing the beans long ways.. scraping the insides out and putting them in a shot glass.. cut the remainder of the outer shell into pieces that will fit in the shot glass.. add some vodka til the beans are covered.. let sit for week or two.. add the vanilla vodka mixture to your beer at kegging.. (straining the contents of course)\r\n\r\nhope that helps..\r\n\r\nBeen using 2 lately and needing more vanilla umphh.. so if you need to add more vanilla, maybe a small amount of extract to compensate.');
